INSERT INTO `posts` (`id`, `lang_id`, `title`, `title_slug`, `title_hash`, `keywords`, `summary`, `content`, `category_id`, `image_big`, `image_default`, `image_slider`, `image_mid`, `image_small`, `image_mime`, `image_storage`, `optional_url`, `pageviews`, `need_auth`, `is_slider`, `slider_order`, `is_featured`, `featured_order`, `is_recommended`, `is_breaking`, `is_scheduled`, `visibility`, `show_right_column`, `post_type`, `video_path`, `video_storage`, `image_url`, `video_url`, `video_embed_code`, `user_id`, `status`, `feed_id`, `post_url`, `show_post_url`, `image_description`, `show_item_numbers`, `updated_at`, `created_at`) VALUES
(926, 1, 'Китай, Android и чипы RISC-V: зачем китайские компании добавляют поддержку открытой архитектуры в мобильную ОС', 'kitay-android-i-chipi-risc-v-zachem-kitayskie-kompanii-dobavlyayut-podderzhku-otkritoy-arkhitekturi-v-mobilnuyu-os', NULL, 'itfox, habr, community, programming community, turkmenportal', 'Несколько дней назад на сайте RISC-V появилась новость о том, что китайцам удалось добавить поддержку архитектуры RISC-V в Android. На самом деле, никакой сенсации в этом нет — китайские компании занимаются этим проектом уже несколько лет. Да и успех пока неполный — поддержка пока лишь частичная (в частности, речь идет об Android Open Source Project, но все равно, продвижение очень заметное. Но зачем это Поднебесной?', '<h3>Новая архитектура, ее перспективы и мобильная ОС</h3>\r\n<p><span style=\"color: #eb4247;\"></span><br /><span>Китай, на самом деле, развивает технологии на базе RISC-V&nbsp;</span>весьма активно<span>. Так, в Поднебесной уже создан процессор, а на его основе &mdash; первый ноутбук, который работает на процессоре с архитектурой RISC-V.</span><br /><br /><span>Кроме того, летом 2022 года стало известно о том, что в Китае разрабатывается архитектура RISC-X, которая, как можно понять по названию, базируется на RISC-V. При этом, как и основа, новая технология будет открытой и бесплатной, причем не только для китайцев, но и для компаний из любых других стран.</span><br /><br /><span>Зачем это все? Дело в том, что Поднебесная находится под санкциями США в отношении технологий производства современных чипов, причем эти санкции постепенно становятся все более жесткими. Плюс архитектуры в том, что это открытая технология, и на ее основе можно развивать какие угодно решения, без необходимости отчислять лицензионные платежи.</span></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3ba3a4f21.jpg\" alt=\"\" /></p>\r\n<p><span>Поэтому Поднебесная крайне заинтересована в этой архитектуре, не только в плане производства ноутбуков или десктопов, но и мобильных устройств. Сейчас стало известно о том, что поддержку RISC-V в мобильную ОС добавила Alibaba Cloud. Команда разработчиков представила около 80 патчей для AOSP, которые дают возможность системе корректно работать с RISC-V. Речь идет как о мультимедийных функциях, так и беспроводной связи.</span><br /><br /><span>Из представленных патчей около трети уже интегрированы в состав AOSP, а остальные &mdash; на пути интеграции. До завершения работы &mdash; еще несколько месяцев, но, насколько можно понять, огромный участок работы уже выполнен. Если все получится, а в этом, наверное, можно уже не сомневаться, то в будущем мобильные устройства из Китая и других стан смогут перейти на архитектуру RISC-V, ничего не потеряв в функциональности и возможностях.</span><br /><br /><span>Ну и речь идет не только о смартфонах, если все пойдет хорошо, то RISC-V чипы можно будет использовать в умных телевизорах, планшетах и IoT-системах, в связке с Android OS.</span></p>\r\n<p><span></span></p>\r\n<h3>Не только Китай</h3>\r\n<p><span><span style=\"color: #eb4247;\"></span><br />В развитии RISC-V архитектуры и переводе на нее различных типов устройств заинтересованы не только китайцы, но и другие страны. Об этом можно судить хотя бы потому, что в новых проектах организация RISC-V International принимает непосредственное участие. Ну а ее можно назвать глобальной &mdash; в нее входит около 1000 компаний и организаций из 50 стран.<br /><br />В рамках упомянутой организации даже создана специальная рабочая группа Android SIG. Сейчас она сообщает об успехах с AOSP, но влияние группы довольно сильное, так что в обозримом будущем, вероятно, можно будет говорить и об добавлении архитектуры RISC-V в обычный Android, а его развитием, как известно, занимается Google. Если это произойдет, то производители электроники станут выпускать разнообразные типы гаджетов на базе указанной архитектуры.<br /><br />В Linux, к слову, ее поддержку добавили несколько лет назад, в 2018 году, начиная с версии 4.15.<br /><br />У RISC-V International есть так называемая дорожная карта добавления поддержки RISC-V архитектуры в Android, и насколько можно судить, пока что этапы этого проекта реализуются успешно.</span></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3bc91ad1e.jpg\" alt=\"\" /></p>\r\n<p><span>К слову, в России также активно занимаются развитием технологий на базе RISC-V. В сентябре в РФ был организован альянс, который ставит своей целью развивать архитектуру RISC-V в России, включая выпуск новых систем на базе этой архитектуры. В ассоциацию вошли достаточно крупные игроки, включая Yadro и &laquo;Байкал электроникс&raquo;, а также разработчик ОС Astra Linux группа &laquo;Астра&raquo;, разработчик технологической программно-аппаратной платформы Vostok и НИУ &laquo;Московский институт электронной техники&raquo;. Стоит отметить, что первые две организации уже занимаются разработкой чипов на базе этой архитектуры. Называется ассоциация &laquo;Альянс RISC-V&raquo;.</span><br /><br /><span>Участники, имея неплохой опыт в отрасли RISC-V, планируют развивать экосистему отечественных решений. В частности, планируется обеспечить совместимость этих решений, создание полигона для их тестирования, а также создать общую базу, доступ к которой получат все члены ассоциации. На разработку отечественных RISC-V чипов планируется выделить почти 28 млрд руб. Если с внедрением поддержки архитектуры в Android будет все хорошо, вполне может быть, что в РФ появятся и собственные мобильные устройства &mdash; но, конечно, об этом пока рано говорить.</span></p>\r\n<p><span></span></p>\r\n<h3>Что еще?</h3>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3be8ab68a.jpg\" alt=\"\" /></p>\r\n<p><span>В Китае работают еще и над архитектурой RISC-X, которая базируется на RISC-V. При этом, как и основа, новая технология будет открытой и бесплатной, причем не только для китайцев, но и для компаний из любых других стран. Китайцы мыслят масштабно, поэтому новая архитектура для них &mdash; запасной вариант на случай, если США попытается при помощи санкций &laquo;отлучить&raquo; их и от RISC-V, несмотря на открытость этой технологии.</span><br /><br /><span>Ну и да, Индия тоже работает над развитием собственной архитектуры RISC-V. Летом 2022 года правительство страны разработало и анонсировало дорожную карту для проектирования и производства полупроводниковых компонентов, которые базируются на архитектуре RISC-V. Поставлять чипы мирового класса в больших объемах страна собирается к лету следующего года.</span><br /><br /><span>Вероятно, эти &laquo;дочерние&raquo; архитектуры будут также поддерживаться Android с интегрированной поддержкой RISC-V, и в этом случае уже никто не сможет повлиять на дальнейшее развитие производства электроники в Китае, Индии и других странах.</span><br /><br /><span>В целом, все идет хорошо, что не может не радовать. Ну а пока ждем дальнейших сообщений от групп, которые пытаются &laquo;подружить&raquo; мобильную ОС от Google и открытую архитектуру RISC-V.</span></p>', 1, 'uploads/images/2022/10/image_750x500_635a3b790d6fc.jpg', 'uploads/images/2022/10/image_750x_635a3b791f4d9.jpg', 'uploads/images/2022/10/image_600x460_635a3b792da4a.jpg', 'uploads/images/2022/10/image_380x226_635a3b793c920.jpg', 'uploads/images/2022/10/image_140x98_635a3b7946d86.jpg', 'jpg', 'local', '', 23, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-27 10:07:25'),
(927, 1, 'Rust\'ерзание краба. Пробуем реверсить Rust удобно', 'rusterzanie-kraba-probuem-reversit-rust-udobno', NULL, '', 'Вступление\r\nRust как язык программирования только набирает обороты и находит своих почитателей. Он не только предлагает множество надстроек для безопасности кода, но с недавнего времени еще и появился в ядре Linux.', '<p>В этой статье мы посмотрим на него с \"обратной\" стороны, а именно попробуем пореверсить программу, написанную на Rust, и выяснить, что можно сделать, чтобы сделать ее анализ проще. Рассмотрим утилиты, приложения и плагины, а также напишем свой плагин для IDA Pro, Cutter и rizin, чтобы автоматически создать сигнатуры для исполняемого файла без отладочных символов. Поговорим о FLIRT-сигнатурах, их преимуществах и недостатках и о том, можно ли автоматизировать их создание.</p>\r\n<p>В качестве примера будем рассматривать задачу с<span>&nbsp;</span><strong>BSidesSF CTF 2020</strong><span>&nbsp;</span>под названием<span>&nbsp;</span><a href=\"https://github.com/BSidesSF/ctf-2020-release/blob/master/rusty2/challenge/src/src/main.rs\">rusty2</a>. Создаем две версии исполняемого файла: один с отладочными символами и без strip, а второй без отладочных символов со strip. Второй вариант используется чаще всего в реальных проектах.</p>\r\n<p>Собирать будем с помощью менеджера пакетов<span>&nbsp;</span><strong>cargo 1.63.0</strong>:</p>\r\n<p>- релизную версию &mdash;<code>cargo build --release</code></p>\r\n<p>- дебаг сборку &mdash;<span>&nbsp;</span><code>cargo build</code></p>\r\n<p>Использовался компилятор<span>&nbsp;</span><strong>stable</strong><span>&nbsp;</span>версии<span>&nbsp;</span><strong><em>1.63.0</em></strong>.</p>\r\n<h2>Плагины</h2>\r\n<p>В статье мы рассмотрим три плагина, два из который для<span>&nbsp;</span><strong>IDA Pro</strong>:</p>\r\n<p>-<span>&nbsp;</span><a href=\"https://github.com/cha5126568/rust-reversing-helper\">rust-reversing-helper</a></p>\r\n<p>-<span>&nbsp;</span><a href=\"https://github.com/BackdoorRE/idapro-rust\">idapro-rust</a></p>\r\n<p>-<span>&nbsp;</span><s>Что-то свое?</s></p>\r\n<h3>rust-reversing-helper</h3>\r\n<p>По заверению автора, этот плагин для<span>&nbsp;</span><strong>IDA Pro</strong><span>&nbsp;</span>помогает с деманглингом имен функций и изменением соглашений о вызове функций.</p>\r\n<p>Проверим работу плагина на сборке с отладочными символами. Деманглинг имен функций в IDA автоматический, поэтому проверим вторую функцию.</p>\r\n<p>До работы плагина мы имеем следующий вид программы:</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3d09d278d.jpg\" alt=\"\" /></p>\r\n<p><span>После его выполнения получаем такой вид:</span></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3d2dc09fa.jpg\" alt=\"\" /></p>\r\n<p><span>Функции, которые стали&nbsp;</span><strong>Library function</strong><span>, &mdash; измененные плагином. Например, функция&nbsp;</span><strong>core::panicking::assert_failed_usize_usize__1</strong><span>&nbsp;до преобразования выглядела так:</span></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3d4180f39.jpg\" alt=\"\" /></p>\r\n<p><span>А после преобразования мы получаем следующий вид:</span></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3d607eeea.jpg\" alt=\"\" /></p>\r\n<p>В данном случае скрипт изменил функцию неверно, поскольку она должна принимать 4 агрумента, и к тому же не должна возвращать ничего.</p>\r\n<p>На сборке без отладочных символов скрипт закончил свою работу без каких либо изменений.</p>\r\n<p>В целом, плагин довольно интересный, но сильно помочь в реверсе Rust, на мой взгляд, не может.</p>\r\n<h3>idapro-rust</h3>\r\n<p>Плагин состоит из Rust-кода и трех скриптов на Python. Основная задача плагина &mdash; сбор информации о функциях: начало и конец кода, соглашение о вызовах, имена и т.д.</p>\r\n<p>Выводит информацию в JSON-формате. Показывать его работу особо смысла не имеется.</p>\r\n<p>Может помочь при реверсе, если необходимо, например, найти определенные функции по признакам или просто собрать информацию.</p>\r\n<h3>Дизассемблеры / декомпиляторы</h3>\r\n<p>Дизассемблеры, которые могут помочь в реверсе программ на Rust:</p>\r\n<p>-<span>&nbsp;</span><a href=\"https://hex-rays.com/ida-pro/\">IDA Pro</a></p>\r\n<p>-<span>&nbsp;</span><a href=\"https://github.com/rizinorg/cutter\">Rizin/Cutter</a></p>\r\n<p>-<span>&nbsp;</span><a href=\"https://github.com/NationalSecurityAgency/ghidra\">Ghidra</a></p>\r\n<p>Это выбор каждого. Просто посмотрим, как одна и та же функция main выглядит в каждом из них.</p>\r\n<p>IDA Pro:</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3d80ddb62.jpg\" alt=\"\" /></p>\r\n<p><span>Rizin/Cutter:</span></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3d940b43d.jpg\" alt=\"\" /></p>\r\n<p><span>Ghidra:</span></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3dad9b906.jpg\" alt=\"\" /></p>\r\n<p>Если начать сравнивать, то можно увидеть, что в декомпиляторе HexRays есть проблема с определением адреса прыжка (JUMPOUT). Это не очень критично, но неприятно. Остальные декомпиляторы справились хорошо.</p>\r\n<h2>FLIRT-сигнатуры</h2>\r\n<p>FLIRT-сигнатуры &mdash; это база с соответствием имен функций и их первых байт кодов. Позволяет при реверсе приложения без отладочных символов определить часть функций, для которых первые байты кода совпадут с одной из сигнатур. Такая возможность существует в<span>&nbsp;</span><strong>IDA Pro</strong><span>&nbsp;</span>и<span>&nbsp;</span><strong>Cutter</strong>.<span>&nbsp;</span><strong>Ghidra</strong><span>&nbsp;</span>пока такого не умеет.</p>\r\n<p>Казалось бы, очень хороший способ определять функции &mdash; создавать статический бинарный файл, содержащий нужные функции, извлекать сигнатуры и использовать где угодно. Но тут есть свои подводные камни. Из-за ограничения на количество первых записываемых байт сигнатуры могут подвергаться коллизиям, поэтому придется либо решать, какую функцию вы хотели бы оставить, либо убрать обе. В больших файлах может получаться большое количество коллизий, что уменьшит эффективность использования такого подхода.</p>\r\n<p>Еще можно добавить, что сигнатуры сильно зависят от оптимизаций, применяемых при компиляции или линковке. Чем более похожие оптимизации будут у целевого файла и того, откуда были сгенерированы сигнатуры, тем лучше будет результат распознавания.</p>\r\n<p>Тем не менее это очень удобный способ с ходу распознать часть функции в бинарном файле.</p>\r\n<h2>Собственный плагин</h2>\r\n<p>Все способы, описанные выше, имеют свое применение в определенных условиях. Но ведь можно не только пользоваться, но и создавать свое. Мы попробуем написать плагин для<span>&nbsp;</span><strong>IDA Pro</strong>,<span>&nbsp;</span><strong>Cutter</strong><span>&nbsp;</span>и<span>&nbsp;</span><strong>rizin</strong>, который будет автоматически создавать сигнатуры для исполняемых файлов или библиотек, написанных на языке Rust и собранных без отладочных символов.</p>\r\n<p>Чтобы создать сигнатуры, нужно скомпилировать свой бинарный файл с отладочными символами. А для этого нам нужно знать, какие функции этот файл должен содержать.</p>\r\n<p>Для начала посмотрим, какую информацию можно вынести из скомпилированного файла, написанного на Rust. С виду он выглядит как обычный исполняемый файл с кучей функций (около 700 в нашем примере). Самое интересное для нас находится в строках. Замечу, что чаще всего оказывается, что строки в Rust не заканчиваются нулем. Компилятор хранит большую часть строковых типов как ссылку на ее начало и длину. В некоторый случаях (как в типе String) еще ее максимальную вместимость до выделения большего объема памяти.</p>\r\n<p>И все же там можно увидеть очень много полезного, потому что строки для вывода ошибок строго прописаны. Например, можно найти путь до модуля или библиотеки на стороне создателя файла. А еще там прописаны названия используемых библиотек и их версии. Для нашего примера это будет выглядеть так:</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3dcd9684e.jpg\" alt=\"\" /></p>\r\n<p>Имея эту информацию, мы можем посмотреть эти библиотеки в<span>&nbsp;</span><a href=\"https://docs.rs/\">документации</a>. Там есть раздел для функций, откуда можно взять их шаблоны и примеры использования.</p>\r\n<p>Постепенно у нас вырисовывается план, как будет работать наш плагин:</p>\r\n<p>1. Ищем строки в бинарной файле</p>\r\n<p>2. Регулярным выражением выделяем библиотеки и их версии</p>\r\n<p>3. В документации находим нужные библиотеки и информацию об их функциях</p>\r\n<p>4. Создаем свой Rust-проект и пытаемся добавить в него как можно больше функций</p>\r\n<p>5. Компилируем с отладочными символами</p>\r\n<p>6. Генерируем сигнатуры для дальнейшего использования</p>\r\n<p>Пройдемся по каждому пункту. Тут я буду писать про плагин для<span>&nbsp;</span><strong>IDA Pro</strong>, но в целом для<span>&nbsp;</span><strong>Cutter</strong><span>&nbsp;</span>и<span>&nbsp;</span><strong>rizin</strong><span>&nbsp;</span>будет примерно такая же ситуация.</p>\r\n<h3>Находим строки в бинарной файле</h3>\r\n<p>Тут ничего сложного. С помощью средств idapython вытягиваем все строки в файле. Код выглядит так:</p>\r\n<pre><code class=\"python hljs\"><span class=\"hljs-keyword\">import</span> idautils\r\nsc = idautils.Strings()</code></pre>\r\n<h3>Регулярным выражением выделяем библиотеки и их версии</h3>\r\n<p>С этим тоже трудностей не предвидится. Берем библиотеку<span>&nbsp;</span><strong>**re**</strong><span>&nbsp;</span>и с ее помощью достаем нужную нам информацию и преобразуем в множество (set), чтобы убрать повторяющийся элементы:</p>\r\n<pre><code class=\"python hljs\"><span class=\"hljs-keyword\">import</span> idautils\r\n<span class=\"hljs-keyword\">import</span> re\r\n\r\nsc = idautils.Strings()\r\n\r\npattern = re.compile(<span class=\"hljs-string\">r\'([\\w\\d\\-_]+)-(\\d\\.\\d+\\.\\d+)\'</span>)\r\nlibs = set(re.findall(pattern, <span class=\"hljs-string\">\'\'</span>.join(map(str, sc))))\r\n\r\nprint(<span class=\"hljs-string\">f\'Found <span class=\"hljs-subst\">{len(libs)}</span> libraries!\'</span>)\r\n\r\n<span class=\"hljs-keyword\">for</span> lib, version <span class=\"hljs-keyword\">in</span> libs:\r\n    print(<span class=\"hljs-string\">\'{} = {}\'</span>.format(lib, version))</code></pre>\r\n<h3>В документации находим нужные библиотеки и информацию об их функциях</h3>\r\n<p>Для запросов к документации будем использовать библиотеку<span>&nbsp;</span><strong>requests</strong>. А для парсинга html страниц &mdash;<span>&nbsp;</span><strong>BeautifulSoup4</strong>. Информация о библиотеке по ее версии можно найти по адресу<span>&nbsp;</span><strong>https://docs.rs/{lib_name}/{lib_version}</strong>. А список функций - по адресу<span>&nbsp;</span><strong>https://docs.rs/{lib_name}/{lib_version}/#functions</strong>. Потом с помощью html-парсера находим ссылки на сами функции. Эти действия вынесем в функцию:</p>\r\n<pre><code class=\"python hljs\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">get_lib_funcs</span><span class=\"hljs-params\">(lib, ver)</span>:</span>\r\n    <span class=\"hljs-string\">\'\'\'Get all functions html path\'\'\'</span>\r\n\r\n    url = <span class=\"hljs-string\">\'https://docs.rs/{}/{}\'</span>\r\n\r\n    r = requests.get(url.format(lib, ver) + <span class=\"hljs-string\">\'/#functions\'</span>)\r\n\r\n    soup = BeautifulSoup(r.text, <span class=\"hljs-string\">\'html.parser\'</span>)\r\n\r\n    result = []\r\n    <span class=\"hljs-keyword\">for</span> link <span class=\"hljs-keyword\">in</span> soup.find_all(<span class=\"hljs-string\">\'a\'</span>, attrs={<span class=\"hljs-string\">\'class\'</span>: <span class=\"hljs-string\">\'fn\'</span>}):\r\n        result.append(link.get(<span class=\"hljs-string\">\'href\'</span>))\r\n\r\n    <span class=\"hljs-keyword\">return</span> result</code></pre>\r\n<p>После этого мы можем посмотреть на шаблон функции и на примеры ее использования. В плагине будет использоваться два подхода. В нем определены переменные с наиболее распространенными типами в Rust. Каждый раз, когда проверяется информация о функции, плагин смотрит на ее шаблон, и, если у нее нет аргументов или аргументы имеют определенные типы, то мы можем просто вызвать ее внутри нашего проекта без дополнительных действий.</p>\r\n<p>Если аргументы имеют неизвестный для плагина вид, можно попытаться взять код из примера в документации, оформить его как функцию и вынести ее в отдельный модуль. А затем в нашем проекте вызвать ее.</p>\r\n<p>Так будем доставать код функции:</p>\r\n<pre><code class=\"python hljs\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">get_func_code</span><span class=\"hljs-params\">(lib: str, ver: str, func=<span class=\"hljs-string\">\'\'</span>)</span>:</span>\r\n    <span class=\"hljs-string\">\'\'\'Get single function code from it\'s html page\'\'\'</span>\r\n\r\n    url = <span class=\"hljs-string\">f\'https://docs.rs/<span class=\"hljs-subst\">{lib}</span>/<span class=\"hljs-subst\">{ver}</span>/<span class=\"hljs-subst\">{lib.replace(\"-\", \"_\")}</span>/<span class=\"hljs-subst\">{func}</span>\'</span>\r\n\r\n    soup, examples = get_example(url)\r\n\r\n    check_template(soup, lib)\r\n\r\n    <span class=\"hljs-keyword\">if</span> examples:\r\n        <span class=\"hljs-keyword\">return</span> map(<span class=\"hljs-keyword\">lambda</span> x: x.text, examples)\r\n\r\n\r\n    <span class=\"hljs-keyword\">return</span> <span class=\"hljs-literal\">None</span></code></pre>\r\n<p>В<span>&nbsp;</span><strong>get_func_code</strong><span>&nbsp;</span>функция<span>&nbsp;</span><strong>check_template</strong><span>&nbsp;</span>проверяет шаблон функции на наличие аргументов. Если они есть, смотрит их тип и решает, сможем ли мы у себя в проекте ее вызвать с аргументами. Дальше мы достаем код из примера использования и работаем уже с ним.</p>\r\n<p>Стоит добавить, какие типы аргументов будет поддерживать плагин, потому что кастомные и generic типы сложно вывести заранее. Поддерживаемые типы (будет mut в скобках если добавлены изменяемые и неизменяемый типы):</p>\r\n<pre><code class=\"rust hljs\">(<span class=\"hljs-keyword\">mut</span>) <span class=\"hljs-built_in\">str</span>, (<span class=\"hljs-keyword\">mut</span>) <span class=\"hljs-built_in\">String</span>, <span class=\"hljs-built_in\">bool</span>, <span class=\"hljs-built_in\">u8</span>, <span class=\"hljs-built_in\">u16</span>, <span class=\"hljs-built_in\">u32</span>, <span class=\"hljs-built_in\">u64</span>, <span class=\"hljs-built_in\">i8</span>, <span class=\"hljs-built_in\">i16</span>, <span class=\"hljs-built_in\">i32</span>, <span class=\"hljs-built_in\">i64</span>, \r\n(<span class=\"hljs-keyword\">mut</span>) <span class=\"hljs-built_in\">char</span>, &amp;(<span class=\"hljs-keyword\">mut</span>) [<span class=\"hljs-built_in\">u8</span>], &amp;(<span class=\"hljs-keyword\">mut</span>) [<span class=\"hljs-built_in\">u16</span>], &amp;(<span class=\"hljs-keyword\">mut</span>) [<span class=\"hljs-built_in\">u32</span>], &amp;(<span class=\"hljs-keyword\">mut</span>) [<span class=\"hljs-built_in\">u64</span>], \r\n&amp;(<span class=\"hljs-keyword\">mut</span>) [<span class=\"hljs-built_in\">i8</span>], &amp;(<span class=\"hljs-keyword\">mut</span>) [<span class=\"hljs-built_in\">i16</span>], &amp;(<span class=\"hljs-keyword\">mut</span>) [<span class=\"hljs-built_in\">i32</span>], &amp;(<span class=\"hljs-keyword\">mut</span>) [<span class=\"hljs-built_in\">i64</span>], <span class=\"hljs-built_in\">usize</span>, <span class=\"hljs-built_in\">isize</span>, \r\n&amp;(<span class=\"hljs-keyword\">mut</span>) <span class=\"hljs-built_in\">usize</span>, &amp;(<span class=\"hljs-keyword\">mut</span>) <span class=\"hljs-built_in\">isize</span>, <span class=\"hljs-built_in\">f32</span>, <span class=\"hljs-built_in\">f64</span>, &amp;<span class=\"hljs-built_in\">str</span></code></pre>\r\n<p>Если типы аргументов не поддерживаются, попытаемся взять пример из документации.</p>\r\n<p>При желании, можно добавить свои типы в глобальные переменные<span>&nbsp;</span><strong>VARIABLES</strong>,<span>&nbsp;</span><strong>DEFINES</strong>.</p>\r\n<h3>Создаем свой Rust проект</h3>\r\n<p>Проект будем создавать с помощью команды<span>&nbsp;</span><code>cargo new {project_name} --lib --vcs none</code>. С помощью нее мы получим готовый проект для создания библиотеки.</p>\r\n<p>Теперь наша задача &mdash; добавить библиотеки в зависимости в<span>&nbsp;</span><strong>Cargo.toml</strong><span>&nbsp;</span>и добавить их в проект с помощью<span>&nbsp;</span><strong>extern crate {crate_name}</strong>.</p>\r\n<p>Код для генерации<span>&nbsp;</span><strong>Cargo.toml</strong>:</p>\r\n<pre><code class=\"python hljs\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">gen_cargo_toml</span><span class=\"hljs-params\">(libs)</span>:</span>\r\n    <span class=\"hljs-string\">\'\'\'Generate valid Cargo.toml\'\'\'</span>\r\n\r\n    cargo_template = textwrap.dedent(\r\n        <span class=\"hljs-string\">\'\'\'\r\n        [package]\r\n        name = \"rust_codes\"\r\n        version = \"0.1.0\"\r\n        edition = \"2021\"\r\n\r\n        [profile.release]\r\n        debug = true\r\n        strip = false\r\n        lto = true\r\n\r\n        [lib]\r\n        crate-type = [\"staticlib\", \"cdylib\"]\r\n\r\n        [dependencies]\r\n        {}\r\n        \'\'\'</span>)\r\n\r\n    toml_path = <span class=\"hljs-string\">f\'<span class=\"hljs-subst\">{RUST_PROJ_PATH}</span>/<span class=\"hljs-subst\">{RUST_PROJ_NAME}</span>/Cargo.toml\'</span>\r\n\r\n    deps = <span class=\"hljs-string\">\'\'</span>\r\n    <span class=\"hljs-keyword\">for</span> lib, version <span class=\"hljs-keyword\">in</span> libs:\r\n        deps += <span class=\"hljs-string\">\'{} = \"{}\"\\n\'</span>.format(lib, version)\r\n\r\n    <span class=\"hljs-keyword\">for</span> ext <span class=\"hljs-keyword\">in</span> EXTERNS:\r\n        <span class=\"hljs-keyword\">if</span> <span class=\"hljs-keyword\">not</span> <span class=\"hljs-string\">f\'<span class=\"hljs-subst\">{ext}</span> =\'</span> <span class=\"hljs-keyword\">in</span> deps <span class=\"hljs-keyword\">and</span> <span class=\"hljs-keyword\">not</span> <span class=\"hljs-string\">f\'<span class=\"hljs-subst\">{ext.replace(\"_\", \"-\")}</span> =\'</span> <span class=\"hljs-keyword\">in</span> deps:\r\n            version = get_latest_version(ext)\r\n\r\n            deps += <span class=\"hljs-string\">\'{} = \"{}\"\\n\'</span>.format(ext, version)\r\n\r\n    <span class=\"hljs-keyword\">with</span> open(toml_path, <span class=\"hljs-string\">\'w\'</span>) <span class=\"hljs-keyword\">as</span> toml:\r\n        toml.write(cargo_template.format(deps))</code></pre>\r\n<p>Тут мы видим, что конечный результат компиляции должен быть статической и разделяемой библиотекой. Какая из них будет использоваться зависит от того, где сигнатуры будут использоваться. Еще мы добавляем в релизный профиль отладочные символы.</p>\r\n<p>Прежде чем продолжить, поговорим немного о возможных оптимизациях, применяемых в Rust. Это необходимо, поскольку может сильно повлиять на вид сигнатур. Для управления настройками компиляции и определения зависимостей cargo использует файл<span>&nbsp;</span><strong>Cargo.toml</strong>. Самое интересное для нас из него &mdash; это настройки профилей по умолчанию. Основные профили &mdash; это dev и release. Профиль dev используется по умолчанию в сборке через cargo:<span>&nbsp;</span><code>cargo build</code>. Профиль release используется в сборке с флагом<span>&nbsp;</span><code>--release</code>.</p>\r\n<p>Стандартные настройки для дебаг сборки:</p>\r\n<pre><code class=\"yaml hljs\"><span class=\"hljs-string\">[profile.dev]</span>\r\n<span class=\"hljs-string\">opt-level</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-number\">0</span>\r\n<span class=\"hljs-string\">debug</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">true</span>\r\n<span class=\"hljs-string\">split-debuginfo</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-string\">\'...\'</span>  <span class=\"hljs-comment\"># Platform-specific.</span>\r\n<span class=\"hljs-string\">debug-assertions</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">true</span>\r\n<span class=\"hljs-string\">overflow-checks</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">true</span>\r\n<span class=\"hljs-string\">lto</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">false</span>\r\n<span class=\"hljs-string\">panic</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-string\">\'unwind\'</span>\r\n<span class=\"hljs-string\">incremental</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">true</span>\r\n<span class=\"hljs-string\">codegen-units</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-number\">256</span>\r\n<span class=\"hljs-string\">rpath</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">false</span></code></pre>\r\n<p>Стандартные настройки для релизной сборки:</p>\r\n<pre><code class=\"yaml hljs\"><span class=\"hljs-string\">[profile.release]</span>\r\n<span class=\"hljs-string\">opt-level</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-number\">3</span>\r\n<span class=\"hljs-string\">debug</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">false</span>\r\n<span class=\"hljs-string\">split-debuginfo</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-string\">\'...\'</span>  <span class=\"hljs-comment\"># Platform-specific.</span>\r\n<span class=\"hljs-string\">debug-assertions</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">false</span>\r\n<span class=\"hljs-string\">overflow-checks</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">false</span>\r\n<span class=\"hljs-string\">lto</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">false</span>\r\n<span class=\"hljs-string\">panic</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-string\">\'unwind\'</span>\r\n<span class=\"hljs-string\">incremental</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">false</span>\r\n<span class=\"hljs-string\">codegen-units</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-number\">16</span>\r\n<span class=\"hljs-string\">rpath</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-literal\">false</span></code></pre>\r\n<p>В целом, различия очевидны. В дебаг сборке включены макросы вроде<span>&nbsp;</span><strong>debug_assert!</strong>, добавляются отладочные символы. А в релизной сборке это лишнее &mdash; там включены оптимизации. Рассмотрим основные флаги оптимизации, используемые в<span>&nbsp;</span><strong>Cargo.toml</strong>:</p>\r\n<p>-<span>&nbsp;</span><strong>opt-level</strong><span>&nbsp;</span>&mdash; определяет уровень оптимизации. Наиболее продвинутая оптимизация достигается при уровне 3 и отключается на уровне 0</p>\r\n<p>-<span>&nbsp;</span><strong>lto</strong><span>&nbsp;</span>(LLVM\'s link time optimizations) &mdash; отвечает за оптимизацию кода во время линковки. Для этого приходится проводить дополнительный анализ, из-за чего время сборки проекта может сильно возрасти. Как правило, в реальных проектах, эта опция будет включена.</p>\r\n<h3>Компилируем с отладочными символами</h3>\r\n<p>Шаблон у нас есть, код функций тоже. Теперь осталось грамотно вызвать все функции и правильно сгенерировать код библиотеки. Этот шаг довольно непростой. Как создать библиотеку и быть уверенным, что код в ней соберется как нужно? Для начала определимся со \"скелетом\", в который мы будем добавлять остальной код:</p>\r\n<pre><code class=\"rust hljs\"><span class=\"hljs-meta\">#![allow(unused_imports)]</span>\r\n<span class=\"hljs-meta\">#![allow(dead_code)]</span>\r\n\r\n<span class=\"hljs-keyword\">pub</span> <span class=\"hljs-keyword\">mod</span> smth {\r\n    <span class=\"hljs-meta\">#[no_mangle]</span>\r\n    <span class=\"hljs-keyword\">pub</span> <span class=\"hljs-keyword\">extern</span> <span class=\"hljs-string\">\"C\"</span> <span class=\"hljs-function\"><span class=\"hljs-keyword\">fn</span> <span class=\"hljs-title\">main</span></span>() {\r\n    }\r\n}</code></pre>\r\n<p>Определяем модуль<span>&nbsp;</span><strong>smth</strong>, в котором будет экспортируемая функция<span>&nbsp;</span><strong>main</strong>. Внутри нее и будет основная логика библиотеки - определение переменных и вызовы функций. Еще тут не хватает добавления внешних библиотек.</p>\r\n<p>В наш \"скелет\" сначала добавим внешние крейты. Это и есть наши зависимости, описанные в<span>&nbsp;</span><strong>Cargo.toml</strong>. Теперь хотелось бы убедиться, что наши вызовы или примеры кода, вынесенные в отдельные модули, могут компилироваться. Для этого будем добавлять по одному вызову функций в шаблон выше и проверять с помощью<span>&nbsp;</span><code>cargo check --release</code>. Если команда выполняется успешно, мы оставляем этот вызов в конечный результат. Если нет, то мы игнорируем этот вызов и переходим к следующему. Код, выполняющий проверку и записывающий конечный результат в<span>&nbsp;</span><strong>lib.rs</strong><span>&nbsp;</span>приведен ниже.</p>\r\n<pre><code class=\"python hljs\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">check_compile</span><span class=\"hljs-params\">()</span>:</span>\r\n    <span class=\"hljs-string\">\'\'\'Check every function for compilation. If succeed, add it to lib.rs\'\'\'</span>\r\n\r\n    head = <span class=\"hljs-string\">\'#![allow(unused_imports)]\\n#![allow(dead_code)]\\n\\n\'</span>\r\n    head += <span class=\"hljs-string\">\'\\n\'</span>.join(map(<span class=\"hljs-keyword\">lambda</span> x: <span class=\"hljs-string\">f\'#[macro_use]\\nextern crate <span class=\"hljs-subst\">{x.replace(\"-\", \"_\")}</span>;\\n\'</span>,\r\n                          set(EXTERNS)))\r\n    head += <span class=\"hljs-string\">\'\\n\'</span>\r\n\r\n    mods = <span class=\"hljs-string\">\'\'</span>\r\n    candidates = <span class=\"hljs-string\">\'\'</span>\r\n    usings = <span class=\"hljs-string\">\'\'</span>\r\n    variables = <span class=\"hljs-string\">\'\'</span>\r\n\r\n    <span class=\"hljs-keyword\">for</span> define <span class=\"hljs-keyword\">in</span> DEFINES:\r\n        variables += <span class=\"hljs-string\">f\'        <span class=\"hljs-subst\">{define}</span>\\n\'</span>\r\n\r\n    <span class=\"hljs-keyword\">for</span> i <span class=\"hljs-keyword\">in</span> range(len(LIB_FUNCS)):\r\n        candidate = <span class=\"hljs-string\">f\'        <span class=\"hljs-subst\">{LIB_FUNCS[i]}</span>\\n\'</span>\r\n\r\n        full_code = head + <span class=\"hljs-string\">\'\\npub mod smth {\\n\'</span> + \\\r\n            <span class=\"hljs-string\">\'\\n    #[no_mangle]\\n    pub extern \"C\" fn main() {\\n\'</span> + \\\r\n            variables + candidate + <span class=\"hljs-string\">\'    }\\n\'</span> + <span class=\"hljs-string\">\'}\'</span>\r\n\r\n        <span class=\"hljs-keyword\">if</span> cargo_check(full_code, LIB_FUNCS[i]):\r\n            candidates += candidate\r\n\r\n    <span class=\"hljs-keyword\">for</span> i <span class=\"hljs-keyword\">in</span> range(len(EXAMPLE_FUNCS)):\r\n        mod = <span class=\"hljs-string\">f\'mod func<span class=\"hljs-subst\">{i}</span>;\\n\'</span>\r\n        candidate = <span class=\"hljs-string\">f\'        <span class=\"hljs-subst\">{EXAMPLE_FUNCS[i]}</span>();\\n\'</span>\r\n        use = <span class=\"hljs-string\">f\'    use crate::func<span class=\"hljs-subst\">{i}</span>::<span class=\"hljs-subst\">{EXAMPLE_FUNCS[i]}</span>;\\n\'</span>\r\n\r\n        full_code = head + mod + <span class=\"hljs-string\">\'\\npub mod smth {\\n\'</span> + use + \\\r\n            <span class=\"hljs-string\">\'\\n    #[no_mangle]\\n    pub extern \"C\" fn main() {\\n\'</span> + \\\r\n            variables + candidate + <span class=\"hljs-string\">\'    }\\n\'</span> + <span class=\"hljs-string\">\'}\'</span>\r\n\r\n        <span class=\"hljs-keyword\">if</span> cargo_check(full_code, EXAMPLE_FUNCS[i]):\r\n            candidates += candidate\r\n            mods += mod\r\n            usings += use\r\n\r\n    lib_code = head + mods + <span class=\"hljs-string\">\'\\npub mod smth {\\n\'</span> + usings + \\\r\n        <span class=\"hljs-string\">\'\\n    #[no_mangle]\\n    pub extern \"C\" fn main() {\\n\'</span> + \\\r\n        variables + candidates + <span class=\"hljs-string\">\'    }\\n\'</span> + <span class=\"hljs-string\">\'}\'</span>\r\n\r\n    <span class=\"hljs-keyword\">with</span> open(<span class=\"hljs-string\">f\'<span class=\"hljs-subst\">{RUST_PROJ_PATH}</span>/<span class=\"hljs-subst\">{RUST_PROJ_NAME}</span>/src/lib.rs\'</span>, <span class=\"hljs-string\">\'w\'</span>) <span class=\"hljs-keyword\">as</span> rust_lib:\r\n        rust_lib.write(lib_code)</code></pre>\r\n<p>После этого мы вызываем<span>&nbsp;</span><code>cargo build --release</code><span>&nbsp;</span>и получаем библиотеку с отладочными символами.</p>\r\n<h3>Генерируем сигнатуры</h3>\r\n<p>Дело за малым &mdash; создать из готовой библиотеки сигнатуры. В случае с IDA Pro 8.0 мы будем использовать ее инструментарий<span>&nbsp;</span><strong>flair80</strong>. А именно<span>&nbsp;</span><strong>pelf/sigmake</strong><span>&nbsp;</span>для Linux или<span>&nbsp;</span><strong>pld/sigmake</strong><span>&nbsp;</span>для Windows. Сначала мы создаем .pat-файл, и с него с помощью sigmake создаем .sig-файл. При этом чаще всего с первого раза мы получим предупреждение о коллизиях. Для этого нам нужно удалить строки, начинающиеся с \";\" с .exc-файла. После чего повторяем действия с sigmake и получаем flirt-сигнатуры для IDA Pro.</p>\r\n<p>В случае с<span>&nbsp;</span><strong>Rizin / Cutter</strong><span>&nbsp;</span>все намного проще. Нам нужно иметь установленный<span>&nbsp;</span><strong>rizin</strong><span>&nbsp;</span>и выполнить команду<span>&nbsp;</span><code>rizin -A -qc \"zfc {target}/libname}.sig\" {target}/{libname}</code>, где<span>&nbsp;</span><strong>libname</strong><span>&nbsp;</span>&mdash; это скомпилированная разделяемая библиотека с отладочными символами.</p>\r\n<p>Посмотрим, как различается вид программы до и после применения полученных сигнатур. Тестировать будем на релизной версии файла. Вот как все было до применения сигнатур:</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3e0915a22.jpg\" alt=\"\" /></p>\r\n<p>А вот что мы получаем после:</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a3e1ede29c.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>158 функций из 772 распознались с помощью сигнатур. Вполне неплохой результат. Часть оставшихся функций &mdash; это аналоги распознанных функций для другого типа принимаемого значения. Правда, часть функций получит имя<span>&nbsp;</span><strong>unknown_libname</strong>, и с этим пока не очень понятно что делать. К тому же мы отбрасываем все коллизии вместо выбора. Эту проблему можно решить руками, если их не особо много.</p>\r\n<h2>Вывод</h2>\r\n<p>В статье мы рассмотрели существующие инструменты, которые могут помочь при реверсе программ, написанный на языке Rust. Сделали вывод по каждому из них и написали собственный плагин на python для автоматического создания сигнатур, используя строки из бинарного файла. Исходные кода плагинов для остальных дизассемблеров можно найти по<span>&nbsp;</span><a href=\"https://github.com/R33v0LT/rlibs2sigs\">ссылке</a>.</p>\r\n<p>В планах добавить парсинг документаций к библиотекам с других источников вроде<span>&nbsp;</span><strong>github</strong><span>&nbsp;</span>или сгенерированной с помощью<span>&nbsp;</span><strong>rustdoc-gen</strong>.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 1, 'uploads/images/2022/10/image_750x500_635a3d10d5181.jpg', 'uploads/images/2022/10/image_750x_635a3d110a26e.jpg', 'uploads/images/2022/10/image_600x460_635a3d1130aa0.jpg', 'uploads/images/2022/10/image_380x226_635a3d1156384.jpg', 'uploads/images/2022/10/image_140x98_635a3d1178681.jpg', 'jpg', 'local', '', 24, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-27 10:16:30');
INSERT INTO `posts` (`id`, `lang_id`, `title`, `title_slug`, `title_hash`, `keywords`, `summary`, `content`, `category_id`, `image_big`, `image_default`, `image_slider`, `image_mid`, `image_small`, `image_mime`, `image_storage`, `optional_url`, `pageviews`, `need_auth`, `is_slider`, `slider_order`, `is_featured`, `featured_order`, `is_recommended`, `is_breaking`, `is_scheduled`, `visibility`, `show_right_column`, `post_type`, `video_path`, `video_storage`, `image_url`, `video_url`, `video_embed_code`, `user_id`, `status`, `feed_id`, `post_url`, `show_post_url`, `image_description`, `show_item_numbers`, `updated_at`, `created_at`) VALUES
(928, 1, 'Иммерсионное охлаждение в ЦОД — аргументы «за» и «против»', 'immersionnoe-okhlazhdenie-v-tsod-argumenti-za-i-protiv', NULL, '', 'Центр обработки данных — достаточно энергозатратная система. Большое количество энергии требуют как ИТ-инфраструктура, так и системы её охлаждения. ', '<p>Считается, что в мировом масштабе центры обработки данных<span>&nbsp;</span><a href=\"https://www.if24.ru/data-tsentry-pozhirayut-3-mirovoj-elektroenergii/\"><u>потребляют около 3%</u></a><span>&nbsp;</span>от общего уровня потребления электроэнергии в мире, и, скорее всего, эта доля будет расти. Кроме того, с развитием высокопроизводительных процессоров будет увеличиваться количество тепла, выделяемого серверами. Уже сейчас системы охлаждения ЦОДа<span>&nbsp;</span><a href=\"https://www.ups-info.ru/for_partners/library/ilektrosnabzhenie_tsod/\"><u>могут потреблять 30-50%</u></a><span>&nbsp;</span>от общего энергопотребления.</p>\r\n<p>Также есть мнение, что через какое-то время традиционные воздушные системы охлаждения серверов перестанут справляться с теплоотведением оборудования, то есть воздух будет забирать тепло от нагревающихся элементов медленнее, чем эти элементы будут его генерировать. Если не внедрять способы решения проблем охлаждения, то рост температуры будет приводить к снижению производительности и систематическим отказам.&nbsp;</p>\r\n<p>Вопрос экономии также играет роль &ndash; в некоторых случаях внедрение альтернативных источников охлаждения может помочь на порядок сократить капитальные и операционные расходы. Всё это обуславливает интерес операторов центров обработки данных к альтернативным способам охлаждения оборудования. Как следствие, все это приводит к росту новых разработок и исследований. Впереди всех тут, конечно же, крупные компании, например, Майкрософт, тоже ведущий<span>&nbsp;</span><a href=\"https://news.microsoft.com/innovation-stories/datacenter-liquid-cooling/\"><u>исследования</u></a><span>&nbsp;</span>в этой области.</p>\r\n<p>Сегодня я хотел бы поговорить об иммерсионном охлаждении &ndash; любопытной концепции, известной давно, но так и не вышедшей в отрасли охлаждения компьютерных систем в сколь-либо массовый продакшен.&nbsp;</p>\r\n<p></p>\r\n<h2>Что же это такое?</h2>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a48a824f8b.jpg\" alt=\"\" /></p>\r\n<p>Перевод слова &ldquo;immersion&rdquo; на русский язык сразу дает представление о сути этой технологии &ndash; погружение. Иммерсионное охлаждение заключается в погружении рабочей машины (сервера) или отдельных его компонентов: материнской платы с процессором, видеокарты, дисков, блока питания и так далее &ndash; в теплопроводную диэлектрическую жидкость, которая обеспечивает отбор тепла от устройства, не затрагивая при этом (в силу непроводимости) работы электроники.&nbsp;</p>\r\n<p>Вообще, в последние годы системы жидкостного охлаждения серверов и ПК набирают популярность. Например, у нас в FirstVDS на часть серверов установлены CPU-водоблоки, и, думаю, у каждого найдется хотя бы пара товарищей-геймеров, использующих такой тип охлаждения на своих игровых станциях.&nbsp;</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a48c50bede.jpg\" alt=\"\" /></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a48c65e3b2.jpg\" alt=\"\" /></p>\r\n<p>Обычным пользователям такая система без надобности, но если речь идет о высокопроизводительных машинах, вода, обладая большей по сравнению с воздухом теплоёмкостью, позволяет эффективнее отводить тепло от нагревающихся элементов системы, сохраняя их работоспособность. Однако жидкостная система охлаждения не обязательно должна быть реализована через установку водоблоков, трубок, помпы и, собственно, жидкости, циркулирующей через такую систему.</p>\r\n<p>У иммерсионного охлаждения другой подход, менее традиционный. Бесспорно, его можно назвать разновидностью жидкостного охлаждения, но оно не требует наличия герметичного контура для хладагента, что, очевидно, выгоднее с точки зрения упрощения конструкции, также при таком подходе охлаждается весь сервер, а не только узлы под водоблоками.&nbsp;</p>\r\n<p>Надо сказать, что иммерсионное охлаждение оборудования началось, конечно, не с серверов. Еще в XIX веке практиковалось охлаждение трансформаторов путем погружения в масляную ванну. Это до сих пор является общепринятой практикой, а трансформаторное масло в современной классификации &ndash; это отдельный вид минеральных масел, со<span>&nbsp;</span><a href=\"https://files.stroyinf.ru/Data/228/22892.pdf\"><u>своим ГОСТ</u></a><span>&nbsp;</span>и так далее. Кстати, трансформаторные масла также применяются как охлаждающие жидкости для иммерсионных ванн.&nbsp;</p>\r\n<h2>Разберемся более подробно</h2>\r\n<p>Сервер погружается в некую ванну, заполненную диэлектрической жидкостью. Предварительно с сервером не совершается никаких специальных манипуляций, исключением может быть разве что демонтаж корпуса (частичный или полный), радиаторов и кулеров воздушного охлаждения. Жидкость, находящаяся в прямом контакте с нагревающимися частями сервера, отводит тепло, а затем охлаждается в чиллере или с помощью иного теплообменника.&nbsp;</p>\r\n<p>Диэлектрические жидкости, используемые в иммерсионных системах, по виду вещества можно поделить на две категории:&nbsp;&nbsp;</p>\r\n<ul>\r\n<li>\r\n<p>Масла. Минеральные, синтетические, силиконовые &mdash; тысячи их! В качестве примера можно привести, например, STE Oil Crystal Plus 70T или Блюмид.&nbsp;</p>\r\n</li>\r\n<li>\r\n<p>Фторуглероды. Такие, как 3M<span>&nbsp;</span><a href=\"https://www.3m.com/3M/en_US/novec-us/\"><u>Novec</u></a><span>&nbsp;</span>и<span>&nbsp;</span><a href=\"https://www.3m.com/3M/en_US/data-center-us/applications/immersion-cooling/fluorinert-electronic-liquids/\"><u>Fluorinert</u></a>.&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p>И также диэлектрические жидкости делятся на двухфазные и однофазные:&nbsp;</p>\r\n<ul>\r\n<li>\r\n<p><strong>Двухфазные жидкости</strong><span>&nbsp;</span>&mdash; во время цикла охлаждения оборудования жидкость превращается в газ, т. е. испаряется. Получившийся пар охлаждается с помощью конденсатора, обычно это змеевики с проточной водой, которые располагаются в верхней части иммерсионной ванны (внимание на картинку). В результате пар конденсируется и в жидком виде капает обратно. Такие жидкости характеризуются низкой точкой кипения, как правило, около 60 градусов Цельсия. Для такого типа охлаждения используются только герметичные резервуары.</p>\r\n</li>\r\n</ul>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a48f4d88df.jpg\" alt=\"\" /></p>\r\n<ul>\r\n<li>\r\n<p><strong>Однофазные жидкости</strong><span>&nbsp;</span>&mdash; жидкость все время находится в одном агрегатном состоянии. Такой подход требует циркуляции диэлектрической жидкости в резервуаре с помощью насосов или естественной конвекции, они никогда не доводятся до кипения. Для охлаждения жидкость прокачивается через теплообменник. Жидкости для однофазного иммерсионного охлаждения характеризуются высокой точкой кипения. Резервуар для однофазной жидкости может быть открытым.&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a490da4461.jpg\" alt=\"\" /></p>\r\n<h2>Плюсы иммерсионного охлаждения</h2>\r\n<ul>\r\n<li>\r\n<p>Жидкость, обладая б&oacute;льшей, чем воздух, теплоёмкостью, позволяет отводить от устройства б&oacute;льшее количество тепла. Это даёт возможность использовать более высокопроизводительные CPU/GPU, вырабатывающие большое количество тепла, не боясь их перегрева и выхода из строя, а также позволит размещать оборудование более плотно, экономя пространство.</p>\r\n</li>\r\n</ul>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a493f732b6.jpg\" alt=\"\" /></p>\r\n<ul>\r\n<li>\r\n<p>Иммерсионное охлаждение исключает явление локального нагрева, потому что охлаждает всю поверхность устройства равномернее, чем при воздушном охлаждении или, тем более, непрямом жидкостном охлаждении, то есть через водоблоки. Такой подход повышает, в том числе, срок службы устройств.</p>\r\n</li>\r\n<li>\r\n<p>Снижение затрат на электроэнергию за счет отказа от инфраструктуры воздушного охлаждения в пользу иммерсионной, например, отпадает необходимость фальшпола и закрытых холодных коридоров. Благодаря более эффективному охлаждению коэффициент PUE приближается к единице.</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a49515049f.jpg\" alt=\"\" /></p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p>Повышение вычислительной мощности. Эффективная система охлаждения позволяет разгонять устройства до максимума без риска перегрева.&nbsp;</p>\r\n</li>\r\n<li>\r\n<p>Исключение попадания пыли и грязи. Вентиляторы воздушной системы охлаждения переносят частицы, которые потенциально могут стать причиной сбоя в оборудовании. Иммерсионный подход решает эту проблему, повышая надежность устройств.&nbsp;</p>\r\n</li>\r\n<li>\r\n<p>В случае применения негорючих диэлектрических жидкостей отсутствует необходимость в сложных системах пожаротушения.</p>\r\n</li>\r\n<li>\r\n<p>Отсутствие шума.</p>\r\n</li>\r\n</ul>\r\n<p>Что же, список преимуществ выглядит солидно. Обычно сторонники иммерсионного охлаждения ЦОД в своих материалах после перечисления вышеописанных достоинств начинают рассуждать о &ldquo;принципиально новом подходе&rdquo; и &ldquo;технологическом прорыве&rdquo;. Однако, если игнорировать маркетинговую составляющую, сложно не заметить, что иммерсионные решения практически не используются в ЦОДах. Подавляющее большинство операторов ЦОД в России и мире строит и использует инфраструктуру под воздушное охлаждение, а иммерсионный подход используется в основном в майнинге и в небольшом количестве экспериментальных программ. Почему так происходит?&nbsp;</p>\r\n<p>Чтобы ответить на этот вопрос, необходимо проанализировать плюсы, перечисленные выше.&nbsp;&nbsp;</p>\r\n<h2>Недостатки иммерсионного охлаждения</h2>\r\n<p>Список достоинств, приведенный выше, с незначительными вариациями можно встретить на любом сайте компании-производителя иммерсионных жидкостей, оборудования или иных подобных решений для майнинга и ЦОД. На мой взгляд, он правдив и объективен, однако количество возникающих при переходе на иммерсионное охлаждение вопросов перевешивает плюсы, особенно если рассматривать их &ldquo;у станка&rdquo; &ndash; находясь в работающем дата-центре, умозрительно прикидывать узкие места того или иного аспекта.&nbsp;</p>\r\n<ul>\r\n<li>\r\n<p><strong>Утилизация тепла</strong>. Иммерсионная жидкость, отводя тепло более эффективно и в б&oacute;льших количествах, действительно позволяет размещать сверхвысоконагруженные стойки (до 100 кВт на стойку против 12-15 кВт при воздушном охлаждении). Но отвести тепло от серверов это только половина задачи, главный вопрос &mdash; это утилизация тепла, эта проблема никуда не пропадает. В любом случае придется использовать теплообменники гораздо более производительные и дорогие, чем в системах с воздушным охлаждением. Это, в свою очередь, снижает экономию на электроэнергии.</p>\r\n</li>\r\n<li>\r\n<p><strong>Гарантия на оборудование.<span>&nbsp;</span></strong>Поскольку все серверы архитектурно приспособлены не под иммерсионное охлаждение, а под воздушное, производитель по умолчанию будет рассматривать как негарантийные все случаи поломок и дефектов используемого с иммерсионными системами оборудования. Единственное исключение, которое я нашел, упоминается в<span>&nbsp;</span><a href=\"https://habr.com/ru/news/t/685470/\"><u>этой новости</u></a><span>&nbsp;</span>на Хабре. Такой сервер, наверное, под гарантию попадет :)</p>\r\n</li>\r\n</ul>\r\n<p>Кроме того, некоторые виды жестких дисков невозможно использовать в жидкостной среде в принципе &ndash; перестает крутиться шпиндель из-за более плотной среды. Использовать в иммерсионных ваннах можно только герметичные гелиевые HDD или твердотельные накопители.</p>\r\n<ul>\r\n<li>\r\n<p><strong>Горячая замена и обслуживание.<span>&nbsp;</span></strong>Вызывает вопросы возможность замены дисков без остановки сервера, а также его включение-выключение-ребут по кнопке. Чтобы произвести каждую из этих операций в обычном ЦОДе, инженеру надо просто открыть стойку, а в случае иммерсионной ванны сервер необходимо достать, дождаться стекания иммерсионной жидкости&hellip; В схеме с двухфазным охлаждением ситуация будет еще сложнее из-за требований к герметичности резервуаров. В общем, если горячая замена и будет реализуема в принципе, то её скорость снижена в разы в сравнении с классической стойкой.</p>\r\n</li>\r\n</ul>\r\n<p>В целом, весь процесс обслуживания физического сервера будет занимать больше времени, чем обычно &ndash; достать сервер из иммерсионной ванны и подготовить к сервису дольше, чем из обычной стойки. Это влияет на статистику простоя.</p>\r\n<p>Также сомнительна фактическая полезность некоторых часто озвучиваемых поставщиками иммерсионных услуг преимуществ:</p>\r\n<ul>\r\n<li>\r\n<p>Отсутствие шума. Никто не будет делать иммерсионный проект только из-за желания избавиться от звукового загрязнения. Бесшумность оборудования может быть важна для домашнего майнинга, но в ЦОДе снаружи слышно не будет, а внутри сотрудникам дадут противошумные наушники. Кстати, прочитать о том, как наша дежурная смена подбирает средства шумозащиты, можно<span>&nbsp;</span><a href=\"https://habr.com/ru/company/first/blog/687986/\"><u>в этой статье</u></a>.&nbsp;</p>\r\n</li>\r\n<li>\r\n<p>Экономия пространства. Сверхплотное размещение серверов, которое становится возможным с использованием иммерсионного охлаждения, должно иметь под собой какое-то объективное обоснование. А не просто потому, что так&nbsp; можно или захотелось.&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p>Например, таким обоснованием может стать высокая стоимость земли &ndash; если цена квадратного метра $10000, то, наверное, игра в экономию площади стоит свеч.</p>\r\n<p>Вторая причина - ограниченное пространство. Если вы майнер и в вашем распоряжении&nbsp; только площадь своей квартиры или гаража, но при этом вы хотите снимать с фермы не 10 кВт, а 80, то внедрение иммерсионных ванн с хэш-платами в них вместо традиционного воздушного охлаждения будет целесообразно.&nbsp;</p>\r\n<p>Если рассматривать не майнинг, а дата-центры, то серьезное ограничение пространства может возникнуть из-за необходимости разместить большие мощности на небольшой площади офиса в силу, например, политик безопасности, но я не видел таких кейсов на практике.</p>\r\n<p>Еще один момент. При строительстве дата-центра сложность представляет не поиск места под строительство нужной площади, а поиск электричества. Другими словами, для традиционного ЦОДа сложно найти 10 МВт, а площадь под строительство ЦОДа такого размера значительно легче. Особенно эта проблема актуальна в условиях города.&nbsp;</p>\r\n<ul>\r\n<li>\r\n<p>Повышение срока службы устройств. Да, за счет эффективного теплоотведения снижается нагрев приборов, и серверы служат дольше. Однако даже в традиционных, &ldquo;воздушных&rdquo; ЦОДах давно действует правило &ldquo;Устареет быстрее, чем сломается&rdquo;. В данный момент нужды в вечных серверах нет, а срок годности стандартного сервера &ndash; 5 лет, после чего его место занимает более производительный собрат. Таким образом, сильная нужда в повышении срока службы сервера отсутствует.&nbsp;</p>\r\n</li>\r\n<li>\r\n<p>Исключение попадания пыли и грязи. Серьезная проблема потенциально, однако достаточно легко решаемая клинингом. В Ixcellerate влажная чистка пола проходит раз в день, вход в машзал осуществляется только в бахилах, уборку стоек и чистку серверов мы проводим регулярно.&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p>Иногда еще, в приложение к словам об исключении попадания пыли, начинают писать о пользе демонтажа серверных кулеров в процессе &ldquo;подготовки к погружению&rdquo; платформ в ванны, якобы они часто ломаются, что влечет за собой перегрев и простой сервера. Звучит сомнительно &ndash; за все годы работы в дата-центре ни у одного из наших серверов я не видел отказавшего вентилятора.&nbsp;</p>\r\n<h2>Заключение</h2>\r\n<p>Мое мнение &mdash; системы иммерсионного охлаждения, в силу вышеописанных причин, не смогут занять место традиционных систем в центрах обработки данных в обозримой перспективе. В ближайшее время целесообразно лишь их точечное применение под определенные задачи: в сфере высокопроизводительных вычислений, при сверхплотном размещении мощностей в силу ограниченного пространства или для лабораторных исследований.&nbsp;</p>\r\n<p>Возможно, дальнейшее развитие мощных процессоров даст импульс к более широкому применению иммерсионного охлаждения, если окажется, что другие системы более не способны отводить тепло от столь мощных систем.</p>', 40, 'uploads/images/2022/10/image_750x500_635a4a5b30890.jpg', 'uploads/images/2022/10/image_750x_635a4a5b3da0c.jpg', 'uploads/images/2022/10/image_600x460_635a4a5b4ba66.jpg', 'uploads/images/2022/10/image_380x226_635a4a5b58615.jpg', 'uploads/images/2022/10/image_140x98_635a4a5b61d82.jpg', 'jpg', 'local', '', 23, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-27 11:07:48'),
(929, 1, 'Вы уверены? Как писать тексты для экранов подтверждения', 'vi-uvereni-kak-pisat-teksti-dlya-ekranov-podtverzhdeniya', NULL, 'itfox, habr, community, programming community, turkmenportal', 'В каждом продукте есть сценарии, которые могут привести к разрушительным последствиям. Например, какая-то команда может уничтожить важные данные, внести серьезные изменения в систему или просто что-то «сломать». Поэтому важно четко и понятно предупреждать об этом и помогать пользователю принимать осознанные решения.\r\nВ статье собрала основные принципы создания текстов для экранов подтверждения, которым следуют Apple, Microsoft и Google.', '<h3>Когда нужен экран подтверждения</h3>\r\n<p>Используйте экраны подтверждения экономно. Да, они дают пользователям важную информацию, но вместе с тем прерывают движение по сценарию. Часто это злит, раздражает и вызывает желание поскорее скрыть навязчивый экран. Вот для каких событий экран подтверждения скорее нужен.&nbsp;</p>\r\n<p><strong>1. Событие не частотное</strong></p>\r\n<p>Запросы на подтверждение частых действий, например удаление письма из почтового ящика, быстро станут раздражающими. Тем более при частотных операциях маловероятно, что пользователи по ошибке случайно нажмут не ту кнопку. А вот если событие редкое и может привести к серьезным последствиям, запрос на подтверждение с описанием этих последствий очень кстати.&nbsp;</p>\r\n<p><strong>2. Событие имеет необратимые последствия</strong></p>\r\n<p>Экран подтверждения нужен, если пользователи собираются выполнить необратимое действие. Например, навсегда удалить какие-то данные без возможности восстановления. Или отправить важный отчет, который больше нельзя будет отредактировать.&nbsp;</p>\r\n<p><strong>3. Событие может привести к серьезным изменениям в работе системы</strong></p>\r\n<p>Важно предупредить пользователя, если его действие может повлиять на конфигурацию других устройств или работоспособность всей системы.</p>\r\n<h2>Как писать заголовок и описание</h2>\r\n<p><strong>1. Сделайте заголовок информативным&nbsp;</strong></p>\r\n<p>В интерфейсе каждая фраза должна быть полезной. Иначе вы впустую тратите внимание пользователя. Не делайте формальный заголовок и не уносите важное в подзаголовок &mdash; его часто не читают.</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4ca4b1f3c.jpg\" alt=\"\" /></p>\r\n<p>Если действие может привести к необратимым последствиям, также расскажите об этом в заголовке. Иначе пользователь может упустить важную информацию и принять решение, не осознавая риски.</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4cd17f41f.jpg\" alt=\"\" /></p>\r\n<p>Избавляйтесь от неинформативных частей в стиле: &laquo;вы уверены&hellip;&raquo; или &laquo;точно&hellip;&raquo;.<br />Лучше сразу перейти к сути, чтобы пользователь, даже просто сканируя текст, понял суть сообщения.</p>\r\n<p><strong>2. Не используйте двойные отрицания</strong></p>\r\n<p>Сформулируйте заголовок так, чтобы в нем не было отрицания. Двойное отрицание создает дополнительную когнитивную нагрузку. Пользователю, чтобы отказаться от действия, придется воспроизвести в голове конструкцию вида &laquo;не применять не применять ввод?&raquo;</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4d0fdf99a.jpg\" alt=\"\" /></p>\r\n<p><strong>3. Предложите альтернативу&nbsp;</strong></p>\r\n<p>Если верите, что пользователь вместо решительного &laquo;разрушительного&raquo; действия может выбрать что-то менее радикальное, предложите это. Но не увлекайтесь, чтобы не превратить это в навязчивую манипуляцию.</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4d2a0730c.jpg\" alt=\"\" /></p>\r\n<p><strong>4. Заголовок должен &laquo;дружить&raquo; с кнопками&nbsp;</strong></p>\r\n<p>Это универсальное правило интерфейсного текста. Но в экране подтверждения оно важно особенно &mdash; здесь ошибка может дорого стоить пользователю.<br />Убедитесь, что заголовок точно отражает действие, которое подтверждает или отклоняет кнопка.</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4d3eaa18d.jpg\" alt=\"\" /></p>\r\n<p><span>Кнопки должны быть согласованы именно с заголовком, а не с текстом в пояснении.</span></p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4d50009b0.jpg\" alt=\"\" /></p>\r\n<h2>Как назвать кнопки</h2>\r\n<p><strong>1. Не используйте кнопки &laquo;Ок&raquo; и &laquo;Отменить&raquo;</strong></p>\r\n<p>Эти кнопки могут ввести в заблуждение. Например, означает ли &laquo;Ок&raquo; &mdash; &laquo;Ок, я хочу завершить действие&raquo; или &laquo;Ок, теперь я понимаю, к каким негативным результатам привело бы мое действие&raquo;?</p>\r\n<p>Хорошо, если кнопки информативны настолько, что, даже не читая общего текста, пользователь может сделать правильный выбор.</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4d7c5fd8f.jpg\" alt=\"\" /></p>\r\n<p><strong>2</strong>.<span>&nbsp;</span><strong>Не используйте на экране подтверждения больше 2 кнопок</strong></p>\r\n<p>В большинстве случаев заголовок можно сформулировать как бинарный вопрос с двумя вариантами ответа в виде кнопок. Важно, чтобы кнопки отличались друг от друга и между ними было легко выбирать.</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4d9ec8474.jpg\" alt=\"\" /></p>\r\n<p><strong>3. Если событие имеет критичные и необратимые последствия, дополнительно укажите на это в кнопке&nbsp;</strong></p>\r\n<p>Кнопки, которые отличаются от стандартных &laquo;Продолжить&raquo;, &laquo;Установить&raquo; и пр., привлекают больше внимания. Они могут заставить пользователя остановиться, задуматься и принять более осознанное решение</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4dbb36c14.jpg\" alt=\"\" /></p>\r\n<p><strong>4. Не манипулируйте&nbsp;</strong></p>\r\n<p>Не подменяйте понятия в кнопках и не пытайтесь любыми силами остановить пользователя &mdash; например, от удаления заказа. Вряд ли это путь к долгим и счастливым отношениям :-)</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a4ddd0a3bd.jpg\" alt=\"\" /></p>', 41, 'uploads/images/2022/10/image_750x500_635a4c8f78344.jpg', 'uploads/images/2022/10/image_750x_635a4c8f8703a.jpg', 'uploads/images/2022/10/image_600x460_635a4c8f94980.jpg', 'uploads/images/2022/10/image_380x226_635a4c8fa0ede.jpg', 'uploads/images/2022/10/image_140x98_635a4c8faa754.jpg', 'jpg', 'local', '', 22, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, '2022-10-27 11:23:22', '2022-10-27 11:16:41'),
(930, 1, 'Как снизить стоимость лида с помощью воронки спроса?', 'kak-snizit-stoimost-lida-s-pomoshchyu-voronki-sprosa', NULL, '', 'Это принцип распределения клиентов по стадиям процесса продаж от первого контакта до заключения сделки.', '<div class=\"l-island-a\">\r\n<p><b>Как её внедрить в свой бизнес или бизнес клиента?</b></p>\r\n</div>\r\n<div class=\"l-island-a\">\r\n<ol>\r\n<li><b>Прорабатываем три кита успешного маркетинга: Продукт/ЦА/УТП</b></li>\r\n</ol>\r\n</div>\r\n<figure>\r\n<div>\r\n<div class=\"booster-promo booster-promo--externalLink booster-promo--between_entry_blocks l-island-a\">\r\n<div class=\"booster-promo__inner\">\r\n<div class=\"booster-promo__head\">\r\n<div data-gtm=\"Booster &mdash; Create in Entry &ndash; Text &mdash; Click\" class=\"booster-promo__button\">Создать объявление</div>\r\n<div data-gtm=\"Booster &mdash; Create in Entry &ndash; Text &mdash; Click\" class=\"booster-promo__button\">\r\n<div class=\"l-island-a\">\r\n<p><i>Без этого бизнес прогорит!</i></p>\r\n</div>\r\n<div class=\"l-island-a\">\r\n<p>Сейчас идёт огромная конкуренция в рекламных каналах. Только представь, сколько бизнесов таргетируется на, условно, жителей Москвы в возрасте 20-45 лет. Это и авто, и недвижка, и товарка, и стройка. Не зная своей ЦА мы не сможем разделить её на сегменты. Не зная своей<i><span>&nbsp;</span>ЦА</i>, мы не сможем предложить ей наш<span>&nbsp;</span><i>продукт</i><span>&nbsp;</span>по вкусному<span>&nbsp;</span><i>УТП.<span>&nbsp;</span></i>И будем вынуждены платить за заявки<span>&nbsp;</span><b>очень дорого.</b></p>\r\n</div>\r\n<div class=\"l-island-a\">\r\n<p>2.<b><span>&nbsp;</span>Прорабатываем воронку спроса.</b></p>\r\n</div>\r\n<div class=\"l-island-a\">\r\n<p>Зачем?</p>\r\n</div>\r\n<div class=\"l-island-a\">\r\n<p>За тем, что в социальных сетях трудно понять какой сформирован спрос у каждой конкретной группы аудитории.</p>\r\n</div>\r\n<div class=\"l-island-a\">\r\n<p>У нас есть 7 этапов:<br />1) Человек ещё не знает о тебе, о товаре, об услуге. На данном этапе нам надо показать человеку, что у него есть потребность, задача, проблема, которую ты или твой бизнес могут решить. (не знает, что у него могут быть плохие анализы. Не знает, что на него могут подать в суд и он обанкротится)<br />2) Следующий этап &ndash; осознание. Человек понял, что его жизнь может стать лучше/проще благодаря тебе<br />3) На этом этапе, человек начинает интересоваться &laquo;а как это работает?&raquo; &laquo;а для чего это нужно?&raquo;. Возможно, у него возникнет какой-нибудь страх? Например потери бизнеса. Или наоборот радость? Например, новость о том, что он проживет дольше, воспользовавшись нашей услугой. Прорабатывания объявления, стоит играть на эмоциях клиента.<br />4) Желание. Человек не определился с выбором исполнителя или товара, но он точно знает, что ему это надо. Думаем, какие критерии выбора возникают у твоего клиента? Подумай, что им важно. Все нюансы нужно знать на этапе желания<br />5) Покупка. На этом этапе продумываем всё, что может отпугнуть клиента. Что его может простимулировать купить это здесь и сейчас? Казалось бы на этом всё, но нет.<br />6) Доп.покупки. Это мелкие допродажи, которые идут сначала до основного продукта, а потом плюсом с ним, вплоть до полного комплекса. Важный этап, который многие упускают. Этот этап даёт клиенту выбор.<br />7) Подписка. &laquo;плати нам Х сумму в месяц, а мы будем контролировать&hellip;&raquo; Этап для увеличения LTV.</p>\r\n<div class=\"content content--full \">\r\n<div class=\"l-island-a\">\r\n<p>3. На тему допов, о которых писал выше.<br /><i><b>\"Эмоции предвкушения намного сильнее, чем эмоции обладания\"</b></i><br />Вспомни, когда задумаешься \"а надо ли мне ещё что-то предложить моему клиенту?\"<br />Представим состоятельного мужчину, который занимается своими делам и всё у него прекрасно. В один из вечеров, лежа дома на диване, он листает ленту в соц.сети и натыкается на короткий видеоролик про хоккей. Казалось бы, ну хоккей и хоккей, но<span>&nbsp;</span><i>мужика пробивает на эмоции</i>. Он яростно начинает поглащать весь контент на эту тематику, он тут же включает себе сериал \"Молодежка\" и смотрит его до утра.<br />Чего это он, спросишь ты? Оказывается, в далёком детстве<span>&nbsp;</span><i>хоккей был его любимый вид спорта</i>. Он вспоминает, как днями напролёт мог ни пить, ни есть, а тренировался на корту. Накатывают прежние эмоции, его охватывает ностальгия и он<span>&nbsp;</span><i>принимает решение, купить себе клюшку</i>.<br />За вечер пересмотрев тонну материала на тему \"как выбрать клюшку\", всё таки нашёл интернет магазин от какого-то известного хоккеиста. Переходит на него и (!)... о боги... он видит свою мечту. Без лишних раздумий клюшка летит в корзину.<span>&nbsp;</span><i>Покупка на 300$ моментально оплачивается</i>.<br />Мужик на 7 небе от счастья уже попадает на страницу благодарности за покупку и видит сообщение. \"Ты купил такую клюшку, а шайбу забыл? Разве с такой клюшкой можно играть в дешевых перчатках? Обычно, такой набор мы продаем за 800$, но тебе он достанется со скидкой, так ещё и в подарок положим защиту на ноги\" Что в этот момент думает наш мужик? Правильно, он уже не мужик, а будущий хоккеист, поэтому и эта покупка отлетает в корзину и<span>&nbsp;</span><i>общая сумма с 300$ увеличивается до 1000$</i>.<br />Всю неделю он ходит заряженный позитивом, потому что к нему идёт его мечта детства, а это очень сказывается на его карьере, неожиданное повышение за выполненный план за неделю, который был рассчитан на месяц.<br />Стоит ли дальше говорить, что хоккеистом он не стал, а клюшка так и стоит в углу, а остальной набор пылится на полке? Стоит ли говорить, что не он один на эмоциях отоварился на круглую сумму? Прибыль такого магазина возрастает в 3 раза без вложений. Круто? Да, несомненно<br />Сейчас можно сказать, что мы воспользовались человеком, что это не честно, но я с этим не соглашусь. Эмоции, которые он получал всю неделю, повышение на работе, и много других аспектов, которые происходили с ним, стоят куда больше этих 1000$.<br />Думаю, теперь ни у кого не останется сомнений, что допы, это важно, и не стоит ими пренебрегать.</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n<figure class=\"figure-image\">\r\n<div class=\"l-island-b\">\r\n<div class=\"content-image content-image--59a2c9c8-b68d-54b8-975f-de7cea30f343\">\r\n<div class=\"andropov_image andropov_image--zoomable\" air-module=\"module.andropov\" data-andropov-type=\"image\" data-image-width=\"565\" data-image-height=\"548\" data-image-max-width=\"474\" data-image-max-height=\"548\" data-image-src=\"https://leonardo.osnova.io/59a2c9c8-b68d-54b8-975f-de7cea30f343/\"></div>\r\n</div>\r\n</div>\r\n</figure>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</figure>', 61, 'uploads/images/2022/10/image_750x500_635a55b44875b.jpg', 'uploads/images/2022/10/image_750x_635a55b451a28.jpg', 'uploads/images/2022/10/image_600x460_635a55b45b969.jpg', 'uploads/images/2022/10/image_380x226_635a55b461fb7.jpg', 'uploads/images/2022/10/image_140x98_635a55b465b4a.jpg', 'jpg', 'local', '', 3, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-27 11:56:41'),
(931, 1, 'Патент на дизайн интерфейса', 'patent-na-dizayn-interfeysa', NULL, 'itfox, habr, community, programming community, turkmenportal', 'Для бизнеса сайты и приложения стали основными площадками для продаж. Плагиат дизайна интерфейса – частое явление. Скопировать чужую идею легче и быстрее, чем создать свою. Защитить дизайн интерфейса можно с помощью получения патента на промышленный образец. Защитить можно одну иконку, набор или весь интерфейс полностью.', '<p>Как стать обладателем патента на дизайн интерфейса, расскажем в этой статье.</p>\r\n<h3>Что такое патент на промышленный образец?</h3>\r\n<p>Патент на промышленный образец &ndash; документ, который защищает внешний вид изделия: сайта, приложения.</p>\r\n<p>Владелец патента имеет право:</p>\r\n<ul>\r\n<li>\r\n<p>использовать объект в своих целях;</p>\r\n</li>\r\n<li>\r\n<p>запрещать использование другим лицам;</p>\r\n</li>\r\n<li>\r\n<p>передавать объект по лицензии и договору отчуждения.</p>\r\n</li>\r\n</ul>\r\n<p>Получить патент можно только на уникальный дизайн интерфейса. При проверке учитываются все известные решения в России и мире. Срок действия патента &ndash; 25 лет. При этом необходимо уплачивать ежегодную пошлину за его поддержание, начиная с 3 года владения, и продлять каждые 5 лет. За продление платить не надо.</p>\r\n<p>Патент действует только на территории России. При необходимости можно подать заявку в патентные ведомства интересующих стран или по Гаагской системе международной регистрации промышленных образцов. Получить охрану промышленного образца сразу во всех государствах невозможно.</p>\r\n<p>Дизайн одновременно является объектом авторского права. Для защиты не нужно проходить государственную регистрацию, авторские права возникают по умолчанию в момент создания макета. Произведение охраняется полностью. Будущий владелец патента перед подачей заявки должен убедиться, что исключительное право по договору принадлежит ему, а не дизайнеру-автору, если тот участвовал в разработке.</p>\r\n<p>Заявку в Роспатент могут подавать как физические, так и юридические лица. Обычно заявителями бывают:</p>\r\n<ul>\r\n<li>\r\n<p>авторы &ndash; дизайнеры;</p>\r\n</li>\r\n<li>\r\n<p>патентные поверенные, действующие в интересах правообладателя;</p>\r\n</li>\r\n<li>\r\n<p>заказчики, имеющие исключительное право на созданные дизайнером решения;</p>\r\n</li>\r\n<li>\r\n<p>работодатели, если дизайн создан в рамках служебного произведения.&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p><em>Яндекс зарегистрировал интерфейс своих приложений Яндекс Карты, Яндекс Такси в Роспатенте.</em></p>\r\n<p>Авторское право защищает вашу разработку от копирования, то есть создания тождественного дизайна. При получении патента ваши права расширяются. Регистрация дизайна в Роспатенте &ndash; защита не только от тождественных решений, но и от схожих.</p>\r\n<p>Защитить с помощью патента можно только особенности вашего дизайна, а не все детали, в том числе стандартные для любого сайта. На чертеже неподлежащие охране элементы можно обозначить пунктирными линиями.&nbsp; Графический интерфейс обычно включает много шаблонных текстовых полей, слайдеров и&nbsp;других стандартных элементов. На них получить патент нельзя. На регистрацию можно подать web-страницу целиком или только одну иконку.</p>\r\n<p>Авторское право, в отличие от патентного, защищает произведение в полном объеме. Вы можете придумать дизайн, который очень похож на уже существующий, ваш объект будет под защитой авторского права. А для получения патента дизайнерское решение должно быть действительно уникальным: чем больше отличий от ближайшего аналога, тем лучше.</p>\r\n<p>После получения патента вы сами должны мониторить нарушителей, ограничивать их действия, защищать свои права в претензионном и судебном порядке. Роспатент не занимается выявлением нарушений и привлечением к ответственности нарушителей. В России пока нет обширной практики по защите дизайна сайта и интерфейса, но прецеденты есть.</p>\r\n<p>Зарегистрированный дизайн или интерфейс повышает инвестиционную привлекательность компании. Это нематериальный актив, который может использоваться в качестве залога при получении кредита, также с его помощью можно снизить налогооблагаемую базу.&nbsp;</p>\r\n<p>Минус получения патента &ndash; защита распространяется только на зарегистрированный интерфейс. Если вы вносите изменения в запатентованный объект, патент теряет силу. Регистрировать придется новый внешний вид. Поэтому мы рекомендуем патентовать конечный вариант дизайна.</p>\r\n<h3>Как получить патент на дизайн интерфейса?</h3>\r\n<p>В первую очередь нужно провести предварительный патентный поиск. Это можно сделать самостоятельно или с помощью патентного поверенного. При самостоятельном поиске используйте сайт ФИПС, Международную поисковую систему<span>&nbsp;</span><a href=\"https://www.tmdn.org/tmdsview-web/welcome\" rel=\"noopener noreferrer nofollow\">DesignView</a>, международную базу данных<span>&nbsp;</span><a href=\"http://www.wipo.int/ipdl/en/hague/search-struct.jsp\" rel=\"noopener noreferrer nofollow\">Hague Express</a>,&nbsp;<a href=\"https://oami.europa.eu/eSearch/#advanced/designs\" rel=\"noopener noreferrer nofollow\">базу данных промышленных образцов</a><span>&nbsp;</span>ЕС. Если найден схожий дизайн, вы можете доработать свой макет до патентоспособности. Нужно выявить схожие характеристики и постараться уникализировать элементы.</p>\r\n<p>В заявочную документацию на получение патента входит:</p>\r\n<ul>\r\n<li>\r\n<p>заявление;</p>\r\n</li>\r\n<li>\r\n<p>изображения изделия, в нашем случае сайта или приложения;</p>\r\n</li>\r\n<li>\r\n<p>чертеж;</p>\r\n</li>\r\n<li>\r\n<p>описание объекта;</p>\r\n</li>\r\n<li>\r\n<p>квитанция об оплате госпошлины.</p>\r\n</li>\r\n</ul>\r\n<p>Как правильно заполнить заявку, можно узнать<span>&nbsp;</span><a href=\"https://www.consultant.ru/document/cons_doc_LAW_192300/12b65c25606650edc23c7dce7235e543d29d21de/\" rel=\"noopener noreferrer nofollow\">здесь.</a><span>&nbsp;</span>Нельзя допускать ошибок, иначе эксперты отклонят заявку.</p>\r\n<p>На регистрацию подается макет, который представляет собой структуру сайта с блоками и навигационными панелями: общая дизайн-концепция, расположение графических элементов, видеоматериалов, текста, построение меню, навигации. Не нужно указывать несущественные мелочи и сам текст. Интерфейс также можно зарегистрировать по частям, например анимацию и иконки.</p>\r\n<p>При описании дизайна нужно уделить особое внимание его особенностям. Вы должны убедить эксперта в уникальных характеристиках вашей разработки. Чем подробнее вы распишите информацию о вашем дизайне, тем выше степень защиты, которую он получит. Это объясняется тем, что грамотное расширенное описание увеличивает объем охраняемого объекта. Конкурентам будет сложнее зарегистрировать или использовать аналогичное решение. Для наглядности выбирают несколько похожих дизайнов и на их примере раскрывают уникальность.</p>\r\n<p>За регистрацию уплачиваются пошлины, размер можно рассчитать<span>&nbsp;</span><a href=\"https://www.fips.ru/podacha-zayavki/kalkulyator-poshlin/index.php\" rel=\"noopener noreferrer nofollow\">на сайте Роспатента.</a><span>&nbsp;</span>Если подать заявку в электронной форме, то пошлина снизится на 30%. Заявка в этом случае подписываются усиленной квалифицированной электронной подписью. Обратите внимание на то, что ФИО индивидуального предпринимателя или название организации плательщика должны совпадать с информацией о заявителе. Квитанция прикладывается к заявке. Регистрация длится до 20 месяцев, на практике мы получаем патенты в течение 6 месяцев.</p>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a5629533c1.jpg\" alt=\"\" /></p>\r\n<p>В ходе формальной экспертизы проверяют, все ли документы предоставлены, правильно ли они оформлены. Могут запросить дополнительные сведения, если это необходимо. Экспертиза по существу проверяет представленный макет на новизну и оригинальность. Рассматривают не только зарегистрированные аналоги, но всё, что найдется в Интернете. Обычно процедура длится от 6 до 12 месяцев. Но в нашей практике встречаются случаи прохождения этого этапа за 4-6 месяцев.</p>\r\n<p>Если дизайн или графический интерфейс признан патентоспособным, вы получите патент. В документе указывают как автора, так и правообладателя. Это могут быть два разных человека: заказчик &ndash; правообладатель, дизайнер &ndash; автор. Дизайнеры редко патентуют собственные разработки, обычно в этом заинтересованы заказчики, чтобы закрепить за собой исключительные права.</p>\r\n<p>Автор не сможет без согласия правообладателя совершать с объектом какие-либо действия. Авторов и патентообладателей может быть несколько, закон допускает такую ситуацию.</p>\r\n<p>Патент выдается в электронном виде. Чтобы получить бумажный вариант документа, нужно оплатить дополнительную пошлину.</p>\r\n<h3>Почему авторского права недостаточно для защиты?</h3>\r\n<p>Как мы уже говорили, авторское право защищает только от копирования. Редко нарушители делают полный плагиат. И даже в этом случае требуется проведение экспертиз. К тому же доказать, что именно вы &ndash; автор или правообладатель на словах не получится. В судебном споре одержать победу с первого раза сложно. Хорошо если есть договор между заказчиком и дизайнером.</p>\r\n<p>Патент защищает даже от появления у конкурентов схожих решений. Как правило, горе-разработчики берут основу, но стараются дополнить ее новыми элементами. В суде при наличии сходства доказывать авторство и обладание правами не придется. Патент &ndash; это и есть доказательство.</p>', 61, 'uploads/images/2022/10/image_750x500_635a56587635c.jpg', 'uploads/images/2022/10/image_750x_635a565882b77.jpg', 'uploads/images/2022/10/image_600x460_635a56588eb62.jpg', 'uploads/images/2022/10/image_380x226_635a565898de0.jpg', 'uploads/images/2022/10/image_140x98_635a5658a02d4.jpg', 'jpg', 'local', '', 3, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-27 11:58:56'),
(932, 1, 'Брось себе вызов ‒ сможешь ли стать системным аналитиком?', 'bros-sebe-vizov-smozhesh-li-stat-sistemnim-analitikom', NULL, '', 'Системный аналитик превращает хаос в красивые решения и наводит порядок. Эта роль ‒связующее звено между заказчиком и программистом, аналитик переводит с бизнесового на технический язык. Профессия сложная, но интересная и перспективная, поэтому если хочешь перейти в ИТ, обратите внимание на эту профессию.', '<p>В школе оценивают ваши знания с помощью ЕГЭ или экзаменов для поступления в ВУЗ на конкретную специальность. Предлагаю проверить знания по системному анализу в тесте<span>&nbsp;</span><a href=\"https://forms.gle/qNkpKdPcKKH2dqWSA\" rel=\"noopener noreferrer nofollow\"><strong>&laquo;Готов ли я стать системным аналитиком&raquo;</strong></a>. После прохождения вы узнаете насколько велики ваши шансы стать системным аналитиком или нужно уделить внимание подготовке. Если тест покажет, что необходимо еще набраться знаний, то приходите на курс<span>&nbsp;</span><a href=\"https://stepik.org/a/68303\" rel=\"noopener noreferrer nofollow\"><strong>&laquo;Системный аналитик с нуля&raquo;</strong></a>, чтобы сэкономить время на поиске материала в интернете&nbsp;<span>&nbsp;</span><em>(прим. информация в статье и тестирование<span>&nbsp;</span></em>‒<em><span>&nbsp;</span>это мое личное мнение, которое может не совпадать с мнением читателя)</em>.</p>\r\n<p>С помощью теста вы пройдете самопроверку перед собеседованием.</p>\r\n<p>Тест бесплатный и состоит из 25 заданий: теория ‒ 20 заданий и практика ‒ 5 заданий. Прохождение теста займет не более 30 минут. Важно проходить тест без помощи интернета, потому что это позволит оценить знания, а не навык владения поиском в интернете.</p>\r\n<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<h2>Результаты тестирования</h2>\r\n<details class=\"spoiler\">\r\n<summary>0 ‒ 39 баллов</summary>\r\n<div class=\"spoiler__content\">\r\n<p><strong></strong><a href=\"https://stepik.org/a/68303\" rel=\"noopener noreferrer nofollow\"></a></p>\r\n</div>\r\n</details><details class=\"spoiler\">\r\n<summary>40 ‒ 79 баллов</summary>\r\n<div class=\"spoiler__content\">\r\n<p><strong></strong><a href=\"https://stepik.org/a/68303\" rel=\"noopener noreferrer nofollow\"></a></p>\r\n</div>\r\n</details><details class=\"spoiler\">\r\n<summary>80 ‒ 100 баллов</summary>\r\n<div class=\"spoiler__content\">\r\n<p></p>\r\n</div>\r\n</details>\r\n<h2>Информация о курсе &laquo;Системный аналитик с нуля&raquo;</h2>\r\n<h3>Кому подходит курс</h3>\r\n<div class=\"persona\" persona=\"true\">\r\n<h5 class=\"persona__heading\" persona=\"true\">Вы без опыта работы и хотите освоить профессию системный аналитик</h5>\r\n</div>\r\n<div class=\"persona\" persona=\"true\">\r\n<h5 class=\"persona__heading\" persona=\"true\">Вы системный аналитик на испытательном сроке и хотите закрыть пробелы в знаниях по некоторым темам</h5>\r\n</div>\r\n<div class=\"persona\" persona=\"true\">\r\n<h5 class=\"persona__heading\" persona=\"true\">Вы системный аналитик с опытом 3+ лет и хотите подготовиться к собеседованию</h5>\r\n</div>\r\n<div class=\"persona\" persona=\"true\">\r\n<h5 class=\"persona__heading\" persona=\"true\">Вы специалист из смежной ИТ профессии (product owner,&nbsp;project manager,&nbsp;бизнес аналитик,&nbsp;сопровождение)</h5>\r\n<p></p>\r\n</div>\r\n<h3>Фишка курса</h3>\r\n<p>1️⃣ без воды, только необходимая теория для выполнения практики</p>\r\n<p>2️⃣ можно пройти за месяц и пойти на собеседование</p>\r\n<p>3️⃣ актуальный материал с практическими примерами</p>\r\n<h3>Что вы узнаете на курсе</h3>\r\n<p>В курсе собрана информация по основным требованиям из большинства вакансий на системного аналитика</p>\r\n<p>☑️ Проектировать интеграции с помощью REST</p>\r\n<p>☑️ Писать SQL запросы и проектировать базы данных</p>\r\n<p>☑️ Разбираться в способах интеграции систем</p>\r\n<p>☑️ Описывать требования к продукту, знать нотации UML/BPMN</p>\r\n<p>☑️ Понимать команду, работая в их методологии разработки</p>\r\n<p>Курс<span>&nbsp;</span><a href=\"https://stepik.org/a/68303\" rel=\"noopener noreferrer nofollow\"><strong>&laquo;Системный аналитик с нуля&raquo;</strong></a>&nbsp;состоит из 5 модулей</p>\r\n<details class=\"spoiler\">\r\n<summary>1. Системный аналитик: особенности профессии и обязанности</summary>\r\n<div class=\"spoiler__content\">\r\n<p></p>\r\n</div>\r\n</details><details class=\"spoiler\">\r\n<summary>2. Hards skills: подготовка требований</summary>\r\n<div class=\"spoiler__content\">\r\n<p></p>\r\n</div>\r\n</details><details class=\"spoiler\">\r\n<summary>3. Hards skills: проектирование интеграции систем&nbsp;</summary>\r\n<div class=\"spoiler__content\">\r\n<p></p>\r\n</div>\r\n</details><details class=\"spoiler\">\r\n<summary>4. Soft skills: как аналитику их развивать</summary>\r\n<div class=\"spoiler__content\">\r\n<p></p>\r\n</div>\r\n</details><details class=\"spoiler\">\r\n<summary>5. Как написать резюме и пройти собеседование</summary>\r\n<div class=\"spoiler__content\">\r\n<p></p>\r\n</div>\r\n</details>\r\n<p>Попробуйте бесплатный урок на курсе&nbsp;<a href=\"https://stepik.org/a/68303\" rel=\"noopener noreferrer nofollow\"><strong>&laquo;Системный аналитик с нуля&raquo;</strong></a></p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 61, 'uploads/images/2022/10/image_750x500_635a573460237.jpg', 'uploads/images/2022/10/image_750x_635a57346f8b0.jpg', 'uploads/images/2022/10/image_600x460_635a57347e9c7.jpg', 'uploads/images/2022/10/image_380x226_635a57348ae59.jpg', 'uploads/images/2022/10/image_140x98_635a573493490.jpg', 'jpg', 'local', '', 3, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-27 12:02:32');
