(933, 1, 'Как дружить с БД VMware Cloud Director', 'kak-druzhit-s-bd-vmware-cloud-director', NULL, '', 'Иногда возникают ситуации, когда требуется работать с базой данных VMware Cloud Director не только с поддержкой инженеров вендора, но и самостоятельно: могут залипнуть объекты, невозможно переконфигурировать ВМ, не получается удалить или создать какие-либо объекты, необходимо перенастроить БД, восстановить работу PostgreSQL HA Cluster и т. д.', '<p>Главное примечание: все действия с БД вы выполняете на свой страх и риск, поэтому не забывайте про необходимость резервного копирования.&nbsp;</p>\r\n<h2>Настраиваем подключение к БД</h2>\r\n<p>Чтобы зайти в БД, нужно подключиться к ssh на cell напрямую и выполнить команду:</p>\r\n<pre><code class=\"bash hljs\">sudo -u postgres /opt/vmware/vpostgres/current/bin/psql -d vcloud -U postgres</code></pre>\r\n<p>Как предлагает это делать вендор, описано тут:<a href=\"https://docs.vmware.com/en/VMware-Cloud-Director/10.0/com.vmware.vcloud.install.doc/GUID-3A3BB3A9-F6F3-47BA-A785-2B99882A692B.html\"><span>&nbsp;</span><u>https://docs.vmware.com/en/VMware-Cloud-Director/10.0/com.vmware.vcloud.install.doc/GUID-3A3BB3A9-F6F3-47BA-A785-2B99882A692B.html</u></a></p>\r\n<p>Мягко говоря, не слишком подробно, поэтому распишу подключение по шагам.</p>\r\n<p>Сразу отмечу, что подключаться надо именно к primary cell, так как на secondary не будут отрабатываться запросы delete, update и т. д.&nbsp;&nbsp;</p>\r\n<h3>Разрешаем доступ к БД vcloud</h3>\r\n<p>Подключаемся по ssh на cell.</p>\r\n<p>Затем создаем файл remote.conf:</p>\r\n<p><em>vi /opt/vmware/appliance/etc/pg_hba.d/remote.conf</em></p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-comment\"># TYPE DATABASE USER ADDRESS METHOD</span>\r\nhost DB_name DB_user network/prefix md5</code></pre>\r\n<p>где DB_name &ndash; имя БД (в нашем случае vcloud), DB_user &ndash; по умолчанию vcloud, network/prefix &ndash; сеть, откуда можно подключиться к БД.</p>\r\n<p>Пример:</p>\r\n<pre><code># TYPE DATABASE USER ADDRESS METHOD\r\nhost vcloud vcloud 10.0.0.0/24 md5\r\nhost vcloud vcloud 192.168.0.15/32 md5</code></pre>\r\n<p>Как только закончили редактировать файл remote.conf, данные с файла автоматически добавятся в конец файла /var/vmware/vpostgres/10/pgdata/pg_hba.conf.<em><span>&nbsp;</span></em><strong>Однако иногда этого не происходит</strong>. Тогда можно добавить данные строки самостоятельно и перечитать конфиг:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/current/bin/psql -c <span class=\"hljs-string\">\'SELECT pg_reload_conf();\'</span></code></pre>\r\n<p>либо</p>\r\n<pre><code class=\"bash hljs\">sudo -u postgres /opt/vmware/vpostgres/current/bin/psql -d vcloud -U postgres\r\nSELECT pg_reload_conf();\r\n\\q</code></pre>\r\n<h3>Создаем пользователя</h3>\r\n<p>Если требуется создать пользователя для работы с БД стороннему приложению (мониторинг, биллинг и т. д.), то можно поступить следующим образом:</p>\r\n<pre><code class=\"bash hljs\">sudo -u postgres /opt/vmware/vpostgres/current/bin/psql -d vcloud -U postgres\r\ncreate role <span class=\"hljs-string\">\"test-user\"</span> login password <span class=\"hljs-string\">\'PASS!\'</span>;\r\nGRANT CONNECT ON DATABASE <span class=\"hljs-string\">\"vcloud\"</span> TO <span class=\"hljs-string\">\"test-user\"</span>;\r\nGRANT USAGE ON SCHEMA public TO <span class=\"hljs-string\">\"test-user\"</span>;\r\nGRANT SELECT ON ALL TABLES IN SCHEMA public TO <span class=\"hljs-string\">\"test-user\"</span></code></pre>\r\n<p>Созданный пользователь не будет иметь права на редактирование БД. Не забываем добавить разрешение в БД для данного пользователя в файле remote.conf:</p>\r\n<p><em>host vcloud test-user 192.168.100.10/32 md5</em></p>\r\n<h3>Открываем firewall</h3>\r\n<p>У Cloud Director два интерфейса: eth0 и eth1. Маршрут по умолчанию идет через eth0, а БД открыта в iptables только для eth1. Поэтому для доступа к БД со стороны сокета PostgreSQL нужно или открывать iptables на порт 5432 для eth0, или делать постоянный маршрут. Еще вариант: делать SNAT на шлюзе сети eth1 для трафика, пришедшего с места подключения к БД.</p>\r\n<p>Чтобы открыть iptables, нужно отредактировать файл /etc/systemd/scripts/ip4save-vmw, добавив до COMMIT строки:</p>\r\n<p>-A INPUT -s network/prefix -p tcp -m state --state NEW -m tcp --dport 5432 -j ACCEPT</p>\r\n<p>Пример:</p>\r\n<p><em>-A INPUT -s 192.168.0.15/32 -p tcp -m state --state NEW -m tcp --dport 5432 -j ACCEPT</em></p>\r\n<p>После этого перечитываем конфиг:</p>\r\n<p><em>iptables-restore &lt; /etc/systemd/scripts/ip4save-vmw</em></p>\r\n<p>Как настроить доступ к БД, узнали, теперь посмотрим, в каких случаях он нам может потребоваться.</p>\r\n<h2>1. Доступ к БД для поддержки вендора</h2>\r\n<p>По ssh можно работать с БД, но это не так удобно, как с использованием pgAdmin или любого аналогичного решения. Какой бы вариант вы ни выбрали, все необходимое в такой ситуации вам подскажет вендор.</p>\r\n<h2>2. Исправление записей БД самостоятельно</h2>\r\n<p>Проблемы, которые можно решить помощью БД, весьма разнообразны. Многие этого не подозревают, поэтому я приведу несколько примеров.</p>\r\n<h3>Ищем нужное значение в таблицах: функция глобального поиска</h3>\r\n<p>Для начала создадим функцию глобального поиска БД<span>&nbsp;</span><strong>global_search</strong>, которой нет в БД &laquo;из коробки&raquo;, но которая может понадобиться нам в дальнейшем.</p>\r\n<p>Подключаемся к БД и выполняем SQL-запрос:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">CREATE</span> <span class=\"hljs-keyword\">OR</span> <span class=\"hljs-keyword\">REPLACE</span> <span class=\"hljs-keyword\">FUNCTION</span> global_search(\r\nsearch_term <span class=\"hljs-built_in\">text</span>,\r\nparam_tables <span class=\"hljs-built_in\">text</span>[] <span class=\"hljs-keyword\">default</span> <span class=\"hljs-string\">\'{}\'</span>,\r\nparam_schemas <span class=\"hljs-built_in\">text</span>[] <span class=\"hljs-keyword\">default</span> <span class=\"hljs-string\">\'{public}\'</span>,\r\nprogress <span class=\"hljs-built_in\">text</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-literal\">null</span> <span class=\"hljs-comment\">-- \'tables\',\'hits\',\'all\'</span>\r\n)\r\n<span class=\"hljs-keyword\">RETURNS</span> <span class=\"hljs-keyword\">table</span>(schemaname <span class=\"hljs-built_in\">text</span>, tablename <span class=\"hljs-built_in\">text</span>, columnname <span class=\"hljs-built_in\">text</span>, rowctid tid)\r\n<span class=\"hljs-keyword\">AS</span> $$\r\n<span class=\"hljs-keyword\">declare</span>\r\n<span class=\"hljs-keyword\">query</span> <span class=\"hljs-built_in\">text</span>;\r\nhit boolean;\r\n<span class=\"hljs-keyword\">begin</span>\r\n<span class=\"hljs-keyword\">FOR</span> schemaname,tablename <span class=\"hljs-keyword\">IN</span>\r\n<span class=\"hljs-keyword\">SELECT</span> table_schema, table_name\r\n<span class=\"hljs-keyword\">FROM</span> information_schema.tables t\r\n<span class=\"hljs-keyword\">WHERE</span> (t.table_name=<span class=\"hljs-keyword\">ANY</span>(param_tables) <span class=\"hljs-keyword\">OR</span> param_tables=<span class=\"hljs-string\">\'{}\'</span>)\r\n<span class=\"hljs-keyword\">AND</span> t.table_schema=<span class=\"hljs-keyword\">ANY</span>(param_schemas)\r\n<span class=\"hljs-keyword\">AND</span> t.table_type=<span class=\"hljs-string\">\'BASE TABLE\'</span>\r\n<span class=\"hljs-keyword\">LOOP</span>\r\n<span class=\"hljs-keyword\">IF</span> (progress <span class=\"hljs-keyword\">in</span> (<span class=\"hljs-string\">\'tables\'</span>,<span class=\"hljs-string\">\'all\'</span>)) <span class=\"hljs-keyword\">THEN</span>\r\n<span class=\"hljs-keyword\">raise</span> info <span class=\"hljs-string\">\'%\'</span>, <span class=\"hljs-keyword\">format</span>(<span class=\"hljs-string\">\'Searching globally in table: %I.%I\'</span>,\r\nschemaname, tablename);\r\n<span class=\"hljs-keyword\">END</span> <span class=\"hljs-keyword\">IF</span>;\r\nquery := format(\'<span class=\"hljs-keyword\">SELECT</span> ctid <span class=\"hljs-keyword\">FROM</span> %I.%I <span class=\"hljs-keyword\">AS</span> t <span class=\"hljs-keyword\">WHERE</span> strpos(<span class=\"hljs-keyword\">cast</span>(t.* <span class=\"hljs-keyword\">as</span> <span class=\"hljs-built_in\">text</span>), %L) &gt; <span class=\"hljs-number\">0</span><span class=\"hljs-string\">\',\r\nschemaname,\r\ntablename,\r\nsearch_term);\r\nFOR rowctid IN EXECUTE query\r\nLOOP\r\nFOR columnname IN\r\nSELECT column_name\r\nFROM information_schema.columns\r\nWHERE table_name=tablename\r\nAND table_schema=schemaname\r\nLOOP\r\nquery := format(\'</span><span class=\"hljs-keyword\">SELECT</span> <span class=\"hljs-literal\">true</span> <span class=\"hljs-keyword\">FROM</span> %I.%I <span class=\"hljs-keyword\">WHERE</span> <span class=\"hljs-keyword\">cast</span>(%I <span class=\"hljs-keyword\">as</span> <span class=\"hljs-built_in\">text</span>)=%L <span class=\"hljs-keyword\">AND</span> ctid=%L<span class=\"hljs-string\">\',\r\nschemaname, tablename, columnname, search_term, rowctid);\r\nEXECUTE query INTO hit;\r\nIF hit THEN\r\nIF (progress in (\'</span>hits<span class=\"hljs-string\">\', \'</span><span class=\"hljs-keyword\">all</span><span class=\"hljs-string\">\')) THEN\r\nraise info \'</span>%<span class=\"hljs-string\">\', format(\'</span><span class=\"hljs-keyword\">Found</span> <span class=\"hljs-keyword\">in</span> %I.%I.%I <span class=\"hljs-keyword\">at</span> ctid %s<span class=\"hljs-string\">\',\r\nschemaname, tablename, columnname, rowctid);\r\nEND IF;\r\nRETURN NEXT;\r\nEND IF;\r\nEND LOOP; -- for columnname\r\nEND LOOP; -- for rowctid\r\nEND LOOP; -- for table\r\nEND;\r\n$$ language plpgsql;</span></code></pre>\r\n<p>Запускаем функцию global_search:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">SELECT</span> * <span class=\"hljs-keyword\">FROM</span> global_search (<span class=\"hljs-string\">\'searchWord\'</span>);</code></pre>\r\n<p>Поскольку поиск ведется по всей БД, он может идти долго. В ответ будет возвращена информация о местонахождении записи. Если при вызове данной функции вы получите ошибку, то либо вы подключились к secondary node, либо БД повреждена.</p>\r\n<p>Давайте рассмотрим несколько простых примеров исправления проблем через БД. До выполнения работ обязательно создавайте бэкапы.</p>\r\n<h3>Чистим inventory</h3>\r\n<p>Выключаем службы cell:</p>\r\n<pre><code class=\"bash hljs\">/opt/vmware/vcloud-director/bin/cell-management-tool cell -i `cat /var/run/vmware-vcd-cell.pid` -shutdown</code></pre>\r\n<p>Подключившись к БД, выполняем SQL-запрос:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">select</span> <span class=\"hljs-string\">\'delete from \'</span> || table_name || <span class=\"hljs-string\">\';\'</span> <span class=\"hljs-keyword\">from</span> INFORMATION_SCHEMA.TABLES <span class=\"hljs-keyword\">where</span> table_name <span class=\"hljs-keyword\">like</span> <span class=\"hljs-string\">\'%_inv\'</span> <span class=\"hljs-keyword\">and</span> TABLE_TYPE = <span class=\"hljs-string\">\'BASE TABLE\'</span>;</code></pre>\r\n<p>К полученному результату добавляем строку:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> property_map;</code></pre>\r\n<p>Нужно переместить ccr_ наверх и выполнить получившийся sql запрос.</p>\r\n<p>Пример:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> ccr_drs_host_group_host_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> ccr_drs_host_group_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> ccr_drs_rule_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> ccr_drs_vm_group_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> ccr_drs_vm_group_vm_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> ccr_drs_vm_host_rule_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> cluster_compute_resource_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> compute_resource_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> custom_field_manager_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> datacenter_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> datacenter_network_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> datastore_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> datastore_profile_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> drs_rule_vm_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> dv_portgroup_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> dv_switch_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> folder_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> managed_server_datastore_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> managed_server_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> managed_server_network_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> network_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> opaque_network_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> resource_pool_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> storage_pod_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> storage_profile_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> task_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> vm_dstore_metrics_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> vm_inv;\r\n<span class=\"hljs-keyword\">delete</span> <span class=\"hljs-keyword\">from</span> property_map;</code></pre>\r\n<p>После этого запускаем службы:</p>\r\n<pre><code class=\"bash hljs\">service vmware-vcd start</code></pre>\r\n<h3>Удаляем сеть из vApp</h3>\r\n<p>Привожу упрощенный пример, когда сеть надо удалить из всех vApp, а не из конкретной:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span> logical_network <span class=\"hljs-keyword\">where</span> <span class=\"hljs-keyword\">name</span>= <span class=\"hljs-string\">\'delete-test-network\'</span>;<br /></code></pre>\r\n<p><img src=\"http://itfox-tm.ru/uploads/images/2022/10/image_750x_635a582d0d265.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>В данном случае имеем всего 2 записи, scope_type=3 &ndash; это сеть, подключенная к vApp.</p>\r\n<p>Так как нам надо полностью избавиться от сети, то выполняем следующие SQL-запросы:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span> logical_network <span class=\"hljs-keyword\">where</span> <span class=\"hljs-keyword\">name</span>= <span class=\"hljs-string\">\'\'</span><span class=\"hljs-keyword\">delete</span>-<span class=\"hljs-keyword\">test</span>-network<span class=\"hljs-string\">\'\'</span> <span class=\"hljs-keyword\">and</span> scope_type=<span class=\"hljs-number\">3</span>;\r\n<span class=\"hljs-comment\">--update logical_network set rnet_id=null where name= \'\'delete-test-network\'\' and scope_type=3;</span></code></pre>\r\n<p>Теперь в GUI можно удалить данную сеть из vApp, а затем из организации.</p>\r\n<h3>Ищем объекты, которые занимают определенную Storage Policy</h3>\r\n<p>Когда вы пытаетесь удалить политику, которая, на ваш взгляд, не используется, и получаете ошибку &laquo;Storage policy \"SATA\" cannot be deleted since it is currently in use&raquo;, можно попробовать узнать, кто же ее использует:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span> public.ui_org_vdc_storage_class_view <span class=\"hljs-keyword\">where</span> sclass_name = <span class=\"hljs-string\">\'storage_policy_name\'</span> <span class=\"hljs-keyword\">and</span> vdc_name = <span class=\"hljs-string\">\'OrgVDC_name\'</span>;</code></pre>\r\n<p>Запоминаем<span>&nbsp;</span><strong>sclass_lr_id</strong><span>&nbsp;</span>и используем его в следующем SQL-запросе:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span>\r\n(\r\n<span class=\"hljs-keyword\">SELECT</span> *\r\n<span class=\"hljs-comment\">--ldisk_storage_class_join.storage_class_id AS storage_class_lr_id,</span>\r\n<span class=\"hljs-comment\">-- COALESCE(sum(logical_disk.size_bytes::numeric / 1048576.0), 0::numeric) AS storage_used_mb,</span>\r\n<span class=\"hljs-comment\">-- 0 AS storage_overhead_mb</span>\r\n<span class=\"hljs-keyword\">FROM</span> logical_disk\r\n<span class=\"hljs-keyword\">LEFT</span> <span class=\"hljs-keyword\">JOIN</span> ldisk_storage_class_join <span class=\"hljs-keyword\">ON</span> logical_disk.id = ldisk_storage_class_join.logical_disk_id\r\n<span class=\"hljs-keyword\">LEFT</span> <span class=\"hljs-keyword\">JOIN</span> ldisk_fo_join <span class=\"hljs-keyword\">ON</span> logical_disk.id = ldisk_fo_join.logical_disk_id\r\n<span class=\"hljs-keyword\">LEFT</span> <span class=\"hljs-keyword\">JOIN</span> disk <span class=\"hljs-keyword\">ON</span> disk.id = ldisk_fo_join.fo_id\r\n<span class=\"hljs-keyword\">LEFT</span> <span class=\"hljs-keyword\">JOIN</span> ( <span class=\"hljs-keyword\">SELECT</span> vm_disk.disk_id\r\n<span class=\"hljs-keyword\">FROM</span> vm_disk\r\n<span class=\"hljs-keyword\">GROUP</span> <span class=\"hljs-keyword\">BY</span> vm_disk.disk_id) vdisk <span class=\"hljs-keyword\">ON</span> vdisk.disk_id = ldisk_fo_join.fo_id\r\n<span class=\"hljs-keyword\">WHERE</span> (logical_disk.logical_disk_type::<span class=\"hljs-built_in\">text</span> = <span class=\"hljs-keyword\">ANY</span> (<span class=\"hljs-built_in\">ARRAY</span>[<span class=\"hljs-string\">\'CDROM\'</span>::bpchar::<span class=\"hljs-built_in\">character</span> <span class=\"hljs-built_in\">varying</span>, <span class=\"hljs-string\">\'FLOPPY\'</span>::bpchar::<span class=\"hljs-built_in\">character</span> <span class=\"hljs-built_in\">varying</span>]::<span class=\"hljs-built_in\">text</span>[])) <span class=\"hljs-keyword\">OR</span> logical_disk.logical_disk_type::bpchar = <span class=\"hljs-string\">\'DISK\'</span>::bpchar <span class=\"hljs-keyword\">AND</span> (vdisk.disk_id <span class=\"hljs-keyword\">IS</span> <span class=\"hljs-literal\">NULL</span> <span class=\"hljs-keyword\">OR</span> disk.sharing_type::<span class=\"hljs-built_in\">text</span> = <span class=\"hljs-string\">\'DISK_SHARING\'</span>::<span class=\"hljs-built_in\">text</span> <span class=\"hljs-keyword\">OR</span> disk.sharing_type::<span class=\"hljs-built_in\">text</span> = <span class=\"hljs-string\">\'CONTROLLER_SHARING\'</span>::<span class=\"hljs-built_in\">text</span>)\r\n<span class=\"hljs-comment\">-- GROUP BY ldisk_storage_class_join.storage_class_id</span>\r\n) <span class=\"hljs-keyword\">as</span> hui\r\n<span class=\"hljs-keyword\">where</span> hui.storage_class_id= sclass_lr_id</code></pre>\r\n<p>&nbsp;Получаем объекты в OrgVDC, которые расположены на данной политике.</p>\r\n<h3>Устраняем проблемы с Refresh storage policy</h3>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span> lock_handle;\r\n<span class=\"hljs-comment\">-- delete from lock_handle;</span>\r\n \r\n<span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span> lock_intent;\r\n<span class=\"hljs-comment\">-- delete from lock_intent;</span>\r\n \r\n<span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span> storage_profile_inv;\r\n<span class=\"hljs-comment\">-- delete from storage_profile_inv;</span></code></pre>\r\n<h3>Удаляем сбойные задания из организации</h3>\r\n<p>Иногда они появляются в ответе api-запроса при запросе конфигурации OrgVDC:</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span> org_prov_vdc <span class=\"hljs-keyword\">where</span> <span class=\"hljs-keyword\">name</span> <span class=\"hljs-keyword\">like</span> <span class=\"hljs-string\">\'%test-orgvcd%\'</span></code></pre>\r\n<p>записываем<span>&nbsp;</span><strong>id</strong><span>&nbsp;</span>организации.</p>\r\n<pre><code class=\"sql hljs\"><span class=\"hljs-keyword\">select</span> * <span class=\"hljs-keyword\">from</span> activity <span class=\"hljs-keyword\">where</span> state_handle <span class=\"hljs-keyword\">in</span> (<span class=\"hljs-keyword\">select</span> job_id <span class=\"hljs-keyword\">from</span> jobs <span class=\"hljs-keyword\">where</span> object_id = <span class=\"hljs-string\">\'id\'</span> <span class=\"hljs-keyword\">and</span> <span class=\"hljs-keyword\">status</span> = <span class=\"hljs-string\">\'3\'</span>)\r\n<span class=\"hljs-comment\">--delete from jobs where object_id = \'id\' and status = \'3\'</span></code></pre>\r\n<h2>3. Тюнинг БД</h2>\r\n<p>Иногда, с ростом инфраструктуры или в связи с обновлением, требуется изменить размер appliance, после чего для оптимальной работы VMware Cloud Director требуется внести изменения в работу БД.</p>\r\n<p>Если хотите более детально углубиться в требования, стоит почитать документ VMware Validated Design for Cloud Providers: Scale and Performance Guidelines для вашей версии Cloud Director.</p>\r\n<p>Рассмотрим тюнинг на примере VMware Cloud Director 10.3:<a href=\"https://cloudsolutions.vmware.com/content/dam/digitalmarketing/microsites/en/images/cloud-solutions/pdfs/VVD_for_Cloud_Providers_Scale_and_Performance-VCD_10.3.pdf\"><span>&nbsp;</span><u>https://cloudsolutions.vmware.com/content/dam/digitalmarketing/microsites/en/images/cloud-solutions/pdfs/VVD_for_Cloud_Providers_Scale_and_Performance-VCD_10.3.pdf</u></a>&nbsp;</p>\r\n<p>Проверяем текущие настройки БД:</p>\r\n<pre><code class=\"bash hljs\">sudo -u postgres /opt/vmware/vpostgres/current/bin/psql -d vcloud -U postgres\r\nshow all;</code></pre>\r\n<p>Эталонные значения:</p>\r\n<p>shared_buffers = 0.25 * (total RAM &ndash; 4 GB)</p>\r\n<p>effective_cache_size = 0.75 * (total RAM &ndash; 4 GB)</p>\r\n<p>work_mem = \'8MB\';\"</p>\r\n<p>maintenance_work_mem = \'1GB\';\"</p>\r\n<p>max_worker_processes = количество ядер на cell, но не меньше 8.</p>\r\n<p>&nbsp;</p>\r\n<p>Меняем на нужные, например:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres\r\npsql -c <span class=\"hljs-string\">\"ALTER SYSTEM set shared_buffers = \'7GB\';\"</span>\r\npsql -c <span class=\"hljs-string\">\"ALTER SYSTEM set effective_cache_size = \'21GB\';\"</span>\r\npsql -c <span class=\"hljs-string\">\"ALTER SYSTEM set work_mem = \'8MB\';\"</span>\r\npsql -c <span class=\"hljs-string\">\"ALTER SYSTEM set max_worker_processes = \'24\';\"</span>\r\npsql -c <span class=\"hljs-string\">\"ALTER SYSTEM set maintenance_work_mem = \'1GB\';\"</span></code></pre>\r\n<p>Копируем postgresql.auto.conf из primary node на standby node:</p>\r\n<pre><code class=\"bash hljs\">scp /var/vmware/vpostgres/current/pgdata/postgresql.auto.conf postgres@&lt;standby-node-address&gt;:/var/vmware/vpostgres/current/pgdata/</code></pre>\r\n<p>Запускаем службу vpostgres:</p>\r\n<pre><code class=\"bash hljs\">systemctl restart vpostgres</code></pre>\r\n<p>Для удаления ручных настроек используем команды ниже:</p>\r\n<pre><code class=\"bash hljs\"> psql -c <span class=\"hljs-string\">\"ALTER SYSTEM reset shared_buffers;\"</span>\r\n psql -c <span class=\"hljs-string\">\"ALTER SYSTEM reset effective_cache_size;\"</span>\r\n psql -c <span class=\"hljs-string\">\"ALTER SYSTEM reset max_worker_processes;\"</span></code></pre>\r\n<p>Официальная документация на данную тему:</p>\r\n<ol>\r\n<li>\r\n<p><a href=\"https://docs.vmware.com/en/VMware-Cloud-Director/10.3/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-B242C866-5547-4CB7-95AC-552FE25CDEBA.html\">https://docs.vmware.com/en/VMware-Cloud-Director/10.3/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-B242C866-5547-4CB7-95AC-552FE25CDEBA.html</a>&nbsp;</p>\r\n</li>\r\n<li>\r\n<p><a href=\"https://docs.vmware.com/en/VMware-Cloud-Director/10.3/vcd_103_install.pdf\">https://docs.vmware.com/en/VMware-Cloud-Director/10.3/vcd_103_install.pdf</a><span>&nbsp;</span>(стр. 40)</p>\r\n</li>\r\n</ol>\r\n<h2>4. Обслуживание БД при восстановлении работы HA кластера</h2>\r\n<p>Начиная c vCD 9.7 поддерживается схема из трех нод vCD с отказоустойчивой внутренней БД. Это привносит некоторые нюансы при работе с нодами vCD.&nbsp;</p>\r\n<p>Аварийные ситуации в работе БД могут возникнуть по таким причинам:</p>\r\n<ul>\r\n<li>\r\n<p>откат на состояние снапшота, где primary изменена на другую ноду;</p>\r\n</li>\r\n<li>\r\n<p>перезагрузка cell, когда Failover mode выставлен Automatic;</p>\r\n</li>\r\n<li>\r\n<p>выполнение каких-либо работ на cell, связанных с БД и прочее.</p>\r\n</li>\r\n</ul>\r\n<p>Официальную документацию, как следует действовать в данной ситуации, смотрите тут:</p>\r\n<p><a href=\"https://docs.vmware.com/en/VMware-Cloud-Director/10.4/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-BC8B408B-C024-4011-9107-B0238E190D9E.html\"><u>https://docs.vmware.com/en/VMware-Cloud-Director/10.4/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-BC8B408B-C024-4011-9107-B0238E190D9E.html</u></a></p>\r\n<p>Если вы не хотите по каким-либо причинам разворачивать новую ячейку, то можно воспользоваться unsupport-методами, описанными<span>&nbsp;</span><a href=\"https://fojta.wordpress.com/author/fojta/\">Tomas Fojta</a><span>&nbsp;</span>в статье:<span>&nbsp;</span><a href=\"https://fojta.wordpress.com/2019/05/23/vcloud-director-9-7-appliance-tips/\"><u>https://fojta.wordpress.com/2019/05/23/vcloud-director-9-7-appliance-tips/</u></a></p>\r\n<p>Статья актуальна и для более новых версий. Далее будут выжимки из его статьи и официальной документации.</p>\r\n<p>Итак, если возникла аварийная ситуация, то требуется:</p>\r\n<p>1. &nbsp; Если это возможно, выполнить резервную копию данных на текущей primary по инструкции:<span>&nbsp;</span><a href=\"https://docs.vmware.com/en/VMware-Cloud-Director/10.3/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-9562FBC9-4537-4FE6-B1CC-005C232A556D.html\"><u>https://docs.vmware.com/en/VMware-Cloud-Director/10.3/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-9562FBC9-4537-4FE6-B1CC-005C232A556D.html</u></a></p>\r\n<p>&nbsp;2. &nbsp; Классифицировать проблему, выполнив в консоли всех ячеек с базой данных команду:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf cluster show</code></pre>\r\n<p>По итогам вывода необходимо выполнить один из сценариев, описанных ниже.</p>\r\n<h4>Если произошел отказ одной standby-ноды:</h4>\r\n<ul>\r\n<li>\r\n<p>на работоспособность vCD не влияет;</p>\r\n</li>\r\n<li>\r\n<p>блокирует смену primary без --force.</p>\r\n</li>\r\n</ul>\r\n<ol>\r\n<li>\r\n<p>Восстанавливается включением standby или деплоем новой ячейки из ova (новая ячейка берет всю необходимую информацию из параметров при деплое и с NFS-шары).</p>\r\n<p>1.1. Если через деплой из ova:&nbsp;</p>\r\n<p>1.1.1. Удаляем потерянную ноду из postgres.</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf cluster show\r\nsudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf standby unregister --node-id=&lt;failed-standby-node-id&gt;</code></pre>\r\n<p>1.1.2. Удаляем потерянную ноду из интерфейса vCD.</p>\r\n<p>1.1.3. Разворачиваем новую ноду по инструкции:<span>&nbsp;</span><a href=\"https://docs.vmware.com/en/vCloud-Director/9.7/com.vmware.vcloud.install.doc/GUID-8278404A-4C98-47FF-98EE-911EBC4C654D.html\"><u>https://docs.vmware.com/en/vCloud-Director/9.7/com.vmware.vcloud.install.doc/GUID-8278404A-4C98-47FF-98EE-911EBC4C654D.html</u></a></p>\r\n<p>1.2. Если нужно вернуть существующую ноду, но она не подключается, например из-за того, что опережает primary node вследствие клонирования или восстановления из РК, то есть как минимум два пути: сделать ее primary node или инициализировать по новой с отстающей primary node.</p>\r\n<p>1.2.1. Останавливаем сервис БД на standby:</p>\r\n<pre><code class=\"bash hljs\">systemctl stop vpostgres.service</code></pre>\r\n<p>1.2.2 Перемещаем данные на standby (перед перемещением убедимся, что хватит места):</p>\r\n<pre><code class=\"bash hljs\">mv /var/vmware/vpostgres/current/pgdata /root</code></pre>\r\n<p>1.2.3 Клонируем данные с primary:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/current/bin/repmgr -h &lt;primary_database_IP&gt; -U repmgr -d repmgr -f /opt/vmware/vpostgres/current/etc/repmgr.conf standby <span class=\"hljs-built_in\">clone</span></code></pre>\r\n<p>1.2.4 Запускаем сервис БД:</p>\r\n<pre><code class=\"bash hljs\">systemctl start vpostgres.service</code></pre>\r\n<p>1.2.5 При необходимости регистрируем standby на primary (регистрация может не потребоваться, если stanby не удалялся из конфигурации primary):</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/current/bin/repmgr -h &lt;primary_database_IP&gt; -U repmgr -d repmgr -f /opt/vmware/vpostgres/current/etc/repmgr.conf standby register --force</code></pre>\r\n</li>\r\n</ol>\r\n<h4>Отказ primary-ноды:</h4>\r\n<ul>\r\n<li>\r\n<p>ведет к отказу интерфейса vCD;</p>\r\n</li>\r\n<li>\r\n<p>требует ручного переключения primary-ноды через веб-интерфейс той ноды, которая становится главной<span>&nbsp;</span><a href=\"http://fqdn:5480/\">http://fqdn:5480</a><span>&nbsp;</span>-&gt; promote;</p>\r\n</li>\r\n</ul>\r\n<ol>\r\n<li>\r\n<p>Включение старой primary-ноды ведет к ситуации с двумя primary: рабочая отмечена звездочкой *, выходившая из строя восклицательным знаком &ldquo;!&rdquo; или тире &ldquo;&ndash;&rdquo; с подписью failed, и ее нужно сделать standby. Вот тут будет самое интересное.</p>\r\n<p>1.1. Единственный поддерживаемый способ &ndash; это удаление прежней primary-ноды и деплой новой standby-ноды из ova.</p>\r\n<p>1.1.1. Удаляем потерянную ноду из postgres:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf primary unregister --node-id=&lt;failed-primary-node-id&gt;</code></pre>\r\n<p>1.1.2. Удаляем потерянную ноду из интерфейса vCD.</p>\r\n<p>1.1.3. Деплоим новую ноду по инструкции:<span>&nbsp;</span><a href=\"https://docs.vmware.com/en/vCloud-Director/9.7/com.vmware.vcloud.install.doc/GUID-8278404A-4C98-47FF-98EE-911EBC4C654D.html\">https://docs.vmware.com/en/vCloud-Director/9.7/com.vmware.vcloud.install.doc/GUID-8278404A-4C98-47FF-98EE-911EBC4C654D.html</a></p>\r\n<p>1.2. Есть и не поддерживаемый способ:<span>&nbsp;</span><a href=\"https://fojta.wordpress.com/2019/05/23/vcloud-director-9-7-appliance-tips/\">https://fojta.wordpress.com/2019/05/23/vcloud-director-9-7-appliance-tips/</a></p>\r\n<p>1.2.1. Останавливаем vpostgres на прежней primary (на той, что с восклицательным знаком!):</p>\r\n<pre><code class=\"bash hljs\">systemctl stop vpostgres.service</code></pre>\r\n<p>1.2.2. Удаляем данные на прежней primary (на той, что с восклицательным знаком!):</p>\r\n<pre><code class=\"bash hljs\">mv /var/vmware/vpostgres/current/pgdata /root</code></pre>\r\n<p>1.2.3 Клонируем данные:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/current/bin/repmgr -h &lt;primary_database_IP&gt; -U repmgr -d repmgr -f /opt/vmware/vpostgres/current/etc/repmgr.conf standby <span class=\"hljs-built_in\">clone</span></code></pre>\r\n<p>1.2.4 Если не работает и вылетает с ошибкой timeout, то используем IP с другого интерфейса.</p>\r\n<p>1.2.5 Запускаем сервис vpostgres:</p>\r\n<pre><code class=\"bash hljs\">systemctl start vpostgres.service</code></pre>\r\n<p>1.2.6 Добавляем ноду в кластер:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/current/bin/repmgr -h &lt;primary_database_IP&gt; -U repmgr -d repmgr -f /opt/vmware/vpostgres/current/etc/repmgr.conf standby register --force</code></pre>\r\n</li>\r\n</ol>\r\n<h4>Потеря двух standby-нод:</h4>\r\n<ul>\r\n<li>\r\n<p>ведет к недоступности интерфейса vCloud Director из-за перехода primary-ноды в read only;</p>\r\n</li>\r\n<li>\r\n<p>требует восстановления потерянных нод или деплоя новой ноды из ova с новым DNS-именем;</p>\r\n</li>\r\n</ul>\r\n<ol>\r\n<li>\r\n<p>Есть не поддерживаемый способ, который заключается в переводе оставшейся primary из HA группы в standalone<strong>:&nbsp;</strong></p>\r\n<p>1.1. Удаляем потерянные standby:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf cluster show\r\nsudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf standby unregister --node-id=&lt;failed-standby-id1&gt;\r\nsudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf standby unregister --node-id=&lt;failed-standby-id2&gt;</code></pre>\r\n<p>1.2. Удаляем потерянные ноды из интерфейса vCD;</p>\r\n<p>1.3. Удаляем каталоги потерянных нод с NFS-шары:</p>\r\n<pre><code class=\"bash hljs\">mv /opt/vmware/vcloud-director/data/transfer/appliance-nodes/node-&lt;UUID1&gt; /backup/location\r\nmv /opt/vmware/vcloud-director/data/transfer/appliance-nodes/node-&lt;UUID2&gt; /backup/location</code></pre>\r\n<p>1.4. Удаляем ноды из параметра synchronous_standby_names = \'\' в файле /var/vmware/vpostgres/current/pgdata/postgresql.conf, если они там остались (у меня при тестировании их не было).</p>\r\n<p>1.5. Перечитываем конфиг:</p>\r\n<pre><code class=\"bash hljs\">systemctl reload vpostgres.service</code></pre>\r\n<p>1.6. БД должна перейти в режим read-write.</p>\r\n</li>\r\n</ol>\r\n<h4>Отказ standby и primary:</h4>\r\n<ul>\r\n<li>\r\n<p>ведет к недоступности интерфейса vCloud Director из-за перехода standby-ноды в read only;</p>\r\n</li>\r\n<li>\r\n<p>оставшуюся standby можно поднять до primary, выполнив promote, но она останется в read only.</p>\r\n<ol>\r\n<li>\r\n<p>До promote требуется восстановление потерянных нод, после promote &ndash; вычистка NFS-шары и конфигов от старой primary и деплоя новой standby-ноды из ova с новым DNS-именем;</p>\r\n<p>1.1 Жмем promote для оставшейся standby.</p>\r\n<p>1.2 Удаляем потерянные ноды из postgres:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf cluster show\r\nsudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf primary unregister --node-id=&lt;failed-primary-id&gt;\r\nsudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf standby unregister --node-id=&lt;failed-standby-id&gt;</code></pre>\r\n<p>1.3. Исправляем IP-адрес primary БД в файлах:</p>\r\n<pre><code class=\"bash hljs\">/opt/vmware/vcloud-director/etc/responses.properties\r\n/opt/vmware/vcloud-director/etc/global.properties\r\n/opt/vmware/vcloud-director/data/transfer/responses.properties</code></pre>\r\n<p>1.4. Останавливаем vpostgres на отказавших primary и standby:</p>\r\n<pre><code class=\"bash hljs\">systemctl stop vpostgres.service</code></pre>\r\n<p>1.5. Удаляем данные на отказавших primary и standby:</p>\r\n<pre><code class=\"bash hljs\">mv /var/vmware/vpostgres/current/pgdata /root/</code></pre>\r\n<p>1.6. Клонируем данные:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/current/bin/repmgr -h &lt;primary_database_IP&gt; -U repmgr -d repmgr -f /opt/vmware/vpostgres/current/etc/repmgr.conf standby <span class=\"hljs-built_in\">clone</span></code></pre>\r\n<p>1.7. Если не работает и вылетает с ошибкой timeout, то используем IP с другого интерфейса.</p>\r\n<p>1.8. Запускаем сервис vpostgres:</p>\r\n<pre><code class=\"bash hljs\">systemctl start vpostgres.service</code></pre>\r\n<p>1.9. Добавляем ноду в кластер:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/current/bin/repmgr -h &lt;primary_database_IP&gt; -U repmgr -d repmgr -f /opt/vmware/vpostgres/current/etc/repmgr.conf standby register --force</code></pre>\r\n</li>\r\n</ol>\r\n</li>\r\n</ul>\r\n<h4>Потеря standby и primary</h4>\r\n<ul>\r\n<li>\r\n<p>ведет к недоступности интерфейса vCloud Director из-за перехода standby node в read only;</p>\r\n</li>\r\n<li>\r\n<p>оставшуюся standby node можно поднять до primary, выполнив promote, но она останется в read only.</p>\r\n<ol>\r\n<li>\r\n<p>До promote требуется восстановление потерянных нод, после promote нужна чистка NFS-шары и конфигов от старой primary и деплой новой standby-ноды из ova с новым DNS-именем.</p>\r\n<p>1.1. Promote оставшейся standby.</p>\r\n<p>1.2. Удаляем потерянные standby и primary из postgres и NFS:</p>\r\n<pre><code class=\"bash hljs\">sudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf cluster show\r\nsudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf primary unregister --node-id=&lt;failed-primary-id&gt;\r\nsudo -i -u postgres /opt/vmware/vpostgres/10/bin/repmgr -f /opt/vmware/vpostgres/10/etc/repmgr.conf standby unregister --node-id=&lt;failed-standby-id&gt;</code></pre>\r\n<p>1.3. Удаляем потерянные ноды из интерфейса vCD.</p>\r\n<p>1.4. Удаляем каталоги потерянных нод с NFS-шары:</p>\r\n<pre><code class=\"bash hljs\">mv /opt/vmware/vcloud-director/data/transfer/appliance-nodes/node-&lt;UUID1&gt; /backup/location\r\nmv /opt/vmware/vcloud-director/data/transfer/appliance-nodes/node-&lt;UUID2&gt; /backup/location</code></pre>\r\n<p>1.5. Исправляем IP-адреса БД в файлах:</p>\r\n<pre><code class=\"bash hljs\">/opt/vmware/vcloud-director/etc/responses.properties\r\n/opt/vmware/vcloud-director/etc/global.properties\r\n/opt/vmware/vcloud-director/data/transfer/responses.properties</code></pre>\r\n<p>1.6. Регистрируем имя новой ноды на DNS-сервере.</p>\r\n<p>1.7. Deploy новой временной standby с новым DNS-именем, для того чтобы вывести кластер из режима \"только чтение\" по инструкции:<span>&nbsp;</span><a href=\"https://docs.vmware.com/en/vCloud-Director/9.7/com.vmware.vcloud.install.doc/GUID-8278404A-4C98-47FF-98EE-911EBC4C654D.html\">https://docs.vmware.com/en/vCloud-Director/9.7/com.vmware.vcloud.install.doc/GUID-8278404A-4C98-47FF-98EE-911EBC4C654D.html</a></p>\r\n<p>1.8. Deploy новой standby со старыми DNS-именами по инструкции:<span>&nbsp;</span><a href=\"https://docs.vmware.com/en/vCloud-Director/9.7/com.vmware.vcloud.install.doc/GUID-8278404A-4C98-47FF-98EE-911EBC4C654D.html\">https://docs.vmware.com/en/vCloud-Director/9.7/com.vmware.vcloud.install.doc/GUID-8278404A-4C98-47FF-98EE-911EBC4C654D.html</a></p>\r\n<p>1.9. После восстановления прежней HA группы временную standby можно удалить.</p>\r\n</li>\r\n</ol>\r\n</li>\r\n</ul>\r\n<h4>Завершающий шаг</h4>\r\n<p>После восстановления работоспособности БД:</p>\r\n<ul>\r\n<li>\r\n<p>Восстанавливаем режим обработки отказов БД с<span>&nbsp;</span><strong>Indeterminate<span>&nbsp;</span></strong>на<strong><span>&nbsp;</span>Manual/Automatic</strong><span>&nbsp;</span>по инструкции:<span>&nbsp;</span><a href=\"https://docs.vmware.com/en/VMware-Cloud-Director/10.3/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-5DFEF587-29C0-46D4-89D8-8725EBFAEF19.html\"><u>https://docs.vmware.com/en/VMware-Cloud-Director/10.3/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-5DFEF587-29C0-46D4-89D8-8725EBFAEF19.html</u></a>&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p>То есть выполняем API-запрос:</p>\r\n<p>POST<span>&nbsp;</span><a href=\"https://vcd-cell-fqdn:5480/api/1.0.0/nodes/failover/%7Bdesired-mode\"><u>https://vcd-cell-fqdn:5480/api/1.0.0/nodes/failover/{desired-mode</u></a>}&nbsp;</p>\r\n<p>Authorization: Basic</p>\r\n<p>{desired-mode} - automatic/manual</p>\r\n<p>Либо через curl:</p>\r\n<pre><code class=\"bash hljs\">curl -X POST -H <span class=\"hljs-string\">\"Accept: application/json\"</span> -H <span class=\"hljs-string\">\"Authorization: Basic [[basicHash]]\"</span> <span class=\"hljs-string\">\"https://localhost/api/1.0.0/nodes/failover/{desired-mode}\"</span></code></pre>\r\n<ul>\r\n<li>\r\n<p>Проверяем результат по инструкции:<span>&nbsp;</span><a href=\"https://docs.vmware.com/en/VMware-Cloud-Director/10.3/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-E1B642AB-95CF-4B34-BAB1-8576A6E53C6A.html#GUID-E1B642AB-95CF-4B34-BAB1-8576A6E53C6A\"><u>https://docs.vmware.com/en/VMware-Cloud-Director/10.3/VMware-Cloud-Director-Install-Configure-Upgrade-Guide/GUID-E1B642AB-95CF-4B34-BAB1-8576A6E53C6A.html#GUID-E1B642AB-95CF-4B34-BAB1-8576A6E53C6A</u></a></p>\r\n</li>\r\n</ul>\r\n<p>Проверить Failover mode можно как в GUI апплаенса (<a href=\"https://vcd-cell-fqdn:5480/\"><u>https://vcd-cell-fqdn:5480</u></a>), так и через API-запрос:</p>\r\n<p>GET<span>&nbsp;</span><a href=\"https://vcd-cell-fqdn:5480/api/1.0.0/nodes\"><u>https://vcd-cell-fqdn:5480/api/1.0.0/nodes</u></a></p>\r\n<p>Authorization: Basic</p>\r\n<p>Либо через curl:</p>\r\n<pre><code class=\"bash hljs\">curl -X GET -H <span class=\"hljs-string\">\"Accept: application/json\"</span> -H <span class=\"hljs-string\">\"Authorization: Basic [[basicHash]]\"</span> <span class=\"hljs-string\">\"https://localhost/api/1.0.0/nodes\"</span></code></pre>\r\n<p>На этом пока все. Желаем вам удачи в эксплуатации БД VMware Cloud Director.</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<pre><code class=\"sql hljs\"></code></pre>', 40, 'uploads/images/2022/10/image_750x500_635a5866393c5.jpg', 'uploads/images/2022/10/image_750x_635a58663fc21.jpg', 'uploads/images/2022/10/image_600x460_635a5866491fc.jpg', 'uploads/images/2022/10/image_380x226_635a586650c68.jpg', 'uploads/images/2022/10/image_140x98_635a586655892.jpg', 'jpg', 'local', '', 24, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-27 12:07:39');
INSERT INTO `posts` (`id`, `lang_id`, `title`, `title_slug`, `title_hash`, `keywords`, `summary`, `content`, `category_id`, `image_big`, `image_default`, `image_slider`, `image_mid`, `image_small`, `image_mime`, `image_storage`, `optional_url`, `pageviews`, `need_auth`, `is_slider`, `slider_order`, `is_featured`, `featured_order`, `is_recommended`, `is_breaking`, `is_scheduled`, `visibility`, `show_right_column`, `post_type`, `video_path`, `video_storage`, `image_url`, `video_url`, `video_embed_code`, `user_id`, `status`, `feed_id`, `post_url`, `show_post_url`, `image_description`, `show_item_numbers`, `updated_at`, `created_at`) VALUES
(934, 1, '8 игр для школьников, которые научат текстовому программированию', '8-igr-dlya-shkolnikov-kotorie-nauchat-tekstovomu-programmirovaniyu', NULL, '', 'Сегодня хочу поделиться подборкой игр для детей и подростков, обучающих текстовому программированию. Научиться программировать можно самостоятельно, нужна только усидчивость и интерес к IT. ', '<p><strong>Ранее я уже публиковала подборку обучалок визуальному программированию,<span>&nbsp;</span></strong>лучше начать с этих приложений,<span>&nbsp;</span><strong>ребенку проще понять, как работают алгоритмы на визуальном материале</strong>. Немного освоившись, можно повысить уровень и перейти к изучению настоящих языков программирования!&nbsp;</p>\r\n<p>Для удобства я поделила игры, основываясь<span>&nbsp;</span><strong>на наличии русскоязычной локализации.<span>&nbsp;</span></strong>Большинство в подборке<span>&nbsp;</span><strong>браузерные</strong>, что очень удобно.<strong><span>&nbsp;</span>Начинать заниматься можно с 7 лет,</strong><span>&nbsp;</span>конечно, возможно, малышам потребуется помощь родителя.</p>\r\n<h3>Русскоязычные игры</h3>\r\n<ol>\r\n<li>\r\n<p><a href=\"https://app.codemonkey.com/\" rel=\"noopener noreferrer nofollow\"><u>CodeMonkey</u></a><span>&nbsp;</span>&mdash; отличная браузерная игра, чтобы разобраться в основах программирования.<span>&nbsp;</span><strong>Подойдет школьникам 9-14 лет без начальных знаний.<span>&nbsp;</span></strong>Цель игры &mdash; помочь обезьянке собрать бананы, сложность растет с каждым уровнем.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b82b2ba90a.jpg\" alt=\"\" /></p>\r\n<p><strong>Сначала ребенок знакомится с блочными и текстовым программированием, потом внедряются python и stem-технологии.</strong><span>&nbsp;</span>Игра поделена на курсы, поэтому при желании можно сразу перейти к задачам среднего или продвинутого уровня и сразу изучать Python. Большой плюс,<span>&nbsp;</span><strong>наличие русскоязычной локализации</strong>, она местами неидеальна, но все же позволяет учиться ребенку без знания языка.&nbsp;</p>\r\n<p><strong>Подписка на CodeMonkey стоит от 6$</strong><span>&nbsp;</span>(это доступ для одного ученика), есть<span>&nbsp;</span><strong>пробный период две недели</strong>, чтобы познакомиться с интерфейсом и оценить необходимость покупки. Платежи можно осуществлять с помощью кредитных карт, дебетовых карт, PayPal, AliPay, Skrill или банковского перевода. Приложение разработано тремя разработчиками из Израиля: братья Джонатан и Идо Шор и Яша Пинчовер в 2014 году.</p>\r\n<p>В Code Monkey играют по всему миру. Вот, например, отзыв из Китая:</p>\r\n<p>Hayes Zhong, отец 9-летнего сына:<span>&nbsp;</span><em>&ldquo;Я думаю, что Codemonkey отлично подходит для систематического обучения программированию для детей. Анимация очень забавная. Сложность каждого уровня совершенно правильная</em><strong><em>. Кроме того, благодаря механизму вознаграждения, мой сын проявляет инициативу в обучении.<span>&nbsp;</span></em></strong><em>Кроме того, мой сын сказал, что он выучил много английских слов во время учебы. Ему это очень нравится&rdquo;.</em></p>\r\n</li>\r\n<li>\r\n<p><a href=\"https://cssgridgarden.com/#ru\" rel=\"noopener noreferrer nofollow\"><u>GridGarden<span>&nbsp;</span></u></a>&mdash; браузерное приложение, которое<span>&nbsp;</span><strong>учит основам CSS</strong>. Задача игрока &mdash; вырастить морковный сад, поливая овощи, устраняя сорняки и т. д.&nbsp;</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b82d7ba2db.jpg\" alt=\"\" /></p>\r\n<p>Управление ведется с помощью текстового кода. Первые уровни игры достаточно простые и включают в себя подсказки, но все же лучше познакомиться с визуальным программированием, а потом перейти к GridGarden. Здесь всего<span>&nbsp;</span><strong>28 уровней, начать можно с любого</strong>, прохождение не займет много времени, в итоге обучения вы узнаете, что такое css grid и как с ними работать.<span>&nbsp;</span><strong>Простой минималистичный интерфейс<span>&nbsp;</span></strong>без лишних деталей позволяет быстро адаптироваться и сразу начать учиться, не разбираясь в меню и т.д.<strong><span>&nbsp;</span>Отлично подходит в качестве первой игры.</strong></p>\r\n<p>Играть в GridGarden можно<span>&nbsp;</span><strong>бесплатно, русский язык есть. Регистрация не нужна.<span>&nbsp;</span></strong>Игра выпущена компанией Codepip, которая специализируется на разработке обучающих игр.</p>\r\n</li>\r\n<li>\r\n<p>Аналог предыдущей игры &mdash;<span>&nbsp;</span><a href=\"https://flexboxfroggy.com/#ru\" rel=\"noopener noreferrer nofollow\"><u>FlexboyFroggy</u></a>, идентичная игра от тех же разработчиков, только персонажем выступает лягушонок.<strong><span>&nbsp;</span>В этой игре пользователь знакомится с понятием flexbox и учиться с ним работать.<span>&nbsp;</span></strong>24 уровня на пути к знанию CSS. У компании<span>&nbsp;</span><a href=\"https://codepip.com/\" rel=\"noopener noreferrer nofollow\"><u>Codepip</u></a><span>&nbsp;</span>есть еще много обучающих приложений, но не все они локализованы для России. Вы можете ознакомиться самостоятельно<span>&nbsp;</span><a href=\"https://codepip.com/\" rel=\"noopener noreferrer nofollow\"><u>на сайте.</u></a>&nbsp;</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b82fd25171.jpg\" alt=\"\" /><br /><br /></p>\r\n</li>\r\n<li>\r\n<p><a href=\"https://codecombat.com/\" rel=\"noopener noreferrer nofollow\"><u>CodeCombat<span>&nbsp;</span></u></a>&mdash; популярная во всем мире игра, которая<strong><span>&nbsp;</span>учит кодить на Python и JavaScript.<span>&nbsp;</span></strong>Игрок с помощью текстового кода управляет персонажем, собирает кристаллы и выполняет миссии.&nbsp;</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b832b39a9e.jpg\" alt=\"\" /></p>\r\n<p>Первые уровни достаточно простые, в целом разберется и новичок, но понимание азов лишним никогда не будет.<span>&nbsp;</span><strong>Игра имеет русскую локализацию. Играть можно бесплатно, а можно приобрести подписку за $3,99 за месяц или $39,60 за год</strong>. Подписка открывает больше уровней и персонажей. Здесь очень много уровней, играть интересно, CodeCombat действительно затягивает.</p>\r\n<p><strong>В CodeCombat можно заниматься с учителем</strong>, что значительно ускорит процесс обучения. Приложение действительно популярно, насчитывает<span>&nbsp;</span><strong>миллион обучающихся в 190 странах мира.</strong><span>&nbsp;</span>Рекомендовано BBC и сотрудничает с такими брендами, как Amazon.</p>\r\n<p>Отзыв преподавателя, Скотт Бэйли, Bobby Duke Middle School:</p>\r\n<p><em>&ldquo;Назовите любую онлайн программу, я попробовал её. Ни один из них не соответствует CodeCombat. Любой учитель, который хочет, чтобы их ученики научились кодировать ... начните здесь!&rdquo;</em></p>\r\n</li>\r\n<li>\r\n<p><a href=\"https://education.minecraft.net/ru-ru\" rel=\"noopener noreferrer nofollow\"><u>Minecraft<span>&nbsp;</span></u></a>в представлении не нуждается. Легендарная игра, в которую играют миллионы человек, но не все знают, что здесь можно изучать программирование.&nbsp;</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b8287a5323.jpg\" alt=\"\" /></p>\r\n<p>С помощью<span>&nbsp;</span><strong>Python<span>&nbsp;</span></strong>в Minecraft создают собственные миры, задают алгоритмы для выполнения сложных и трудоемких заданий.<strong><span>&nbsp;</span>Самостоятельно изучить программирование в Minecraft будет сложно, помогут обучалки на YouTube и специальные курсы.<span>&nbsp;</span></strong>Единственное приложение в подборке, которое нужно устанавливать на компьютер, но оставить его без внимания было нельзя.</p>\r\n<p>На основе Minecraft можно изучить все основные понятия: алгоритмы, циклы, события, координаты, функции, массивы и т.д. С помощью кода ребята создают свои цифровые вселенные в игре, города со своей инфраструктурой и умными коммуникациями.<strong><span>&nbsp;</span>Большим плюсом будет то, что все друзья играют в Minecraft и это будет мотивировать не забрасывать занятия и развиваться.&nbsp;</strong></p>\r\n<h3>Игры на английском языке</h3>\r\n1. <a href=\"https://www.tynker.com/\" rel=\"noopener noreferrer nofollow\"><u>Tyrker<span>&nbsp;</span></u></a>&mdash; классная платформа для школьников всех возрастов!<strong><span>&nbsp;</span>В Tynker можно изучать как визуальное, так и текстовое программирование.&nbsp;</strong><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b836855ca5.jpg\" alt=\"\" /></li>\r\n</ol>\r\n<p>Здесь можно выбрать курсы по блочному программированию, Python, JavaScript, Java, HTML и CSS, а также курс по Minecraft.<span>&nbsp;</span><strong>Учиться можно бесплатно, необходима только регистрация. Язык доступен только английский.<span>&nbsp;</span></strong>В процессе обучения ребенок учится рисовать, создавать анимацию и разрабатывать свои собственные проекты &ndash; игры и мультики. Естественно, с помощью написания кода. В Tynker доступно много туториалов, которые позволят разобраться в трудных вопросах.</p>\r\n<p><strong>В Tynker прошли обучение более 60 миллионов студентов, игра внедрена в учебную программу тысяч школ по всему миру.<span>&nbsp;</span></strong>Приложение рекомендовано даже для ребят 4-7 лет. Но ограничением станет незнание английского языка. Курсы соответствуют стандартам CCSS-ELA, CCSS-Math, NGSS, а также CS стандартам, таким как CSTA, ISTE, CA CS, UK National Curriculum.</p>\r\n<p>2. <a href=\"https://empireofcode.com/\" rel=\"noopener noreferrer nofollow\"><u>Empire of Code<span>&nbsp;</span></u></a>&mdash; на момент написания статьи, игра находится на стадии альфа-тестирования. Каждый желающий может отправить запрос и присоединиться к тестированию. Отзывы игроков положительные.&nbsp;</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b83c32f8ba.jpg\" alt=\"\" /></p>\r\n<p><strong>Концепция игры в разделении игроков на два лагеря: JavaScript и Python.<span>&nbsp;</span></strong>Это основная фишка, которая выделяет Empire of Code среди аналогов. Каждая команда управляет своей базой, наращивает армию роботов, сражается в битвах и добывает ресурсы. А управление ведется с помощью кода на одном из языков, в зависимости от лагеря. В игре достаточно подсказок, с помощью которых разберется даже новичок. Здорово, что играть можно с друзьями, что делает процесс суперинтересным.<span>&nbsp;</span><strong>Сложность в отсутствии русскоязычной локализации, на данный момент игра бесплатная.</strong></p>\r\n<p>3. <a href=\"https://www.codingame.com/\" rel=\"noopener noreferrer nofollow\"><u>CodinGame</u></a><span>&nbsp;</span>&mdash; платформа, на которой можно изучать<span>&nbsp;</span><strong>более 25 языков программирования!<span>&nbsp;</span></strong>К сожалению, русской локализации нет.<strong><span>&nbsp;</span>CodingGame понравится старшеклассникам, уже хорошо знакомым с программированием,</strong><span>&nbsp;</span>тем для кого CodeMonkey &mdash; это уже скучно.&nbsp;</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b83efeeb95.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" lang=\"ru\" class=\"tm-article-body\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>Играть можно бесплатно и прямо в браузере. Задача игрока &mdash; уничтожать вражеские корабли. А еще,<strong><span>&nbsp;</span>эта игра точно заинтересует джунов</strong>, каждый месяц можно принимать участие в онлайн-турнире, решать задачи и отправлять ответы в одну из компаний-спонсоров, чтобы принять участие в конкурсе на вакансию.</p>\r\n<p><strong>Цель разработчиков CodinGame &mdash; создать комьюнити программистов,<span>&nbsp;</span></strong>дать возможность улучшать свои навыки и соревноваться с друзьями и другими разработчиками. Здесь проводят время сотрудники Google и других топовых компаний, представляете какая крутая среда для развития?</p>\r\n<p>На самом деле, на английском языке игр гораздо больше, в подборке привела одни из самых интересных и популярных. К тому же русскоязычные материалы для школьника будут актуальнее, чтобы не создавать дополнительно языковые барьеры в изучении программирования. Хотя для кого-то, учиться на английском, наоборот, станет крутой практикой, верно?</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 1, 'uploads/images/2022/10/image_750x500_635b828786561.jpg', 'uploads/images/2022/10/image_750x_635b8287a5323.jpg', 'uploads/images/2022/10/image_600x460_635b8287c20f2.jpg', 'uploads/images/2022/10/image_380x226_635b8287dc186.jpg', 'uploads/images/2022/10/image_140x98_635b828801539.jpg', 'jpg', 'local', '', 25, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, '2022-10-28 09:28:51', '2022-10-28 09:26:57'),
(935, 1, 'Конец эпохи чудес', 'konets-epokhi-chudes', NULL, '', 'Какие бы катаклизмы ни сотрясали сегодня мир, мы всё ещё живём в эпоху чудес, самый краешек которой нам чудом удалось застать. Последние двести лет истории человечества — это уникальное время, когда научно-технический прогресс развивался столь стремительно, что каждое новое поколение входило во взрослую жизнь уже в совсем ином мире, нежели их родители. Бурный прогресс охватил буквально все аспекты жизнедеятельности и привёл к тому, что мы сегодня живём в мире, который всего-то 50 лет назад считался фантастикой.', '<p>Даже одно перечисление технологий, изменивших мир до неузнаваемости займёт десятки страниц. За эти двести лет мы произвели несколько энергетических революций: если в начале 19 века основными источниками энергии были дрова и животная тяга, то позже ими стали уголь, нефть и газ, ядерная энергия и сила ветра и воды, обузданные человеком. Лошадь сменили паровые двигатели, которые уступили ДВС и электродвигателям. Железные дороги и автотрассы связали города скоростными сообщениями, авиация связала континенты. Путь, который ранее занимал месяцы, теперь занимает часы.</p>\r\n<p>Но ещё более ускорилась передача информации &mdash; в начале 19 века единственным способом её передачи было письмо, передвигавшееся со скоростью курьера, а значит и почти не отличавшееся по скорости доставки от перевозки грузов или людей. Но теперь можно за секунды отправить своё послание, хоть на другой конец Земли. А уж то, что у каждого из нас в кармане лежит устройство с вычислительной мощью большей, чем вся, что была на Земле на начало 20 века, и вовсе должно поражать (а также то, как бездарно мы её используем).</p>\r\n<p>И весь этот прогресс со стороны выглядит просто невероятным. Если до 19 века он еле полз, то потом устремился вперёд, как ракета. Но загадки в такой стремительности нет. На самом деле научно-технический прогресс больше похож на пружину. Сумма технологий и знаний, описывающих их и окружающий мир, сжимают эту пружину до того момента, пока она не разожмётся с изобретением чего-то революционного. Ведь в чём парадокс. Большая часть &laquo;открытий&raquo;, которые сопровождали первую научно-техническую революцию на поверку не были таковыми.</p>\r\n<p>Значительная часть технологий и идей уже давно были &laquo;открыты&raquo;, например простейшие паровые движители умели делать ещё в античность. Но сама по себе идея не стоит ломаного гроша, если ты не можешь понять почему она работает. Только у техножречества Марса может тысячелетиями тиражироваться техника в устройстве которой мало кто разбирается. Реальность гораздо прозаичнее &mdash; без понимания физических принципов успех в развитии технологии может быть получен либо случайно, либо с длительным накоплением опыта. И бОльшую часть истории человечества так и было &mdash; медленно, но неуклонно копился огромный багаж разрозненных знаний, который требовал своего осмысления.</p>\r\n<p>Все изменило появление науки. Учёные ещё с эпохи Возрождения этот багаж знаний пытались осмыслить, выстроить в логичную и непротиворечивую картину. Кирпичик за кирпичиком знания складывались в теории, а те, в свою очередь &mdash; в законы природы. Увеличивалась не только сумма знаний, но и уровень их понимания. А если ты что-то понимаешь, то можешь это использовать себе на благо. Как круги на воде от камешка, каждое новое открытие вызывало целый каскад новых, которые сами пускали круги. Паровые машины позволили увеличить производительность фабрик, создать железные дороги, что ускорило доставку грузов, а после открытия магнетизма привело к появлению электрических машин, питаемых от паровых турбин и т. д. и т. п.</p>\r\n<p>Стремительное развитие прогресса создавало иллюзию, что теперь его не остановить, что границ познания для человечества нет. Закон Мура про удвоение числа транзисторов в микрочипах &mdash; эталонный пример такого технического оптимизма. Этот оптимизм наблюдался почти везде, охватив даже общество, повально увлёкшееся фантастикой. Но постепенно прогресс стал замедляться, пока многим незаметно, но процесс этот идёт.</p>\r\n<p>Бурный прогресс предыдущих двух столетий создал проблему, что человечество открыло всё, что было легко открыть. Каждый новый уровень знаний и технологий стоил дороже и по трудозатратам, и по времени, чем предыдущий. Например стоимость разработки микрочипа на техпроцессе 28 нм стоит от $10 млн до $35 млн, а на 7 нм &mdash; от $120 млн до $420 млн из-за кратно выросших затрат. При этом между 28 нм и 7 нм лежит ещё с десяток разных техпроцессов стоимость каждого из которых увеличивалась по мере увеличения плотности размещения транзисторов.</p>\r\n<p>Сейчас речь уже идёт о техпроцессах в 3, 2 и даже 1 нм, стоимость которых настолько астрономическая, что освоить их могут лишь самые крупные производители. Да, повышение плотности размещения транзисторов дало многократный рост вычислительной мощности. Но при этом сама возможность уплотнения подошла к пределу из-за физических ограничений &mdash; сделать транзистор меньше 0,5 нм просто не выйдет из-за атомарных эффектов. А значит рано или поздно рост мощности микрочипов упрётся в потолок, пробить который, возможно, и не выйдет. Что это значит для смартфона или ПК? Что через 10, 20 или может 30 лет, но будет достигнут предел их вычислительных мощностей, шагнуть за который не выйдет без новой физики.</p>\r\n<p>Некоторое время назад такой &laquo;новой физикой&raquo;, которая позволит преодолеть недостатки обычных микрочипов, считали квантовые компьютеры. Но кроме того, что они пока очень не миниатюрные и крайне хрупкие, так ещё и спектр решаемых задач у них крайне узок. Так что революция отменяется. Кремниевые чипы с нами надолго. И в сущности, это типичная история. Её уже прошли многие привычные нам технологические чудеса: электродвигатель, ДВС, паровая турбина &mdash; все они упёрлись в предел повышения КПД, выше которого не прыгнуть. Уже десятки лет идут поиски нового &laquo;супераккумулятора&raquo;, который во всём был бы лучше традиционного литий-иона, предложены десятки вариантов, но все они по тому или другому параметру уступают нестареющей классике. И пока что физика и химия не могут дать ответа будет ли найдена какая-то альтернатива. И таких примеров сотни.</p>\r\n<p>Сейчас ещё остались области науки и техники, где возможны настоящие революции, но всё увеличивающаяся сложность получения новых знаний для этой революции приводит к тому, что многие революционные разработки так и не выходят за пределы экспериментов. Эпоха чудес подходит к концу. Вместо революций нас ждёт совершенствование и оптимизация уже существующих технологий. Если нам повезёт и мир не скатится в ничтожество, то наше будущее будет похоже на настоящее, но чуточку лучше: смартфоны станут ещё чуть мощнее, машины экологичнее, а интернет ещё более скоростным. Но революции в технике будут случаться всё реже и рано или поздно мы выйдем на плато, за которым будет вечность точечных улучшений уже имеющихся технологий. Но будем ли мы похожи на самих себя нынешних, вот это уже крайне интересный вопрос. Будущее покажет.</p>', 62, 'uploads/images/2022/10/image_750x500_635b8de622a4c.jpg', 'uploads/images/2022/10/image_750x_635b8de62e12c.jpg', 'uploads/images/2022/10/image_600x460_635b8de637563.jpg', 'uploads/images/2022/10/image_380x226_635b8de63f929.jpg', 'uploads/images/2022/10/image_140x98_635b8de64576f.jpg', 'jpg', 'local', '', 30, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-28 10:08:11'),
(936, 1, 'TypeScript 4.9: что нас ожидает', 'typescript-49-chto-nas-ozhidaet', NULL, 'itfox, habr, community, programming community, turkmenportal', 'В сентябре этого года Microsoft анонсировал TypeScript 4.9 beta. В бета-версии появились любопытные нововведения и исправления: новый оператор, оптимизация производительности, улучшения существующих типов… ', '<h2>Новый оператор satisfies</h2>\r\n<p><em>TL;DR Позволяет делать неоднородные наборы типов более гибкими.</em></p>\r\n<p>Чтобы понять, зачем нужен оператор satisfies, рассмотрим пример переменной-записи, где данные имеют смешанный характер. Положим, что значения этой записи могут быть как строками, так и числами.</p>\r\n<pre><code class=\"typescript hljs\"><span class=\"hljs-keyword\">type</span> ComponentKey = <span class=\"hljs-string\">\'component1\'</span> | <span class=\"hljs-string\">\'component2\'</span> | <span class=\"hljs-string\">\'component3\'</span>;\r\n\r\n<span class=\"hljs-keyword\">const</span> data: Record&lt;ComponentKey, <span class=\"hljs-built_in\">number</span> | <span class=\"hljs-built_in\">string</span>&gt; = {\r\n    component1: <span class=\"hljs-number\">0</span>,\r\n    component2: <span class=\"hljs-string\">\'\'</span>,\r\n    component3: <span class=\"hljs-number\">42</span>,\r\n};\r\n\r\n<span class=\"hljs-keyword\">const</span> firstResult = data.component1 + <span class=\"hljs-number\">42</span>;\r\n\r\n<span class=\"hljs-keyword\">const</span> secondResult = data.component2.toUpperCase();</code></pre>\r\n<p>Если мы попытаемся работать с объектом<span>&nbsp;</span><code>data</code><span>&nbsp;</span>далее, неизбежно наткнёмся на ошибки типов:</p>\r\n<pre><code class=\"typescript hljs\">Operator <span class=\"hljs-string\">\'+\'</span> cannot be applied to types <span class=\"hljs-string\">\'string | number\'</span> and <span class=\"hljs-string\">\'number\'</span>.\r\n\r\nProperty <span class=\"hljs-string\">\'toUpperCase\'</span> does not exist on <span class=\"hljs-keyword\">type</span> <span class=\"hljs-string\">\'string | number\'</span>.\r\nProperty <span class=\"hljs-string\">\'toUpperCase\'</span> does not exist on <span class=\"hljs-keyword\">type</span> <span class=\"hljs-string\">\'number\'</span>.</code></pre>\r\n<p>Это объясняется тем, что<span>&nbsp;</span><code>number | string</code><span>&nbsp;</span>&mdash; это объединение. TypeScript разрешает операцию над объединением только в том случае, если она действительна для каждого члена объединения.</p>\r\n<p>TypeScript 4.9 beta предлагает выход: использовать новый оператор satisfies, который позволит безболезненно указывать, какому именно типу удовлетворяет объект.</p>\r\n<pre><code class=\"typescript hljs\"><span class=\"hljs-keyword\">type</span> ComponentKey = <span class=\"hljs-string\">\'component1\'</span> | <span class=\"hljs-string\">\'component2\'</span> | <span class=\"hljs-string\">\'component3\'</span>;\r\n\r\n<span class=\"hljs-keyword\">const</span> data = {\r\n    component1: <span class=\"hljs-number\">0</span>,\r\n    component2: <span class=\"hljs-string\">\'\'</span>,\r\n    component3: <span class=\"hljs-number\">42</span>,\r\n} satisfies Record&lt;ComponentKey, <span class=\"hljs-built_in\">number</span> | <span class=\"hljs-built_in\">string</span>&gt;;\r\n\r\n<span class=\"hljs-keyword\">const</span> firstResult = data.component1 + <span class=\"hljs-number\">42</span>;\r\n\r\n<span class=\"hljs-keyword\">const</span> secondResult = data.component2.toUpperCase();</code></pre>\r\n<p>Компиляция проходит без ошибок. Попробуем поменять значение в<span>&nbsp;</span><code>component2</code>, чтобы убедиться, что новый оператор действительно приводит объект к нужному типу:</p>\r\n<pre><code class=\"typescript hljs\"><span class=\"hljs-keyword\">type</span> ComponentKey = <span class=\"hljs-string\">\'component1\'</span> | <span class=\"hljs-string\">\'component2\'</span> | <span class=\"hljs-string\">\'component3\'</span>;\r\n\r\n<span class=\"hljs-keyword\">const</span> data = {\r\n    component1: <span class=\"hljs-number\">0</span>,\r\n    component2: <span class=\"hljs-number\">44</span>,\r\n    component3: <span class=\"hljs-number\">42</span>,\r\n} satisfies Record&lt;ComponentKey, <span class=\"hljs-built_in\">number</span> | <span class=\"hljs-built_in\">string</span>&gt;;\r\n\r\n<span class=\"hljs-keyword\">const</span> firstResult = data.component1 + <span class=\"hljs-number\">42</span>;\r\n\r\n<span class=\"hljs-keyword\">const</span> secondResult = data.component2.toUpperCase();</code></pre>\r\n<p>И, как и ожидалось, увидим ошибку:</p>\r\n<pre><code class=\"typescript hljs\">Property <span class=\"hljs-string\">\'toUpperCase\'</span> does not exist on <span class=\"hljs-keyword\">type</span> <span class=\"hljs-string\">\'number\'</span>.</code></pre>\r\n<p>Таким образом мы сохраняем контроль над типами, и работа с записями становится удобнее.</p>\r\n<p><a href=\"https://github.com/microsoft/TypeScript/issues/47920\"><u>Подробнее про оператор, примеры использования, спорные моменты</u>&nbsp;</a></p>\r\n<h2>Умный in</h2>\r\n<p><em>TL;DR В операторе in станет меньше ошибок при сужении типов.</em></p>\r\n<p>Оператор<span>&nbsp;</span><code>in</code><span>&nbsp;</span>в JavaScript проверяет, существует ли свойство у объекта. Это удобно для данных, чей тип мы не знаем: например, для данных файлов конфигураций.</p>\r\n<p>В TypeScript оператор<span>&nbsp;</span><code>in</code><span>&nbsp;</span>часто используется, чтобы проверить, входит ли свойство в объект определённого типа. Пример:</p>\r\n<pre><code class=\"typescript hljs\"><span class=\"hljs-keyword\">interface</span> Bird {\r\n    fly(): <span class=\"hljs-built_in\">void</span>;\r\n    layEggs(): <span class=\"hljs-built_in\">void</span>;\r\n}\r\n\r\n<span class=\"hljs-keyword\">interface</span> Fish {\r\n    swim(): <span class=\"hljs-built_in\">void</span>;\r\n    layEggs(): <span class=\"hljs-built_in\">void</span>;\r\n}\r\n\r\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">isFish</span>(<span class=\"hljs-params\">creature: Fish | Bird</span>): <span class=\"hljs-title\">creature</span> <span class=\"hljs-title\">is</span> <span class=\"hljs-title\">Fish</span> </span>{\r\n    <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\'swim\'</span> <span class=\"hljs-keyword\">in</span> creature;\r\n}</code></pre>\r\n<p><code>isFish</code><span>&nbsp;</span>&mdash; это предикат, который определяет принадлежность параметра<span>&nbsp;</span><code>creature</code><span>&nbsp;</span>типу<span>&nbsp;</span><code>Fish</code>. Для этого выполняется проверка: если свойство<span>&nbsp;</span><code>swim</code><span>&nbsp;</span>содержится в объекте, то очевидно, что параметр<span>&nbsp;</span><code>creature</code><span>&nbsp;</span>относится к типу<span>&nbsp;</span><code>Fish</code>.</p>\r\n<p>Возвращаемый тип функции<span>&nbsp;</span><code>isFish</code><span>&nbsp;</span>помогает при вызове функции неявно привести параметр<span>&nbsp;</span><code>creature</code><span>&nbsp;</span>к нужному типу, по сути сузив его:</p>\r\n<pre><code class=\"typescript hljs\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">action</span>(<span class=\"hljs-params\">creature: Fish | Bird</span>) </span>{\r\n    <span class=\"hljs-keyword\">if</span> (isFish(creature)) creature.swim(); <span class=\"hljs-comment\">// Это Fish</span>\r\n    <span class=\"hljs-keyword\">else</span> creature.fly(); <span class=\"hljs-comment\">// А это Bird</span>\r\n}</code></pre>\r\n<p>Но что, если тип объекта, в котором проверяется наличие свойства, неизвестен? Что будет, если мы попробуем проверить, существует ли свойство в объекте с заранее неизвестным типом? Рассмотрим следующий пример, более приближенный к жизни:</p>\r\n<pre><code class=\"typescript hljs\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">getConfigVersion</span>(<span class=\"hljs-params\">config: unknown</span>) </span>{\r\n    <span class=\"hljs-keyword\">if</span> (config &amp;&amp; <span class=\"hljs-keyword\">typeof</span> config === <span class=\"hljs-string\">\'object\'</span>) {\r\n        <span class=\"hljs-keyword\">if</span> (<span class=\"hljs-string\">\'version\'</span> <span class=\"hljs-keyword\">in</span> config &amp;&amp; <span class=\"hljs-keyword\">typeof</span> config.version === <span class=\"hljs-string\">\'string\'</span>) {\r\n            <span class=\"hljs-keyword\">return</span> config.version;\r\n        }\r\n    }\r\n\r\n    <span class=\"hljs-keyword\">return</span> <span class=\"hljs-literal\">undefined</span>;\r\n}</code></pre>\r\n<p>В этом примере мы пытаемся получить свойство<span>&nbsp;</span><code>version</code><span>&nbsp;</span>из параметра, чей тип невозможно предсказать заранее. В первой проверке неявно приводим<span>&nbsp;</span><code>config</code><span>&nbsp;</span>к типу<span>&nbsp;</span><code>object</code><em>,</em><span>&nbsp;</span>во второй убеждаемся, что свойство<span>&nbsp;</span><code>version</code><span>&nbsp;</span>типа<span>&nbsp;</span><code>string</code><span>&nbsp;</span>есть в объекте. Но почему-то получаем ошибки:</p>\r\n<pre><code class=\"typescript hljs\">Property <span class=\"hljs-string\">\'version\'</span> does not exist on <span class=\"hljs-keyword\">type</span> <span class=\"hljs-string\">\'object\'</span>.\r\nProperty <span class=\"hljs-string\">\'version\'</span> does not exist on <span class=\"hljs-keyword\">type</span> <span class=\"hljs-string\">\'object\'</span>.</code></pre>\r\n<p>В чем дело? Оказывается, оператор<span>&nbsp;</span><code>in</code><span>&nbsp;</span>строго ограничен типом, который фактически определяет проверяемую переменную. Тип переменной<span>&nbsp;</span><code>config</code><span>&nbsp;</span>уже известен как<span>&nbsp;</span><code>object</code><em>,</em><span>&nbsp;</span>соответственно, ни к чему другому приведение в данном случае невозможно: дальнейшая работа с переменной затруднительна.</p>\r\n<p>TypeScript 4.9-beta исправляет это поведение. Вместо того, чтобы оставлять объект &laquo;как есть&raquo;, добавляет к типу<span>&nbsp;</span><code>Record&lt;\"property-key-being-checked\", unknown&gt;</code><span>&nbsp;</span>. Переменная<span>&nbsp;</span><code>config</code><span>&nbsp;</span>после всех проверок будет иметь тип<span>&nbsp;</span><code>object &amp; Record&lt;\"version\", unknown&gt;</code><em>,</em><span>&nbsp;</span>что позволит функции выполниться без ошибок.</p>\r\n<p>Больше информации по теме &mdash;<span>&nbsp;</span><a href=\"https://github.com/microsoft/TypeScript/pull/50666\"><u>в гитхабе Microsoft</u></a></p>\r\n<h2>Not a number</h2>\r\n<p><em>TL;DR Прямое сравнение с NaN теперь запрещено.</em></p>\r\n<p>NaN &mdash; это специальное числовое значение, обозначающее что угодно, но не число. NaN &mdash; единственное значение в JavaScript, которое при сравнении с самим собой с помощью оператора строгого равенства (===) дает false. То же происходит при сравнении с любыми другими значениями. То есть ничто не может быть равно NaN &mdash; даже NaN!</p>\r\n<p>Примеры типов операций, которые возвращают NaN:</p>\r\n<ol>\r\n<li>\r\n<p>Неудачное преобразование чисел. Например,<span>&nbsp;</span><code>parseInt(\"not_a_number\")</code>.</p>\r\n</li>\r\n<li>\r\n<p>Математическая операция, результат которой не является действительным числом. Например,<span>&nbsp;</span><code>Math.sqrt(-1)</code><em>.</em></p>\r\n</li>\r\n<li>\r\n<p>Метод или выражение, операнд которого является NaN или приводится к нему. Например, 42 * NaN.</p>\r\n</li>\r\n</ol>\r\n<p>То есть наткнуться на NaN в своем коде вполне реально. Это приводит к тому, что разработчики могут случайно сравнить результат операции напрямую с NaN:</p>\r\n<pre><code class=\"typescript hljs\"><span class=\"hljs-built_in\">parseInt</span>(someValue) !== <span class=\"hljs-literal\">NaN</span></code></pre>\r\n<p>Что, как следует из определения, приведёт к логической ошибке, которую можно сразу не заметить: выполнить такую проверку ничто не мешает, и разработчик всегда будет получать<span>&nbsp;</span><code>true</code>.</p>\r\n<p>Решение проблемы &mdash; запрет на прямое сравнение с<span>&nbsp;</span><code>NaN</code><em>.</em><span>&nbsp;</span>В бета-версии TypeScript 4.9 сравнение возможно только через специальный метод<span>&nbsp;</span><code>Number.isNaN</code>, который позволит избежать логических ошибок при сравнении.</p>\r\n<p>Теперь разработчики видят ошибку:</p>\r\n<pre><code class=\"typescript hljs\">TS2845: This condition will always <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\'true\'</span>.  \r\nDid you mean <span class=\"hljs-string\">\'!Number.isNaN(...)\'</span>?</code></pre>\r\n<h2>Отслеживание изменений</h2>\r\n<p><em>TL;DR Изменена стратегия по умолчанию для отслеживания изменений &mdash; механизм File System Events.</em></p>\r\n<p>В более ранних версиях TypeScript для отслеживания изменений использовалась стратегия опроса &mdash; pooling: периодическая проверка состояния файла на наличие обновлений. В этом подходе есть плюсы и минусы. Например, такой способ отслеживания изменений считается более надежным и предсказуемым на разных платформах и файловых системах. Однако если кодовая база большая, то отслеживание изменений путём опроса может серьезно повысить нагрузку на ЦП и привести к перерасходу ресурсов.</p>\r\n<p>В TypeScript 4.9 стратегией по умолчанию станет механизм<span>&nbsp;</span><em>событий файловой системы &mdash; File System Events.</em><span>&nbsp;</span>Он основывается на подписке на событие изменения файлов и выполнение кода только тогда, когда это событие произошло. Таким образом, отпадает необходимость периодических опросов. Для большинства разработчиков это нововведение должно обеспечить гораздо более комфортный опыт при работе в режиме<span>&nbsp;</span><code>--watch</code><span>&nbsp;</span>или при работе с редактором на основе TypeScript.</p>\r\n<p>Настроить отслеживание изменений по-прежнему можно с помощью переменных среды и watchOptions.&nbsp;</p>\r\n<p>Подробнее &mdash;<span>&nbsp;</span><a href=\"https://www.typescriptlang.org/docs/handbook/configuring-watch.html\"><u>в хендбуке TypeScript</u>&nbsp;</a></p>\r\n<h2>Что дальше</h2>\r\n<p>Команда разработчиков продолжает разработку TypeScript 4.9 и в начале ноября планирует выпустить окончательный релиз. Ждём!</p>\r\n<p>А пока что можно установить себе бета-версию и попробовать новые фичи:</p>\r\n<pre><code class=\"typescript hljs\">npm install -D typescript<span class=\"hljs-meta\">@beta</span></code></pre>', 1, 'uploads/images/2022/10/image_750x500_635b8e785ed24.jpg', 'uploads/images/2022/10/image_750x_635b8e7869c27.jpg', 'uploads/images/2022/10/image_600x460_635b8e7872bbe.jpg', 'uploads/images/2022/10/image_380x226_635b8e787bb6a.jpg', 'uploads/images/2022/10/image_140x98_635b8e78845ad.jpg', 'jpg', 'local', '', 23, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-28 10:10:35'),
(937, 1, 'getscreen.me бага или следит?', 'getscreenme-baga-ili-sledit', NULL, 'itfox, habr, community, programming community, turkmenportal', 'Около недели назад на свежеустановленную windows был установлен getscreen.ru (.me). Я часто использую remote desktop для работы - чтобы работать со слабого ноутбука на мощном стационарном ПК.', '<p>Всё бы ничего, но, при работе за ПК показалось что есть какие-то микрофризы, при этом, чуткое ухо программиста улавливает периодическое включение вентилятора без всякой причины.</p>\r\n<p><em>Почему был выбран getscreen: Добавлю что teamviewer начинал раздражать задолго до известных событий - блокировал аккаунт, просил фото паспортов и какие-то подписки, и всё равно блокировал, хотя я никогда не использовал его более чем на одной личной машине. Добавлю, что попробовав несколько, он же оказался и самым лагающим, так что, когда он отвалился, я даже обрадовался что заменю его быстрее. Anydesk неплох по скорости, однако показался не слишком удобным, а вот getscreen показался и хорошим по скорости и по удобству, может быть причина в локальных серверах - не знаю.</em></p>\r\n<p>Первый шаг - просто task manager. Видно, что раз в пару минут демон getscreen.exe присыпается и пару секунд ест cpu. Смотрю какими утилитами пользовался автор - устанавливаю и начинаю смотреть трейс, и действительно, виден всплеск активности getscreen.exe раз в несколько минут.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b8f2ddb8eb.jpg\" alt=\"\" /></p>\r\n<p>Подтянув отладочные символы (долгий процесс), видно что программа активно работает с gdi32, т.е. с картинками, в целом логично - программа для удалённого доступа, но, однако, никакой активной сессии при этом нету - к чему такая активность без подключений?</p>\r\n<p>Понятно, что что-то делается, но надо посмотреть на на сеть:</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b8f4be43da.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>Видно что было пару пакетов, но, после того как getscreen отработал этот пик активности - количество передаваемых данных резко возрастает.</p>\r\n<p>Нельзя что-то утверждать, когда нет 100% доказательств, но извлечь их из зашифрованного траффика невозможно. Однако данные действия программы, помимо неудобства, наводят на подозрения. Возможно что в них есть какая-то техническая необходимость, как пример - в самой панели подключений getscreen виден preview экрана.</p>\r\n<p>-- добавлено --</p>\r\n<p>Последнее навело на мысль. Обновление preview происходит с задержкой, я постоянно обновлял страницу (у getscreen есть доступ через браузер), preview обновилось точно после того как на компьютере в очередной раз покрутились вентиляторы. Т.е., техническое обоснование отправки экрана понятно, но зачем это делать постоянно, даже когда нет подключений и preview не нужно? В настройках обнаружил \"Снимать скриншоты для превью\" - отключил - вентилятор больше не активируется, да и сетевая активность приложения выглядит куда спокойнее.</p>\r\n<p>В любом случае считаю что лучше перепараноить чем недопаранойить, и сделаю следующее заключение:</p>\r\n<p>1) По-умолчанию getscreen постоянно делает снимки вашего экрана</p>\r\n<p>2) Делает это даже если в этом нет никакой необходимости</p>\r\n<p><em>Как обычно в IT, ожидаю что фикс будет что-то типа делать это не раз в две минуты, а раз в десять или час - что картины не меняет - экран отправляется когда не просят</em></p>\r\n<p>3) Делает это не очень аккуратно, заметно загружая процессор</p>\r\n<p>4) На текущий момент я отключаю данную программу пока не получу разъяснений от поддержки куда написал</p>\r\n<p>Спасибо и будьте бдительны :)</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 40, 'uploads/images/2022/10/image_750x500_635b8f2dc18dd.jpg', 'uploads/images/2022/10/image_750x_635b8f2ddb8eb.jpg', 'uploads/images/2022/10/image_600x460_635b8f2e00dbc.jpg', 'uploads/images/2022/10/image_380x226_635b8f2e1c0e2.jpg', 'uploads/images/2022/10/image_140x98_635b8f2e3b55e.jpg', 'jpg', 'local', '', 24, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-28 10:15:16');
