(938, 1, 'Как мы меняли инфраструктуру облачного сервиса: эволюция от одной виртуальной машины к кластеру Kubernetes', 'kak-mi-menyali-infrastrukturu-oblachnogo-servisa-evolyutsiya-ot-odnoy-virtualnoy-mashini-k-klasteru-kubernetes', NULL, 'itfox, habr, community, programming community, turkmenportal', 'Вот уже 7 лет мы развиваем Okdesk — облачную help desk систему для малого и среднего бизнеса.', '<p>В свое время мы начали с одной виртуальной машины у провайдера.</p>\r\n<p>Постепенно сервис взрослел, менялись приоритеты, задачи и проблемы, с которыми мы сталкивались. Сегодня Okdesk живет уже на третьей версии инфраструктуры.</p>\r\n<p>В этой заметке мы расскажем о том, как и почему эволюционировала архитектура Okdesk. А во второй части поста &mdash; почему мы перешли на Kubernetes, каких результатов это позволило добиться и что планируем делать дальше.</p>\r\n<p>Поддерживая бизнес-критичную систему для сотен клиентов, мы стараемся идти на шаг впереди &mdash;&nbsp;менять архитектуру еще до того, как старый подход изживет себя окончательно.&nbsp;</p>\r\n<p>В статье нет rocket science, так как в компании и бизнесе мы придерживаемся мнения, что каждый должен заниматься<span>&nbsp;</span><a href=\"https://habr.com/ru/company/okdesk/blog/694038/\" rel=\"noopener noreferrer nofollow\">своим делом</a>.</p>\r\n<p>Работа Okdesk построена не на супер-совершенных технологиях, а на бизнесовой составляющей &mdash; взаимодействии с клиентами и понимании их потребностей. Для этого нам не требуются квантовые вычисления или иные хайповые решения. Наоборот, мы стараемся использовать проверенные и зарекомендовавшие себя инструменты, которые соответствуют нашим текущим бизнес-требованиям.</p>\r\n<h2>Версия 1. Виртуальная машина</h2>\r\n<p>Запуская сервис, мы старались как можно быстрее выйти на рынок, поэтому построили инфраструктуру, исходя из принципа наименьшей достаточности. Это была виртуалка в дата-центре на Западе, на которой крутилось само приложение и СУБД (дело было еще до выхода законодательства, запрещающего хранить пользовательские данные за границей). Для стабильной работы<span>&nbsp;</span><a href=\"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D0%B8%D0%BC%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE_%D0%B6%D0%B8%D0%B7%D0%BD%D0%B5%D1%81%D0%BF%D0%BE%D1%81%D0%BE%D0%B1%D0%BD%D1%8B%D0%B9_%D0%BF%D1%80%D0%BE%D0%B4%D1%83%D0%BA%D1%82\" rel=\"noopener noreferrer nofollow\">MVP</a><span>&nbsp;</span>этого было более чем достаточно.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b902a31b8c.jpg\" alt=\"\" /></p>\r\n<p>Когда к Okdesk подключились на платной основе первые 15 клиентов, мы разнесли приложение и СУБД по разным виртуальным машинам. Но идеологически инфраструктура осталась той же. Мониторили мы ее через<span>&nbsp;</span><a href=\"https://ping-admin.com/\" rel=\"noopener noreferrer nofollow\">ping-admin</a><span>&nbsp;</span>(инструмент отправляет http-запросы и предупреждает, если ответ отличается от ожидаемого) и на всякий случай регулярно бэкапились в облачный сервис другого поставщика.</p>\r\n<p>Первой версии не хватало надежности. Несмотря на это<span>&nbsp;</span><strong>за время ее работы доступность сервиса не падала ниже 99.97% &mdash; это 2 часа простоев в год</strong>, считая плановые остановки. Но это не значит, что гипотетически сервис не мог бы упасть на 2 часа и более. Просто нам удалось этого избежать.</p>\r\n<p>Параллельно с подключением новых клиентов мы наращивали ресурсы виртуальной машины. Но вместе с клиентской базой росли и риски в первую очередь для репутации. В какой-то момент мы поняли, что упади сервис на несколько часов, это повлияет на бизнес уже сотни компаний, и суммарно это могут быть миллионные убытки. Так мы начали планировать вторую версию инфраструктуры.</p>\r\n<h2>Версия 2. Дублирование серверов</h2>\r\n<p>На втором этапе мы пытались перейти от недостаточно надежного решения к более стабильному (чуть более стабильному, чем на тот момент требовал бизнес). В базовых требованиях мы:</p>\r\n<ul>\r\n<li>\r\n<p>ограничили максимальное время неработоспособности сервиса до 15 минут (даже если дата-центр взорвался, не говоря уже о банальном выходе из строя одного сервера);</p>\r\n</li>\r\n<li>\r\n<p>допустили потерю клиентских данных не более чем за несколько секунд, даже если падает СУБД на продакшне.</p>\r\n</li>\r\n</ul>\r\n<p>Для этого мы дублировали приложение и СУБД на резервный сервер, который вынесли в другой дата-центр (физически расположенный в другом месте) и настроили репликацию данных.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b904b59ae2.jpg\" alt=\"\" /></p>\r\n<p><strong>Переключение с основного на резервный сервер в случае аварии должно было выполняться вручную через route 53 от Amazon и занимать не более 5 минут.</strong></p>\r\n<p>Для мониторинга инфраструктуры к уже использовавшемуся ping-admin мы добавили<span>&nbsp;</span><a href=\"https://mmonit.com/monit/\" rel=\"noopener noreferrer nofollow\">Monit</a><span>&nbsp;</span>и<span>&nbsp;</span><a href=\"https://scoutapm.com/\" rel=\"noopener noreferrer nofollow\">Scoutapp</a>. Первый собирает базовые метрики сервера, а второй помогает профилировать производительность. Позже Monit расширили клиент-серверным инструментом, который умеет мониторить бизнес-параметры и рисовать картинки.</p>\r\n<p><strong>Вторую версию инфраструктуры мы строили уже в соответствии с законом о защите персональных данных, поэтому размещали сервера в России</strong><span>&nbsp;</span>&mdash; на площадке Servers.ru. Подробнее о том переходе можно прочитать в нашей старой<span>&nbsp;</span><a href=\"https://habr.com/ru/company/okdesk/blog/343266/\" rel=\"noopener noreferrer nofollow\"><u>статье.</u></a></p>\r\n<p>Вторая версия инфраструктуры не требовала глубоких знаний в администрировании. Мы ее создали и первое время поддерживали собственными силами. Впоследствии начали привлекать к обслуживанию подрядчиков. После серии попыток сотрудничать с разными компаниями, остановились на Фланте.</p>\r\n<p><strong>Вторая версия инфраструктуры с небольшими доработками просуществовала чуть более 4 лет</strong>. Фактически, это были разрозненные сервера, управлять которыми было довольно сложно из-за обилия ручных процедур. Сервис продолжал развиваться и у нас появилась потребность в бесшовном деплое, раздельной обработке разных типов запросов (например, чтобы API запросы не влияли на работу веб-версии), запуске сторонних приложений. Так мы пришли к необходимости проектировать третью версию инфраструктуры.</p>\r\n<h2>Версия 3. Kubernetes</h2>\r\n<p>При<span>&nbsp;</span><strong>планировании перехода с первой на вторую версию инфраструктуры мы ограничивались парой бизнес-метрик, описывающих клиентский опыт</strong>. Но наш сервис стал более зрелым, количество клиентов стало измеряться сотнями, мы соответственно настроили бизнес-процессы, связанные с его развитием, что повлияло на список требований.</p>\r\n<h3>Базовые \"клиентские\" метрики для проектирования третьей версии</h3>\r\n<p>С точки зрения клиентского сервиса<span>&nbsp;</span><strong>мы хотели снизить последствия отключения одного сервера приложений</strong>. При падении сервера до переключения на резервную инфраструктуру запросы от клиентов не обрабатывались и нас это не устраивало.</p>\r\n<p><strong>Чтобы полного прекращения обслуживания не происходило, логично раздробить сервис на много мелких серверов или нод</strong>. В этом случае падение одного такого сервера (или ноды) обернется не прекращением обработки запросов, а временной потерей мощности. Аналогичную &ldquo;конструкцию&rdquo; логично собрать и в резервном дата-центре.</p>\r\n<p><u>Дробление серверов приложений несет за собой проблемы сквозного мониторинга и сбора логов, балансировки нагрузки, а также синхронизации данных и конфигураций между серверами</u><span>&nbsp;</span>(и отдельно экземплярами приложений на этих серверах). С конфигурированием у нас и так во второй версии были определенные сложности &mdash; очень многие операции, включая парковку доменов, выполнялись вручную, что было чревато ошибками. Все это хотелось автоматизировать, чтобы исключить человеческий фактор.</p>\r\n<p>Тот же подход с дроблением хотелось применить к БД. Но<span>&nbsp;</span><strong>необходимо было учитывать, что запросы из одного дата-центра в другой идут долго и кратно увеличивают время выполнения пользовательского запроса</strong>. Поэтому сервер приложений всегда должен обращаться на реплику базы, которая находится в том же дата-центре. Как правило, для этого используют мастер-слейв архитектуру, в рамках которой запись всегда ведется на один мастер-сервер, который шлет копии на слейвы в режиме реального времени. При этом между дата-центрами сервера БД должны распределяться таким образом, чтобы &ldquo;под боком&rdquo; у мастера (в том же дата центре) всегда был как минимум один слейв.<span>&nbsp;</span><strong>Так не придется обращаться при &ldquo;падении&rdquo; мастера в другой дата-центр, а заодно при необходимости туда можно отправлять на обработку медленные запросы</strong>.</p>\r\n<h3>Простота развития</h3>\r\n<p>С точки зрения дальнейшего развития сервиса мы хотели бесшовный деплой, чтобы конечные клиенты не замечали перезагрузку веб-сервера при выкатке очередных изменений. Почему-то у многих решений на рынке обновления до сих пор сопровождаются остановками. На наш взгляд это прошлый век, а в B2B сегменте, поскольку мы работаем с критичной для бизнеса системой, это особенно важный аспект.</p>\r\n<p><em>Вторая версия архитектуры ограничивала нас тем, что деплоить приходилось вечером, когда трафик на сервис минимальный. Но иногда у нас возникала необходимость вывести в прод некоторые изменения утром. И пока мы жили на второй версии, приходилось терпеть до вечера.</em></p>\r\n<p>Также мы хотели облегчить запуск других приложений в настроенном окружении, например,<span>&nbsp;</span><a href=\"https://okdesk.ru/multichannel-support?utm_source=habrahabr&amp;utm_medium=article&amp;utm_campaign=blog&amp;utm_content=kubernetes\" rel=\"noopener noreferrer nofollow\">бота в Telegram</a>. Это приложение взаимодействует с<span>&nbsp;</span><a href=\"https://okdesk.ru/apidoc?utm_source=habrahabr&amp;utm_medium=article&amp;utm_campaign=blog&amp;utm_content=kubernetes\" rel=\"noopener noreferrer nofollow\">API Okdesk</a><span>&nbsp;</span>и требует определенных ресурсов для своей работы.<span>&nbsp;</span><strong>Необходимо было, чтобы инфраструктура поддерживала интеграцию этого и других приложений каким-то типовым образом, чтобы нам не приходилось каждый раз заново все настраивать.</strong></p>\r\n<h3>Легкое управление</h3>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b907e07c97.jpg\" alt=\"\" /></p>\r\n<p>Помимо глобальных пожеланий, мы хотели чуть больше возможностей для управления инфраструктурой. В частности,<span>&nbsp;</span><strong>мы хотели влиять на балансировку трафика или изолировать запросы разного типа друг относительно друга, заранее выделяя на них определенный объем ресурсов</strong>. Стандартный кейс, где это нужно &mdash;<span>&nbsp;</span><a href=\"https://okdesk.ru/mobile-support?utm_source=habrahabr&amp;utm_medium=article&amp;utm_campaign=blog&amp;utm_content=kubernetes\" rel=\"noopener noreferrer nofollow\">мобильное приложение для выездных специалистов</a>. Его используют не только в городах с хорошим покрытием связью, но и там, где мобильный интернет не быстрый. Запросы на загрузку &ldquo;тяжелых&rdquo; фотоотчетов о выполненных работах или на полнотекстовый поиск могут &ldquo;подвешивать&rdquo; сервис, поэтому их необходимо изолировать от &ldquo;быстрых&rdquo; загрузок карточек заявок и т.п.</p>\r\n<h2>Какие были варианты кроме Kubernetes?</h2>\r\n<p>В теории мы могли развернуть нашу инфраструктуру на нескольких серверах, используя балансировщики нагрузки и настройку параметров серверов и приложений вручную или через Ansible / Chef.</p>\r\n<p>Но такой путь не решает никаких проблем, кроме непосредственно дробления серверов. Удовлетворение остальных требований либо невозможно, либо требует внедрения сторонних инструментов, которые усложняют систему и плодят зоопарк, требующий взаимной интеграции.</p>\r\n<p>На тот момент наш подрядчик, Флант, уже несколько лет специализировался на Kubernetes. Это опенсорсная платформа для управления сервисами в контейнерах с огромной экосистемой.</p>\r\n<p>Флант набрал в этой области большую экспертизу и даже успел разработать свои надстройки, облегчающие управление (они много писали про свои разработки на Хабре:<span>&nbsp;</span><a href=\"https://habr.com/ru/company/flant/blog/562246/\" rel=\"noopener noreferrer nofollow\">1</a>,<span>&nbsp;</span><a href=\"https://habr.com/ru/company/flant/blog/449096/\" rel=\"noopener noreferrer nofollow\">2</a>,<span>&nbsp;</span><a href=\"https://habr.com/ru/company/oleg-bunin/blog/453306/\" rel=\"noopener noreferrer nofollow\">3</a>). Именно они предложили нам развернуть все на Kubernetes. Честно говоря, мы и сами присматривались к более современным технологиям. Так что выбор был сделан.</p>\r\n<p>Миграцию со второй на третью версию обеспечивал Флант. Он же предложил комплект инструментов &mdash; собственный<span>&nbsp;</span><a href=\"https://habr.com/ru/company/flant/blog/569840/\" rel=\"noopener noreferrer nofollow\"><u>Deckhouse</u></a><span>&nbsp;</span>для упрощения контроля, Graylog для сбора логов со всех нод, стандартные в Kubernetes Grafana и Prometheus для мониторинга.</p>\r\n<h2>Итоги переезда на Kubernetes</h2>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b909f25c4c.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>В целом переезд оказался несколько сложнее и дольше, чем мы ожидали. Но мы добились того, чего хотели &mdash;<span>&nbsp;</span><strong>получили отказоустойчивый сервис, развернутый на нескольких физических серверах, который автоматически перезапускается в случае нештатных ситуаций. Достигли доступности 99.99%.</strong></p>\r\n<p>Мы можем легко вводить в эксплуатацию новые сервера &mdash; после установки минимального ПО Kubernetes делает все сам. Таким образом<span>&nbsp;</span><strong>суммарное время запуска сервера сократилось в 10 раз</strong>.</p>\r\n<p>Пользуемся бесшовным деплоем, автоматической парковкой доменов через добавление одной строки в конфиг и т.п.<span>&nbsp;</span><strong>Отселили обработку &ldquo;тяжелых&rdquo; запросов в отдельные песочницы, за счет чего ускорили &ldquo;легкие&rdquo; запросы</strong>.</p>\r\n<p><u>Не стоит думать, что Kubernetes дает какой-то выигрыш по железу.</u><span>&nbsp;</span>Дополнительный слой абстракции требует мощностей, которые в общем случае зависят от сложности реализуемой логики. А у нас она сложна &mdash; только припаркованных доменов больше 160 штук, и каждый из них требует собственного конфига. Общий объем конфигурации &mdash; несколько тысяч строк.&nbsp;</p>\r\n<p>Кроме того, мы понимаем, что вряд ли сможем вырастить полноценную экспертизу по Kubernetes внутри компании, поэтому остаемся завязанными на обращение к подрядчикам. С этим придется смириться. Но Kubernetes уже стал стандартом отрасли, поэтому мы все-таки решились на миграцию и не пожалели.</p>\r\n<p>Есть много вещей, которые хотелось бы улучшить &mdash; и мы планируем над этим работать совместно с подрядчиком. В ближайшее время собираемся:</p>\r\n<ul>\r\n<li>\r\n<p>Найти альтернативный дата-центр для размещения резерва. Сейчас они физически находятся в разных дата-центрах, но обслуживаются одним поставщиком услуг, что означает существование общих точек отказа. Мы хотим избавиться от этого риска.</p>\r\n</li>\r\n<li>\r\n<p>Оптимизировать потребление ресурсов Kubernetes. В современных реалиях наращивать мощности будет сложно, поэтому после завершения активной фазы развития инфраструктуры мы попробуем немного &ldquo;отжать&rdquo; сервис и Kubernetes.</p>\r\n</li>\r\n<li>\r\n<p>Глубже погрузить сотрудников в понимание третьей версии архитектуры &mdash; какие есть базовые компоненты, как они друг с другом взаимодействуют, как хранятся конфигурационные файлы и какие вещи в коде сервиса поддерживают Kubernetes. Все это необходимо документировать и озвучивать внутри компании.</p>\r\n</li>\r\n</ul>\r\n<p>В завершении хотелось бы отметить, что если ваша компания ищет функциональную систему автоматизации процессов сервиса, техподдержки и выездного обслуживания с надежной и отказоустойчивой архитектурой, то вы знаете что найти ее можно у нас, в<span>&nbsp;</span><a href=\"https://okdesk.ru/?utm_source=habrahabr&amp;utm_medium=article&amp;utm_campaign=blog&amp;utm_content=kubernetes\" rel=\"noopener noreferrer nofollow\">Okdesk</a>. Присоединяйтесь к 800+ компаний, которые каждый день сфокусированы на основном бизнесе, а не поиске или разработке собственного ПО для решения обозначенных выше задач.</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 40, 'uploads/images/2022/10/image_750x500_635b900d0f0e2.jpg', 'uploads/images/2022/10/image_750x_635b900d1ddf0.jpg', 'uploads/images/2022/10/image_600x460_635b900d294f5.jpg', 'uploads/images/2022/10/image_380x226_635b900d332cf.jpg', 'uploads/images/2022/10/image_140x98_635b900d37cfa.jpg', 'jpg', 'local', '', 28, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-28 10:24:32'),
(939, 1, 'Apple тестирует новый дизайн веб-приложения iCloud', 'apple-testiruet-noviy-dizayn-veb-prilozheniya-icloud', NULL, 'itfox, habr, community, programming community, turkmenportal', 'Apple начала тестировать обновлённый дизайн веб-приложения iCloud. Компания заменила иконки приложений на интерактивные виджеты, а главную страницу можно персонализировать.', '<p>На главной странице веб-приложения iCloud появилось сообщение о том, что скоро Apple поменяет дизайн приложения. Также пользователям предлагается попробовать новую версию сайта и оставить отзыв.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b92685d08b.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>В веб-версии iCloud теперь нет иконок приложений. Вместо них появились интерактивные виджеты, позволяющие пользователям быстрее получать доступ к файлам и видеть последние синхронизированные изменения без перехода в само приложение. К примеру, &laquo;Фото&raquo; показывает последние фотографии, попавшие в облачное хранилище, а &laquo;Почта&raquo; сразу выводит несколько последних писем. Главная страница стала более информативной.</p>\r\n<p>Также страницу можно персонализировать. У пользователей есть возможность удалить с главного экрана приложения, которые редко используются, а порядок плиток можно менять. Также предусмотрены два размера плиток.</p>\r\n<p>Пока компания не сообщила, когда полностью перейдёт на новый дизайн. Сейчас пользователям предлагается попробовать обновлённый iCloud и оставить отзыв. Важно заметить, что приложение пока в бета-режиме, и некоторые функции могут работать с ошибками.</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 41, 'uploads/images/2022/10/image_750x500_635b924e90357.jpg', 'uploads/images/2022/10/image_750x_635b924ea05a9.jpg', 'uploads/images/2022/10/image_600x460_635b924eaf25a.jpg', 'uploads/images/2022/10/image_380x226_635b924ebbff0.jpg', 'uploads/images/2022/10/image_140x98_635b924ec6878.jpg', 'jpg', 'local', '', 27, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-28 10:28:11'),
(940, 1, 'Учёные создали живого радиоуправляемого голубя', 'uchyonie-sozdali-zhivogo-radioupravlyaemogo-golubya', NULL, 'itfox, habr, community, programming community, turkmenportal', 'Китайские исследователи показали голубя, которым можно управлять с помощью радиоволн. Главной проблемой была небольшая автономность электронной начинки —  всего 45 минут. Согласно последнему исследованию, учёные решили эту проблему, присоединив к птице небольшую солнечную батарею.', '<p>Механизм управления голубем заключается в стимулировании зон мозга, отвечающих за страх, удовольствие и другие факторы, направленные на смену траектории полёта. Чтобы передать стимул напрямую без посредника в виде органов чувств, учёные соединили с соответствующими зонами мозга голубя специальные контакты &mdash; электроды (почти как<span>&nbsp;</span><a href=\"https://4pda.to/2022/08/15/402681/ilon_mask_rasskazal_o_preimuschestvakh_chipirovaniya_mozga/\" target=\"_blank\" rel=\"noopener\">чипы Neuralink</a>).</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b93ac0e5d8.jpg\" alt=\"\" /></p>\r\n<p>Для работы электродам нужна плата управления, которая генерирует электрические сигналы. Учёные разместили её на спине птицы и подключились к плате с помощью радиоканала. Главная проблема заключалась в автономности &mdash; голубем нельзя управлять&nbsp;больше 45 минут. В последнем исследовании учёным удалось поместить на плату достаточно лёгкие солнечные панели &mdash; они непрерывно заряжают АКБ и позволяют управлять птицей два часа в солнечный день. Такой результат более чем в два раза превышает среднее время полёта квадрокоптера.</p>\r\n<p>Операция по вживлению электродов проходит под наркозом, а птица поднимается в воздух только после полного восстановления. Поэтому эксперименты не доставляют ей боли. Голуби на дистанционном управлении с хорошей автономностью облегчат поиск потерявшихся людей в море или лесах, а также позволят эффективнее проводить спасательные операции после стихийных бедствий.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635b93c53bc7d.jpg\" alt=\"\" /></p>', 62, 'uploads/images/2022/10/image_750x500_635b9368700cf.jpg', 'uploads/images/2022/10/image_750x_635b936876aee.jpg', 'uploads/images/2022/10/image_600x460_635b93687d6e5.jpg', 'uploads/images/2022/10/image_380x226_635b9368826ea.jpg', 'uploads/images/2022/10/image_140x98_635b936884e66.jpg', 'jpg', 'local', '', 21, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-28 10:33:59'),
(941, 1, 'Тим Кук объяснил подорожание сервисов Apple', 'tim-kuk-obyasnil-podorozhanie-servisov-apple', NULL, '', 'Глава Apple Тим Кук в ходе объявления финансовых результатов за четвёртый квартал 2022 года объяснил, почему подорожали подписки на сервисы Apple.', '<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>По его словам, это связано не с работой сервисов с технической точки зрения, а с ростом стоимости лицензирования музыки Apple Music.</p>\r\n<p>При этом подписка Apple TV+ подорожала, потому что увеличилось количество сериалов и фильмов, и Apple считает этот продукт более ценным.</p>\r\n<p>&laquo;Мы были на старте, сосредоточились только на своих проектах, у нас было 4-5 сериала вначале и цены были довольно низкими. Теперь у нас намного больше контента, и каждый месяц мы получаем больше, и мы увеличили цену, чтобы отразить ценность услуги&raquo;, &mdash; пояснил Кук.</p>\r\n<p>Глава компании отметил, что цена на Apple One выросла, поскольку подписка включает и Apple Music, и Apple TV+.</p>\r\n<p>Выручка Apple за квартал составила $90,1 млрд, а чистая прибыль &mdash; $20,7 млрд.</p>\r\n<p>Валовая прибыль за квартал достигла 42,3% по сравнению с 42,2% в четвёртом квартале прошлого года.</p>\r\n<p>За весь финансовый год Apple зафиксировала новые рекорды с объёмом продаж $394,3 млрд и чистой прибылью в размере $99,8 млрд.</p>\r\n<p>Ранее Apple впервые<span>&nbsp;</span>подняла<span>&nbsp;</span>стоимость подписки на Apple TV+. Индивидуальный план подорожал с $4,99 до $6,99, а годовой &mdash; с $49 до $69. Стоимость подписок на Apple Music и Apple One также выросла.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 62, 'uploads/images/2022/10/image_750x500_635d00911a40a.jpg', 'uploads/images/2022/10/image_750x_635d009126d37.jpg', 'uploads/images/2022/10/image_600x460_635d009130b3d.jpg', 'uploads/images/2022/10/image_380x226_635d009138965.jpg', 'uploads/images/2022/10/image_140x98_635d00913f2da.jpg', 'jpg', 'local', '', 23, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, '2022-10-29 12:31:26', '2022-10-29 12:31:05'),
(942, 1, 'О способах отслеживания данных — простыми словами. Server-side vs client-side tracking: преимущества и недостатки', 'o-sposobakh-otslezhivaniya-dannikh-prostimi-slovami-server-side-vs-client-side-tracking-preimushchestva-i-nedostatki', NULL, '', 'Отслеживание и сбор данных является одной из ключевых составляющих успеха бизнеса в интернете. В этой статье я расскажу о том, как происходит отслеживание, какие методы бывают, их преимущества и недостатки, а также поделюсь своим опытом использования нового способа отслеживания - server-side tracking  - в Fintech индустрии. Я постаралась рассказать об этом простыми словами и понятно структурировать информацию (мне в свое время не хватало именно таких статей для погружения в тему), и очень надеюсь, что эта статья будет для вас полезной. ', '<p>Итак, начнем.&nbsp;</p>\r\n<p>Выделяют два основных вида отслеживания потока транзакций: client-side tracking и server-side tracking.&nbsp;</p>\r\n<h3>Кто тут клиент, а кто тут сервер?</h3>\r\n<p>Для начала, давайте разберемся, что такое &ldquo;клиент&rdquo; и &ldquo;сервер&rdquo;, т.к. отсутствие понимания этих терминов часто приводит к путанице.</p>\r\n<p>Допустим, вы решили посетить вебсайт. То, что реально произойдет в этом случае - ваш браузер загрузит для вас копии страниц и покажет их вам. Для этого ваш браузер, подобно клиенту в ресторане, сделает запрос на получение определенных страниц, а центральный компьютер отправит - &ldquo;сервирует&rdquo; - эти данные для браузера. Таким образом, ваш браузер выступит в роли клиента, а центральный компьютер, обладающий данными - страницами вебсайта - сервером. Помимо веб-браузера, клиентами могут быть, например, ваше мобильное устройство или приложение.&nbsp;</p>\r\n<h3>А как тут участвуют идентификационные теги?&nbsp;</h3>\r\n<p>Дело в том, что помимо копий страниц, ваш браузер или приложение зачастую загружает идентификаторы - кусочки кода, которые запоминают ваш браузер (например, файлы cookies)&nbsp; или устройство и собирают информацию о посещенных страницах, времени посещения, и т.д. Эти данные затем используются аналитиками данных или маркетологами для решения бизнес-задач.&nbsp;</p>\r\n<h3>Так, понятно, а что за методы сбора данных? Как они работают?&nbsp;</h3>\r\n<p>Таких методов два - client-side tracking и server-side tracking.&nbsp;</p>\r\n<p><em>Client-side tracking, или сбор данных на стороне клиента<span>&nbsp;</span></em>является традиционным, более часто используемым методом. При таком методе добавление тега происходит как в примере выше - с помощью идентификатора в браузере или в приложении. Т.е. действие происходит на &ldquo;клиентской&rdquo; стороне - что и обусловило такое название. Информация отправляется напрямую из браузера пользователя или его мобильного устройства и поступает далее на сервер аналитического сервиса (например, это может быть нередко используемые Google Analytics для вебсайтов или Google Analytics for Firebase - для приложений). Взаимодействие клиента и аналитического сервиса происходит без посредников.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d014616a3c.jpg\" alt=\"\" /></p>\r\n<p>В качестве сноски замечу, что несмотря на то, что именно этот способ традиционно использовался для трекинга в качестве основного, в последнее время он вызывает все больше сомнений в бизнес- и технологических кругах из-за вопросов конфиденциальности и приватности данных. Дело в том, что client-side tracking опирается на использование third-party cookies, то есть на использование кусочков кода, созданного &ldquo;третьей стороной&rdquo; - напрямую не относящейся к вебсайту, который посещает пользователь (например, cookie, созданная рекламодателем, размещающимся на этом вебсайте). У самого вебсайта будет в этом случае крайне лимитированная информация и контроль над функционированием таких cookie. В результате, у пользователей могут возникать опасения, кто и как использует эти данные, собранные об их поведении онлайн. Этот аспект постепенно начинает регулироваться; так, согласно регламенту о защите данных в Европе (GDPR) вебсайты не могут больше использовать third-party cookies без согласия пользователя. В сфере мобильных приложений сами технологические компании делают шаги по изменению ландшафта трекинга из-за возросшего запроса на конфиденциальность данных. Например, взбудоражившая диджитал-сферу ликвидация включенного по умолчанию IDFA (Identifier for Advertisers) трекинга компанией Apple была подобным шагом.&nbsp;</p>\r\n<p><em>Server-side tracking (aka server-to-server, S2S), или сбор данных на стороне сервера.<span>&nbsp;</span></em>В этом случае отслеживание происходит не &ldquo;на клиенте&rdquo; - прямо в браузере или мобильном устройстве -&nbsp; а на сервере. При такой схеме, веб-контейнер сохраняется, однако он будет значительно компактнее (а значит,&nbsp; быстрее) и нацелен на сбор данных по интересующему событию (а не на выполнение множества скриптов разных систем - аналитики, third-party и т.д.). В этом случае third-party cookies не используются вовсе, то есть сбор данных осуществляется только первой стороной. При этом добавляется звено-посредник -<span>&nbsp;</span><em>облачный</em><span>&nbsp;</span><em>сервер</em>. Этот облачный сервер принадлежит (точнее, арендуется) владельцу сайта/приложения.&nbsp; Именно туда и направляется полученный запрос от клиента и данные по нему. Далее в облачном сервере происходит обработка данных и их перенаправление в конечные точки сбора. При этом степень управления и контроля над облачным сервером очень высока. Например, владелец облачного сервера определяет, какие именно данные и в каком виде будут доступны серверам третьей стороны.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d01699e710.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<h3>А зачем нам усложнять процесс сбора данных звеном-посредником?&nbsp;</h3>\r\n<p>Появление дополнительного звена в сборе данных - облачного сервера - нацелено на то, чтобы решить ряд сложностей, сопряженных с привычным, client-side tracking методом. В частности, наличие облачного сервера решает вопросы скорости загрузки страниц, контроля и приватности данных , а также блокировщиков рекламы, которые снижают точность собираемых данных.&nbsp;</p>\r\n<h3>Получается, у server-side tracking есть значительные преимущества? А есть ли недостатки?</h3>\r\n<p>Как это часто бывает, каждый из альтернативных способов имеет свои преимущества и недостатки. Я постаралась свести их воедино в понятную таблицу (подчеркнуты преимущества).</p>\r\n<div>\r\n<div class=\"table\">\r\n<div class=\"table table_wrapped\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\"><em>Аспекты</em></p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\"><em>Client-side</em></p>\r\n</td>\r\n<td>\r\n<p align=\"left\"><em>Server-side</em></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Простота внедрения</p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\"><u>Прост во внедрении</u>. Зачастую существуют уже готовые фрагменты кода, которые можно скопировать и внедрить.</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Потребуется дополнительное время разработчиков на установку и запуск облачного сервера</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Тестирование и отладка</p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\"><u>Проще тестировать</u>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Нет привычных инструментов отладки</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Стоимость&nbsp;</p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\"><u>Как правило, дешевле</u>, т.к. не нужно платить за облачный сервер</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Как правило, дороже</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Безопасность/Защита данных&nbsp;</p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Лимитированный контроль за тем, какие данные собираются&nbsp;</p>\r\n</td>\r\n<td>\r\n<p align=\"left\"><u>Более защищенный;</u><span>&nbsp;</span><u>высокая степень контроля</u><span>&nbsp;</span>над экземпляром сервера и передачей данных третьим сторонам</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Приватность/комплайенс</p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Не отвечает современным запросам на приватность данных</p>\r\n</td>\r\n<td>\r\n<p align=\"left\"><u>Соблюдаются требования приватности;</u><span>&nbsp;</span>поскольку server-side tracking -&nbsp; это сбор данных первой стороной, (а сбор данных третьей стороной не происходит), он соответствует различным регламентам по защите персональных данных, например, GDPR</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Скорость загрузки страниц</p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Скорость загрузки страниц снижается, особенно если используются теги нескольких аналитических систем (они увеличивают нагрузку на браузер/мобильное устройство)</p>\r\n</td>\r\n<td>\r\n<p align=\"left\"><u>Быстрее;</u><span>&nbsp;</span>конечные пользователи получают улучшенную производительность за счет снижения нагрузки тегов, выполняемых в браузере/устройстве пользователя.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Точность данных&nbsp;</p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Блокировщики рекламы, различные браузерные ограничения и удаление пользователями cookie негативно влияют на точность сбора данных</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Поскольку все запросы обрабатываются на стороне сервера, а не на стороне браузера,<span>&nbsp;</span><u>блокировщики рекламы, ITP никак не влияют на точность</u><span>&nbsp;</span>данных</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">CRM/offline данные</p>\r\n</td>\r\n<td data-colwidth=\"234\" width=\"234\">\r\n<p align=\"left\">Нельзя добавить (ввиду прямого взаимодействия конечных систем и&nbsp; браузера/мобильного устройства)&nbsp;</p>\r\n</td>\r\n<td>\r\n<p align=\"left\"><u>Можно добавить релевантные CRM данные</u>, например по событиям, произошедшим уже оффлайн - за пределами сайта или приложения</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p>На последнем пункте имеет смысл остановиться отдельно. Он зачастую опускается при перечислении основных преимуществ и недостатков способов трекинга, однако, на мой взгляд, может оказывать существенное влияние на ваши бизнес-процессы, например улучшить эффективность вашей рекламы.&nbsp;</p>\r\n<h3>Что за CRM данные и чем они могут быть полезны при трекинге?</h3>\r\n<p>Некоторые отслеживаемые события, которые имеют большое значение как для аналитики, так и непосредственно для настройки эффективных рекламных кампаний, происходят вне среды браузера или приложения пользователя.&nbsp;</p>\r\n<p>Например, продолжительное время я сотрудничала с компаниями в сфере Fintech, и такими событиями для них являлись подтвержденный перевод или подтвержденный депозит (в отличие от неподтвержденного депозита, событие по которому происходило в приложении). Эти данные были доступны в CRM системе, и добавление их в систему аналитики предоставляет возможность анализа более &ldquo;полезных&rdquo;, более коррелирующих с прибылью данных. Кроме того, их непосредственное добавление в рекламный аккаунт в качестве цели, могут повысить эффективность работы этих кампаний (т.к. алгоритм в качестве цели будет ориентироваться на более &ldquo;полезное&rdquo; для бизнеса событие). Собственно, эти предположения оправдались. Эффективность рекламных кампаний по ROI возрастала на 10-20%.&nbsp;</p>\r\n<h3>Так какой способ лучше выбирать? Выводы</h3>\r\n<p>Ответ на этот вопрос зависит от того, какими возможностями вы располагаете и какие данные и для каких целей собираете. Если для вас в приоритете сэкономить время (как на внедрение, так и на тестирование, отладку и устранение ошибок) и деньги, то выбирайте client-side tracking. Именно этот способ является привычным и стандартным при отслеживании. Если у же есть потребность в дополнительной точности данных,&nbsp; их конфиденциальности, передаче событий из CRM, и у вас есть возможность направить ресурсы разработчиков на подобный проект - server-side tracking может стать хорошей альтернативой.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 61, 'uploads/images/2022/10/image_750x500_635d018f45414.jpg', 'uploads/images/2022/10/image_750x_635d018f51e00.jpg', 'uploads/images/2022/10/image_600x460_635d018f5cf31.jpg', 'uploads/images/2022/10/image_380x226_635d018f68f85.jpg', 'uploads/images/2022/10/image_140x98_635d018f707a1.jpg', 'jpg', 'local', '', 22, 0, 1, 1, 1, 1, 1, 0, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-29 12:34:42');
