(943, 1, 'Необычный случай восстановления данных или немного реверс-инжиниринга PLC Siemens Simatic S7-300', 'neobichniy-sluchay-vosstanovleniya-dannikh-ili-nemnogo-revers-inzhiniringa-plc-siemens-simatic-s7-300', NULL, 'itfox, habr, community, programming community, turkmenportal', 'На вопрос, какие не самые обычные случаи восстановления данных могут повстречаться в компании, профиль которой – извлекать информацию из поврежденных накопителей, можно привести пример одной из недавних задач с MMCкартой из промышленного ПЛК (PLC) Siemens Simatic S7 300, в задачи которого входило управление несколькими десятками электродвигателей и клапанов, а также анализ параметров целой россыпи датчиков некоего конвейера.', '<p>Для решения этой задачи перечень услуг специалиста по работе с поврежденными накопителями оказался недостаточным. Кроме этого потребовался опыт реверс-инженера, опыт аналитика повреждений в данных, не имеющих избыточности, а также опыт программиста.</p>\r\n<p>Все началось с того, что в один из сентябрьских дней поступил звонок в офис нашей компании. Вопрос клиента состоял в том, готовы ли мы восстановить данные с MMCкарты, на которой используется проприетарная файловая система.&nbsp; На вопрос о том, что случилось с картой, клиент ответил, что есть несколько нечитаемых секторов. Также клиент поинтересовался, знакомы ли мы с промышленными программируемыми логическими контроллерами от Siemens, на что получил ответ, что не знакомы, но можем попытаться исследовать устройство файловой системы и масштаб проблем и далее попытаться найти способ решения.</p>\r\n<p>Клиент не особо был воодушевлен этим ответом и засомневался, стоит ли везти карту памяти в наш офис для проведения аналитических мероприятий. Было предложено прислать посекторную копию для анализа и даны разъяснения как ее можно получить средствами, доступными пользователю.</p>\r\n<p>Получив файл-образ флеш карты, приступаем к осмотру в шестнадцатеричном редакторе.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d023953e56.jpg\" alt=\"\" /></p>\r\n<p>Первое, что бросается в глаза в начале образа &ndash; это предупреждение &laquo;Original Siemens Equipment. Use only with Siemens SIMATIC. Do not format or partition.&raquo; Не обнаружено признаков кода загрузчика, который обычно присутствует в устройствах на х86. В таблице разделов присутствуют 4 шестнадцатибайтных записи о разделах по смещениям 0x1BE, 0x1CE, 0x1DE, 0x1EE. Тип раздела 0x73 до этого случая не встречался.<br /><br />При переходе по смещению на начало первого раздела, описанного в таблице, наблюдаем признаки каких-то данных, но структура и назначение неизвестны.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0257e6426.jpg\" alt=\"\" /></p>\r\n<p>Также в границах раздела обнаруживается множество секторов с ненулевым заполнением и некоторым сходством по заполнению.</p>\r\n<p>В границах второго и третьего разделов отсутствуют признаки данных, отличных от нуля.<br /><br />По смещению на начало четвертого раздела обнаруживаем данные, похожие на некий идентификационный блок.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d028ddde95.jpg\" alt=\"\" /></p>\r\n<p>Иных данных, отличных от нуля, на этом разделе более нет. Очевидно, что разделы 2, 3, 4 можно исключить из дальнейшего рассмотрения по причине отсутствия какого-либо значимого содержимого.</p>\r\n<p>В границах первого раздела выполняем поиск каких-либо известных метаданных файловых систем средствами DataExtractorиз комплекса PC3000Express. Результаты поиска неутешительны &ndash; никаких известных структур не обнаружено.</p>\r\n<p>В такой ситуации поясняем клиенту, что действительно на накопителе нет признаков известных файловых систем, и самым бюджетным методом будет попытка чтения флеш-накопителя нашими средствами. Возможно, при определенных условиях нечитаемые у клиента блоки буду прочитаны, и это будет решением задачи.</p>\r\n<p>Клиент, изучив рынок услуг, не обнаружил предложений, альтернативных нашему, где бы предлагались более действенные методы решения задачи и в итоге принял предложение предоставить ММС карту для осуществления попыток чтения.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d02a4d0f0d.jpg\" alt=\"\" /></p>\r\n<p>Было предпринято множество попыток прочитать карту, и некоторые из них были успешны, согласно протоколу передачи данных от карты к ридеру. Но после проведения сравнительного анализа &laquo;успешных&raquo; попыток чтения оптимизма в плане решения задачи поубавилось.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d02c720416.jpg\" alt=\"\" /></p>\r\n<p>Обнаружилось, что начитанное из одних и тех же мест содержимое сильно различается. Очевидно, что микропрограмма карты памяти при большом количестве битовых ошибок способна отдать искаженные данные под видом успешно прочитанных.</p>\r\n<p>Ничего не остается, как рассмотреть возможные методы исправления ошибок. Первое, что обычно практикуется в борьбе со случайно возникающими ошибками, &ndash; это многократная вычитка поврежденных участков с последующим выбором наиболее часто повторяющихся значений. Недостаток этого метода проявляется в местах, которые устойчиво читаются с ошибкой. В итоге в скомпонованный вариант попадают ошибочные данные.</p>\r\n<p>В нашем случае после анализа нескольких скомпонованных вариантов становится очевидным, что данный метод без дополнительной аналитики неприменим из-за сохраняющихся разночтений в скомпонованных вариантах. На этом моменте появляется необходимость ознакомления с ПЛК Siemens Simatic S7-300.</p>\r\n<p>Обращаемся к сайту производителя за документацией и обнаруживаем достаточно большой документ размером около 300 страниц, на изучение которого может потребоваться слишком много времени. Поиск альтернативных материалов привел к нахождению учебно-методического пособия &laquo;Основы языка программирования STEP7 и базового программного обеспечения промышленных контроллеров SIEMENS&raquo; Автор: Романов В.П., которое оказалось более пригодным для быстрого ознакомления с общей идеологией написания программ для контроллеров. Этого пособия и накопленных ранее знаний было достаточно, чтобы приступить к дальнейшим исследованиям.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d02dfef744.jpg\" alt=\"\" /></p>\r\n<p>Прикладное программное обеспечение, исполняемое в среде PLC Siemens Simatic S7 делится на блоки различного назначения:<br />OB &ndash; организационные блоки, которые являются обработчиками событий.<br />FC &ndash; функциональные блоки, которые можно вызывать с передачей параметров.<br />FB &ndash; функциональные блоки, отличаются от FC возможностью использовать STAT переменные.<br />DB &ndash; блоки данных.<br />SFC &ndash; системные функциональные блоки.<br />SFB &ndash; системные функциональные блоки.<br />SDB &ndash; системные блоки данных.<br /><br />Рассмотрим один из блоков в виде декомпилированного кода и в откомпилированном варианте.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d02f98e6c7.jpg\" alt=\"\" /></p>\r\n<p>Обращаем внимание, что кроме самого кода присутствуют описатели типов переменных, а также присутствует деление кода на сегменты (networks). Это не совсем свойственно для языков, похожих на ассемблер. Это наблюдение дает нам основания полагать, что это не вольная трактовка среды разработки, а наличие служебных данных, которые описывают переменные и сегменты кода.</p>\r\n<p>Для проверки предположений нам необходимо посмотреть в откомпилированном блоке размер всех инструкций и определить те места, которые не являются непосредственно исполняемым кодом. Для выполнения этой задачи необходим справочник, где были бы указаны шестнадцатеричные коды и размерность операндов, соответствующие мнемоникам. Быстро найти такой справочник в официальной документации не удалось, но на просторах интернета обнаружены труды<span>&nbsp;</span><a href=\"https://github.com/nnaumenko\" rel=\"noopener noreferrer nofollow\">Nick Naumenko</a>, опираясь на которые можно было продолжить анализ.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d031390026.jpg\" alt=\"\" /></p>\r\n<p>По смещению 0x24 обнаруживаем последовательность байт 0x79 0x58 0x00 0x02, где 0x79 0x58 инструкция &laquo;А&raquo;, а 0x00 0x02 &ndash; её операнд. По смещению 0x9Cнаходится последовательность байт 0x65 0x00, что соответствует инструкции BE (Blockend), по достижении которой выполнение кода в блоке завершается, и возвращается управление в блок, откуда был осуществлен вызов. Как видим, размер исполняемого кода заметно меньше, чем всего информации в блоке, и составляет 0x7A (122) байта при размере всего блока 0xFA(250) байт. Сразу бросается в глаза значение 0x00 0x7Aпо смещению 0x22, которое равно размеру исполняемого кода, и значение 0x00 0xFAпо смещению 0x0A, которое равно размеру всего блока. Проверки на других блоках подтверждают предположение о назначении этих байт. Проведя множество сравнительных и аналитических операций, выяснили назначение большинства данных, не являющихся исполняемым кодом.</p>\r\n<p><strong>Устройство блока.</strong></p>\r\n<div>\r\n<div class=\"table\">\r\n<div class=\"table table_wrapped\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">Смещение</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">Размер</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Описание</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x00</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">DWORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Устойчивое выражение 0x70 0x70 0x01 0x10 &ndash; маркер начала блока</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x04</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">BYTE</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Данное значение изменяется при перезаписи блока средствами контроллера. Возможно, счетчик. Дублируется в файловой системе.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x05</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">BYTE</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Тип блока (0x0С - FC, 0x0E - FB, 0x0A - DB и т.п.)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x06</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Номер блока</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x0A</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Размер блока</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x10</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">6 BYTES</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Метка времени (timestamp) &ndash; дата и время создания</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x16</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">6 BYTES</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Метка времени (timestamp) &ndash; дата и время последних исправлений</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x1C</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Размер label area (блок описания типов переменных и установленных значений)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x1E</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Размер таблицы сегментов</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x22</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Размер исполняемого кода.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">0x24</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">[0x22]</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Начало исполняемого кода.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">[0x22]+0x24</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">[0x1C]</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Label Area &ndash; блок описаний типов переменных и их значений. Начало блока вычисляется посредством сложения 0x24 с значением по смещению 0x22</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">[0x1C]+[0x22]+0x24</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">[0x1E]</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Таблица количества и размеров сегментов кода (Networks)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"212\" width=\"212\">\r\n<p align=\"left\">[0x1E]+[0x1C]+[0x22]+0x24</p>\r\n</td>\r\n<td data-colwidth=\"98\" width=\"98\">\r\n<p align=\"left\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Информационный блок</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p><br /><strong>Устройство таблицы переменных (Label Area)</strong></p>\r\n<div>\r\n<div class=\"table\">\r\n<div class=\"table table_wrapped\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td data-colwidth=\"214\" width=\"214\">\r\n<p align=\"left\">Смещение</p>\r\n</td>\r\n<td data-colwidth=\"101\" width=\"101\">\r\n<p align=\"left\">Размер</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Описание</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"214\" width=\"214\">\r\n<p align=\"left\">0x02</p>\r\n</td>\r\n<td data-colwidth=\"101\" width=\"101\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Размер описателей типов переменных</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"214\" width=\"214\">\r\n<p align=\"left\">0x04</p>\r\n</td>\r\n<td data-colwidth=\"101\" width=\"101\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Размер блока с установленными значениями переменных значений переменных</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"214\" width=\"214\">\r\n<p align=\"left\">0x07</p>\r\n</td>\r\n<td data-colwidth=\"101\" width=\"101\">\r\n<p align=\"left\">[0x02]</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Блок описания типов переменных. На описание каждой переменной выделяется 2 байта. В первом байте указывается тип переменной (0x01 &ndash; bool, 0x02 &ndash; byte, 0x05 &ndash; int, 0x08 &ndash; real и т.п.). Во втором байте указывается статус переменной: не определен, определен, имеет фиксированное значение в блоке значений переменных</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"214\" width=\"214\">\r\n<p align=\"left\">[0x02]+0x07</p>\r\n</td>\r\n<td data-colwidth=\"101\" width=\"101\">\r\n<p align=\"left\">[0x04]</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Блок значений переменных</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p><br /><strong>Устройство таблицы сегментов кода (Networks)</strong></p>\r\n<div>\r\n<div class=\"table\">\r\n<div class=\"table table_wrapped\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td data-colwidth=\"216\" width=\"216\">\r\n<p align=\"left\">Смещение</p>\r\n</td>\r\n<td data-colwidth=\"103\" width=\"103\">\r\n<p align=\"left\">Размер</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Описание</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"216\" width=\"216\">\r\n<p align=\"left\">0x00</p>\r\n</td>\r\n<td data-colwidth=\"103\" width=\"103\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Количество сегментов кода</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"216\" width=\"216\">\r\n<p align=\"left\">0x02</p>\r\n</td>\r\n<td data-colwidth=\"103\" width=\"103\">\r\n<p align=\"left\">[0x00]*2</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Записи размеров сегментов. Каждая запись состоит из двух байт.&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p><br /><strong>Устройство информационного блока</strong></p>\r\n<div>\r\n<div class=\"table\">\r\n<div class=\"table table_wrapped\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td data-colwidth=\"218\" width=\"218\">\r\n<p align=\"left\">Смещение</p>\r\n</td>\r\n<td data-colwidth=\"106\" width=\"106\">\r\n<p align=\"left\">Размер</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Описание</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"218\" width=\"218\">\r\n<p align=\"left\">0x00</p>\r\n</td>\r\n<td data-colwidth=\"106\" width=\"106\">\r\n<p align=\"left\">QWORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Текстовое поле &laquo;Author&raquo;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"218\" width=\"218\">\r\n<p align=\"left\">0x08</p>\r\n</td>\r\n<td data-colwidth=\"106\" width=\"106\">\r\n<p align=\"left\">QWORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Текстовое поле &laquo;Family&raquo;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"218\" width=\"218\">\r\n<p align=\"left\">0x10</p>\r\n</td>\r\n<td data-colwidth=\"106\" width=\"106\">\r\n<p align=\"left\">QWORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Текстовое поле &laquo;Name&raquo;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"218\" width=\"218\">\r\n<p align=\"left\">0x18</p>\r\n</td>\r\n<td data-colwidth=\"106\" width=\"106\">\r\n<p align=\"left\">BYTE</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Номер версии. Старшие 4 бита &ndash; номер перед точкой, младшие 4 бита &ndash; номер после точки</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p><br />Для решения задачи по восстановлению данных кроме анализа содержимого модулей ПО к PLC Siemens SIMATIC S7 необходимо частично исследовать файловую систему, чтобы понимать принцип размещения данных, с дальнейшей разработкой методов контроля целостности.<br /><br />При осмотре данных в образе карты памяти обнаруживается, что в каждом секторе первого раздела выделяются первые 16 байт под нужды файловой системы, а 496 байт &ndash; для хранения данных. В первом секторе раздела содержатся конфигурационные параметры, один из которых является ссылкой на таблицу объектов.<br /><br /><strong>Устройство служебного заголовка в секторе</strong></p>\r\n<div>\r\n<div class=\"table\">\r\n<div class=\"table table_wrapped\">\r\n<table style=\"width: 751px;\">\r\n<tbody>\r\n<tr>\r\n<td data-colwidth=\"204\" style=\"width: 204.297px;\">\r\n<p align=\"left\">Смещение</p>\r\n</td>\r\n<td data-colwidth=\"121\" style=\"width: 122.523px;\">\r\n<p align=\"left\">Размер</p>\r\n</td>\r\n<td style=\"width: 414.18px;\">\r\n<p align=\"left\">Описание</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"204\" style=\"width: 204.297px;\">\r\n<p align=\"left\">0x00</p>\r\n</td>\r\n<td data-colwidth=\"121\" style=\"width: 122.523px;\">\r\n<p align=\"left\">BYTE</p>\r\n</td>\r\n<td style=\"width: 414.18px;\">\r\n<p align=\"left\">Данное значение изменяется при перезаписи блока средствами контроллера. Возможно, счетчик. Дублируется в заголовке блока</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"204\" style=\"width: 204.297px;\">\r\n<p align=\"left\">0x01</p>\r\n</td>\r\n<td data-colwidth=\"121\" style=\"width: 122.523px;\">\r\n<p align=\"left\">BYTE</p>\r\n</td>\r\n<td style=\"width: 414.18px;\">\r\n<p align=\"left\">Тип блока</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"204\" style=\"width: 204.297px;\">\r\n<p align=\"left\">0x02</p>\r\n</td>\r\n<td data-colwidth=\"121\" style=\"width: 122.523px;\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td style=\"width: 414.18px;\">\r\n<p align=\"left\">Номер блока</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"204\" style=\"width: 204.297px;\">\r\n<p align=\"left\">0x04</p>\r\n</td>\r\n<td data-colwidth=\"121\" style=\"width: 122.523px;\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td style=\"width: 414.18px;\">\r\n<p align=\"left\">Порядковый номер сектора в сохраненном объекте</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"204\" style=\"width: 204.297px;\">\r\n<p align=\"left\">0x0A</p>\r\n</td>\r\n<td data-colwidth=\"121\" style=\"width: 122.523px;\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td style=\"width: 414.18px;\">\r\n<p align=\"left\">Абсолютный номер следующего сектора, принадлежащего текущему объекту. 0x00 &ndash; признак последнего сектора в цепочке.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"204\" style=\"width: 204.297px;\">\r\n<p align=\"left\">0x10</p>\r\n</td>\r\n<td data-colwidth=\"121\" style=\"width: 122.523px;\">\r\n<p align=\"left\">&nbsp;</p>\r\n</td>\r\n<td style=\"width: 414.18px;\">\r\n<p align=\"left\">Пользовательские данные</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d03342255a.jpg\" alt=\"\" /></p>\r\n<p>В конфигурационном секторе по смещению 0x2A находится абсолютный указатель на начало таблицы размещения объектов (получаемое смещение в байтах 0x0152*0x0200=0x2A400).</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d035695d17.jpg\" alt=\"\" /></p>\r\n<p>По рисунку 10 достаточно легко заметить, что размер одной записи в таблице составляет 16 байт.<br /><br /><strong>Устройство записи в таблице размещения объектов.</strong></p>\r\n<div>\r\n<div class=\"table\">\r\n<div class=\"table table_wrapped\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td data-colwidth=\"190\" width=\"190\">\r\n<p align=\"left\">Смещение</p>\r\n</td>\r\n<td data-colwidth=\"116\" width=\"116\">\r\n<p align=\"left\">Размер</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Описание</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"190\" width=\"190\">\r\n<p align=\"left\">0x01</p>\r\n</td>\r\n<td data-colwidth=\"116\" width=\"116\">\r\n<p align=\"left\">BYTE</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Тип блока</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"190\" width=\"190\">\r\n<p align=\"left\">0x02</p>\r\n</td>\r\n<td data-colwidth=\"116\" width=\"116\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Номер блока</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"190\" width=\"190\">\r\n<p align=\"left\">0x06</p>\r\n</td>\r\n<td data-colwidth=\"116\" width=\"116\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Размер данных блока (дублируется в заголовке блока)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td data-colwidth=\"190\" width=\"190\">\r\n<p align=\"left\">0X0A</p>\r\n</td>\r\n<td data-colwidth=\"116\" width=\"116\">\r\n<p align=\"left\">WORD</p>\r\n</td>\r\n<td>\r\n<p align=\"left\">Абсолютный номер первого сектора блока</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p>Опираясь на приведенные выше данные в таблицах, имеем возможность разработать методы логической коррекции ошибок.<br /><br />Первым шагом было приведение в порядок всех секторных заголовков в поврежденных местах, чтобы начала отрабатывать процедура конвертации из образа MMC карты в WLD файл, пригодный для загрузки в среду разработки. Это позволило анализировать логи ошибок при декомпиляции в среде разработки.<br /><br />Вторым шагом было исправление ошибок в служебных заголовках блоков, чтобы были верны маркер, номер и тип блока, описатели размеров всех секций.<br /><br />Третьим шагом была коррекция блоков с таблицами типов и значениями переменных и проверка соответствий размеров блоков описателей типов переменных и блоков со значениями переменных. Также были отброшены заведомо невозможные биты из значений описателей типов и их статуса.<br /><br />Четвертым шагом было исправление ошибок в таблице сегментов. После исключения заведомо невозможных значений битов. Осуществлялась проверка: сумма значений размеров сегментов + 2 = [0x22] (размер исполняемого кода).<br /><br />Пятый шаг &ndash; разложение всего блока с исполняемым кодом на отдельные команды. На этом этапе потребовалась коррекция ошибок в кодах команд посредством исключения всех заведомо невозможных битов в кодах команд и их операндах, а также сопоставление команд со справочником Naumenko на предмет возможности их существования. Учитывая, что команд намного меньше, чем допускает множество от 0x0000 &ndash; 0xFFFF, то метод был достаточно эффективным.<br /><br />По итогам этих мероприятий удалось убрать подавляющее большинство ошибок, но не удалось убрать все.<br /><br />Так как процесс декомпиляции происходил без каких-либо сообщений об ошибках, дальнейший контроль мог быть осуществлен только с анализом логики в самом коде.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d03755307f.jpg\" alt=\"\" /></p>\r\n<p>Для примера берем поврежденный блок FB1 и обращаем внимание, что этот функциональный блок, ответственный за процедуру управления клапанами, является&nbsp; универсальным куском кода, используемым для всех клапанов в конвейере. Номер клапана и сопутствующие параметры задаются в блоках с данными DBxx. Для каждого клапана выделен свой блок данных.</p>\r\n<p>Анализ блоков данных, связанных с процедурой управления, позволил точно выверить ошибки в блоке описания типов переменных, так как они в точности должны были соответствовать блокам данных. Дальнейший анализ подразумевал проверку корректности операндов в инструкциях, которые по большей части являлись номерами переменных, и проверку корректности получаемых логических схем.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0389c2daa.jpg\" alt=\"\" /></p>\r\n<p>Результатом проведения всех видов работ стал работоспособный код, который был<br />успешно запущен, и конвейер возвращен к жизни.</p>\r\n<p>В заключение хочется упомянуть, что это не единичное предприятие, которое<br />становится жертвой отказа носителя информации, вследствие того, что<br />обслуживающий персонал не заботился о сохранности исходного кода проекта,<br />который поставлялся вместе с оборудованием, а также не удосужился сделать<br />резервные копии MMC карты, когда она еще была исправной, что в итоге привело к серьезным убыткам на предприятии.<br /><br />Хотелось бы надеяться на то, что кто-то извлечет урок из этой ситуации, и подобные отказы впредь не будут иметь столь серьезных последствий.</p>\r\n</div>\r\n</div>\r\n</div>', 1, 'uploads/images/2022/10/image_750x500_635d02146c867.jpg', 'uploads/images/2022/10/image_750x_635d0214799c6.jpg', 'uploads/images/2022/10/image_600x460_635d021484cae.jpg', 'uploads/images/2022/10/image_380x226_635d02148f04e.jpg', 'uploads/images/2022/10/image_140x98_635d021496fca.jpg', 'jpg', 'local', '', 23, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-29 12:43:41'),
(944, 1, 'Arm запретит сторонние модули в чипах при наличии своих аналогов и введёт роялти', 'arm-zapretit-storonnie-moduli-v-chipakh-pri-nalichii-svoikh-analogov-i-vvedyot-royalti', NULL, 'itfox, habr, community, programming community, turkmenportal', 'В ходе судебного разбирательства с американской Qualcomm британская Arm решила изменить свою бизнес-модель. Теперь лицензионные сборы будут платить производители конечных устройств, в том числе смартфонов и планшетов. Разработчик также запретит в чипах с Arm-процессорами сторонние компоненты при наличии своих аналогов, включая GPU, NPU и ISP.', '<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>Ранее Arm<span>&nbsp;</span>подала<span>&nbsp;</span>в суд на Qualcomm после того, как та купила разработчика серверных процессоров Nuvia. Британская компания считает, что после этой сделки все прежние договорённости нужно считать недействительными, так как Nuvia разработала проекты микросхем с использованием лицензий Arm, и они не могут быть переданы Qualcomm без разрешения.</p>\r\n<p>Qualcomm подала встречный иск.</p>\r\n<p>В нём говорится, что после 2024 года Arm перестанет лицензировать архитектуру своих процессоров производителям полупроводниковых компонентов. С этого момента платить должны будут производители конечных устройств.&nbsp;</p>\r\n<p>Как отмечает Qualcomm, Arm уже сообщила OEM-производителям, что вскоре им придётся платить прямые лицензионные отчисления.</p>\r\n<p>Также британская компания решила ужесточить также свою политику в отношении разработчиков чипов, в том числе и Qualcomm. Они больше не смогут использовать в однокристальных платформах с Arm-процессорами сторонние компоненты, если Arm предлагает их аналоги в качестве лицензируемого продукта. Это коснётся графических и сетевых процессоров, а также процессоров обработки изображений. Данное нововведение затронет партнёрства Samsung и AMD, а также MediaTek и Imagination.</p>\r\n<p>Однако новые правила коснутся не всех. У Nvidia есть 20-летняя лицензия на разработку компонентов с Arm-архитектурой, а Apple стояла у истоков Arm. Кроме того, нововведения не затронут сотрудничество Arm с Broadcom.&nbsp;</p>\r\n<p>В мае Qualcomm&nbsp;подтвердила, что хотела бы получить долю в Arm и помочь создать консорциум, который позволит удержать британского разработчика чипов в нейтральном положении. Однако владелец Arm SoftBank планирует сохранить контрольный пакет акций производителя после IPO. Его&nbsp;намерены провести&nbsp;в течение финансового года, который закончится 31 марта 2023 года.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 62, 'uploads/images/2022/10/image_750x500_635d049a13c37.jpg', 'uploads/images/2022/10/image_750x_635d049a1deb8.jpg', 'uploads/images/2022/10/image_600x460_635d049a27742.jpg', 'uploads/images/2022/10/image_380x226_635d049a30286.jpg', 'uploads/images/2022/10/image_140x98_635d049a36363.jpg', 'jpg', 'local', '', 22, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-29 12:48:47');
