(945, 1, 'Sublime Text 3 для верстки сайтов. Настройка внешнего вида и установка плагинов. Руководство для начинающих', 'sublime-text-3-dlya-verstki-saytov-nastroyka-vneshnego-vida-i-ustanovka-plaginov-rukovodstvo-dlya-nachinayushchikh', NULL, '', 'Сегодня расскажу о редакторе кода, которым пользуюсь для верстки сайтов уже много лет. Быстрый, удобный и полностью настраиваемый Sublime Text 3.', '<p><span>Мы с нуля настроем его внешний вид, а также применим плагины AutoFileName, BracketHighliter, ColorHighliter, Emmet, GotoCSSDeclaration и Tag, которые существенно помогут нам при верстке сайтов! Ну что ж, от слов к делу!</span><br /><a name=\"habracut\"></a></p>\r\n<h2>Внешний вид программы</h2>\r\n<p><br /><span>Первым делом, после установки Sublime Text 3, я настраиваю внешний вид программы.</span><br /><br /></p>\r\n<h3>Боковая панель</h3>\r\n<p><br /><span>Для отображения панели переходим&nbsp;</span><b>View &ndash; Side Bar &ndash; Show Open Files</b><span>. В этой панели будут отображаться наши проекты, то есть папки и файлы нашей верстки. Для наглядности сейчас добавлю один из них. Все что там нужно сделать &mdash; это просто перетащить папку с проектом на нашу панель.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0eae715e6.jpg\" alt=\"\" /></p>\r\n<h3>Цветовая схема</h3>\r\n<p><br /><span>Далее настраиваю цветовую схему программы и кода, для наглядности открою любой файл, например, с HTML кодом. Для этого два раза кликаю на нужном файле. Теперь перехожу&nbsp;</span><b>Preferences &ndash; Color Scheme</b><span>, открывается окошко с установленными цветовыми решениями и при выборе той или иной темы внешний вид нашего кода и сама программа будут меняться.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0ec2d7b6b.jpg\" alt=\"\" /></p>\r\n<p><span>Лично мне не подходит ни один из предустановленных вариантов, поэтому я устанавливаю дополнительную цветовую схему. Огромное их количество можно найти и ознакомиться на сайте с дополнениями к Sublime&nbsp;</span><a href=\"https://packagecontrol.io/browse/labels/color%20scheme\">packagecontrol.io</a><span>. Я уже знаю какую именно я схему хочу установить, что сейчас и сделаю.</span><br /><br /><span>Для того что устанавливать новые цветовые схемы, плагины и прочие дополнения, мне нужно сперва установить установщик этих дополнений. Звучит сложно, но на деле все гораздо проще.</span><br /><br /><span>Перехожу в меню&nbsp;</span><b>Tools &ndash; Command Palette</b><span>, либо нажимаю&nbsp;</span><b>Ctrl+Shift+P</b><span>. Открывается вот такое окно с поиском, в поле поиска ввожу&nbsp;</span><i>install</i><span>&nbsp;пока не увижу пункт&nbsp;</span><i>Install Package Control</i><span>, и нажимаю на него. Спустя несколько секунд получаю сообщение о том, что Package Control успешно установлен. Теперь я могу приступить к установке нужной цветовой схемы.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0ee2835e1.jpg\" alt=\"\" /></p>\r\n<p><span>Для этого опять вызываю Command Palette зажимая Ctrl+Shift+P, в поле поиска опять ввожу&nbsp;</span><i>install</i><span>&nbsp;пока не увижу пункт&nbsp;</span><i>Package Control: Install Package</i><span>&nbsp;(установить пакет дополнения) нажимаю на него. Немного подождав вижу окно со списком всех доступных дополнений к Sublime. Ну, почти всех.</span><br /><br /><span>В поле поиска ввожу название того дополнения, которое хочу установить, в данный момент &mdash; это цветовая схема под названием Base16 Color Schemes, точнее это целый пакет с множеством цветовых схем. Нажимаю на найденный пункт и ожидаю установки. Индикатор процесса установки можно увидеть на нижней панели программы. Получив там же короткое сообщение о том, что все установлено перехожу к смене схемы. Для этого открываю уже знакомый пункт меню&nbsp;</span><b>Preferences &ndash; Color Scheme</b><span>&nbsp;и вижу в открывшемся окне уже большое множество разных вариантов. Меня интересует схема Ocean, ввожу название в поиске, их тут есть две: одна более контрастней другой.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0ef480b8c.jpg\" alt=\"\" /></p>\r\n<p><span>Моя любимая цветовая схема установлена, ты конечно же можешь выбрать себе любую другую.</span><br /><br /><span>Общий вид программы мне больше нравится темный, поэтому перехожу&nbsp;</span><b>Preferences &ndash; Theme</b><span>, и переключаюсь на&nbsp;</span><b>Adaptive.sublime-theme</b></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0f0f64e9c.jpg\" alt=\"\" /></p>\r\n<p><span>Сочетание цветов очень важно для работы с кодом, так как это влияет не только на восприятие, но и на усталость и здоровье твоих глаз. Так что подбери себе цветовую схему так, чтобы тебя ничего в ней не напрягало. И помни про перерывы в работе!</span><br /><br /></p>\r\n<h3>Дополнительные настройки</h3>\r\n<p><br /><span>Дополнительно повысить восприятие кода и комфорт при работе с ним мне помогут следующие дополнительные настройки. Переходим&nbsp;</span><b>Preferences &ndash; Settings</b><span>. Открывается такое окно разделенное на две части. В левой части настройки по умолчанию, их изменить нельзя, а вот в правой части ты можешь эти настройки переназначить, каждая следующая должна идти через запятую. Вот какие настройки использую я:</span><br /><br /></p>\r\n<pre><code class=\"json hljs\"><span class=\"hljs-string\">\"margin\"</span>: <span class=\"hljs-number\">0</span>, <span class=\"hljs-comment\">// Убирает отступы</span>\r\n<span class=\"hljs-string\">\"font_size\"</span>: <span class=\"hljs-number\">10</span>, <span class=\"hljs-comment\">// Размер шрифта по умолчанию</span>\r\n<span class=\"hljs-string\">\"draw_indent_guides\"</span>: <span class=\"hljs-literal\">true</span>, <span class=\"hljs-comment\">// Включает/выключает направляющие линии</span>\r\n<span class=\"hljs-string\">\"draw_white_space\"</span>: <span class=\"hljs-string\">\"all\"</span>, <span class=\"hljs-comment\">// Отображает непечатаемые символы</span>\r\n<span class=\"hljs-string\">\"tab_size\"</span>: <span class=\"hljs-number\">3</span>, <span class=\"hljs-comment\">//Размер табуляции</span>\r\n<span class=\"hljs-string\">\"remeber_open_files\"</span>: <span class=\"hljs-literal\">true</span>, <span class=\"hljs-comment\">// Помнит открытые ранее файлы</span>\r\n</code></pre>\r\n<p><br /><span>Поясню каждую настройку.</span><br /><br /></p>\r\n<pre><code class=\"json hljs\"><span class=\"hljs-string\">\"margin\"</span>: <span class=\"hljs-number\">0</span>, <span class=\"hljs-comment\">// Убирает отступы</span>\r\n</code></pre>\r\n<p><br /><span>Убирает странные отступы в программе между кодом и боковой панелью, что делает общую картину более компактной.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0f29e559d.jpg\" alt=\"\" /></p>\r\n<pre><code class=\"json hljs\"><span class=\"hljs-string\">\"font_size\"</span>: <span class=\"hljs-number\">10</span>, <span class=\"hljs-comment\">// Размер шрифта по умолчанию</span>\r\n</code></pre>\r\n<p><br /><span>Выставляет размер шрифта по умолчанию.Также быстро изменить размер шрифта, работая с кодом, можно зажав контрол и покрутив колесо мыши.</span><br /><br /><span>Если ты вдруг размер изменил случайно, то сбросить его можно перейдя в&nbsp;</span><b>Preferences &ndash; Font &mdash; Reset</b></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0f43903c4.jpg\" alt=\"\" /></p>\r\n<pre><code class=\"json hljs\"><span class=\"hljs-string\">\"draw_indent_guides\"</span>: <span class=\"hljs-literal\">true</span>, <span class=\"hljs-comment\">// Включает/выключает направляющие линии</span>\r\n</code></pre>\r\n<p><br /><span>Эти линии очень полезны для новичка, потому что визуально соединяют открывающий и закрывающий элемент, что существенно помогает в ориентации в коде.</span><br /><br /><span>Лично я отключаю их (false) по двум причинам. Первая &mdash; я уже не новичок и без них неплохо справляюсь, вторая причина &mdash; это следующая настройка.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0f5843a00.jpg\" alt=\"\" /></p>\r\n<pre><code class=\"json hljs\"><span class=\"hljs-string\">\"draw_white_space\"</span>: <span class=\"hljs-string\">\"all\"</span>, <span class=\"hljs-comment\">//Отображает непечатаемые символы</span>\r\n</code></pre>\r\n<p><br /><span>Отображает невидимые табуляции и пробелы. То есть это не часть кода, а просто разметка для удобства работы. И вот, если включить и draw_indent_guides и draw_white_space то получатеся кашица которая лично меня напрягает. Что из этого использовать, а что нет &mdash; решать тебе.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0f72b6a64.jpg\" alt=\"\" /></p>\r\n<pre><code class=\"json hljs\"><span class=\"hljs-string\">\"tab_size\"</span>: <span class=\"hljs-number\">3</span>, <span class=\"hljs-comment\">//Размер табуляции</span>\r\n</code></pre>\r\n<p><br /><span>Размер ширины линии отступа при нажатии Tab. Лично мне нравится 3й размер :)</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0fb7da970.jpg\" alt=\"\" /></p>\r\n<pre><code class=\"json hljs\"><span class=\"hljs-string\">\"remember_open_files\"</span>: <span class=\"hljs-literal\">true</span>, <span class=\"hljs-comment\">//Помнит открытые файлы</span>\r\n</code></pre>\r\n<p><br /><span>Например мы работали работали, а потом неожиданно закрыли программу :) Бывает такое? У меня постоянно, так вот эта настройка включает &laquo;память&raquo; у Sublime и при следующем открытии программы откроются и все последние файлы. И да, память работает и после перезагрузки компа.</span><br /><br /></p>\r\n<h3>Разделение рабочего окна</h3>\r\n<p><br /><span>Еще более улучшить восприятие кода и ускорить процесс верстки нам поможет разделение рабочего окна.</span><br /><br /><span>Поскольку практически всегда приходится работать с несколькими разными файлами, например index.html style.css и какой-то js файл, то дополнительным удобством будет разделение окна с кодом на секторы. Варинтов несколько. Переходим в&nbsp;</span><b>View &ndash; Layout</b><span>&nbsp;и смотрим что тут у нас есть.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0fd515d7d.jpg\" alt=\"\" /></p>\r\n<p><span>Соответственно Single &ndash; это вид без разделений как сейчас, Columns: 2, 3, 4 это разбивка по вертикали. Например нажав на Columns: 2 наш экран с кодом разделится пополам, и мы можем часть файлов переместить в пустую колонку, например CSS слева HTML и JS справа, что делает работу более наглядной и быстрой.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d0fece52b3.jpg\" alt=\"\" /></p>\r\n<p><span>Так же у нас есть варианты поделить экран по горизонтали это Rows: 2 и Rows: 3, нажав например на Rows: 3 получим три горизонтальных окна и можно перекинуть JS файл в третье окно. И последний вариант это Grid: 4 который делит экран пополам как по горизонтали, так и по вертикали. В результате получаются четыре окна. Обрати внимание, что переключаться между режимами можно и с помощью горячих клавиш&nbsp;</span><b>Alt+Shift+ соответствующая цифра</b><span>.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d101d6ef32.jpg\" alt=\"\" /></p>\r\n<p><span>Так что у тебя есть широкий выбор по вкусу. Я чаще всего использую одно разделение по вертикали.</span><br /><br /></p>\r\n<h3>Подсветки синтаксиса</h3>\r\n<p><br /><span>Конечной настройкой внешнего вида будет настройка подсветки синтаксиса. Слово страшное, однако на деле все просто.</span><br /><br /><span>Подсветки синтаксиса &ndash; это особое окрашивание цветом того или иного елемента в коде. Например, в этой цветовой схеме в HTML файле краcным выделен тег, зеленым &mdash; название класса, белым &mdash; текст и так далее. Это делает восприятие кода намного понятнее. Обрати внимание на правый нижний угол окна программы, в зависимости от того как кой файл у нас сейчас активен, CSS HTML JS и так далее происходит переключение отображения кода этого конкретного файла.</span><br /><br /><span>Зачем же тут что-то делать если все и так отлично работает? Дело в том что в начальном пакете Sublime установлены пакеты подсветки синтаксиса далеко не для всех форматов.</span><br /><br /><span>Например, в дальнейшем я планирую работать с файлами SCSS, открыв его я увижу сплошную простыню из набора белых символов. Не очень удобно, правда?</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d103641d80.jpg\" alt=\"\" /></p>\r\n<p><span>Так вот, в таких случаях я дополнительно устанавливаю нужный пакет.</span><br /><br /><span>Открываем наш привычный Commаnd Palette перейдя&nbsp;</span><b>Tools &ndash; Command Palette</b><span>, либо нажимаем&nbsp;</span><b>Ctrl+Shift+P</b><span>&nbsp;набираем&nbsp;</span><i>install</i><span>, жмем&nbsp;</span><i>Install Package Control</i><span>&nbsp;и ищем дополнение SCSS. Нажимаем на него, после установки мы можем переключить наше отображение на SCSS. Сейчас все выглядит симпатичнее, не так ли?</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d1053f08b2.jpg\" alt=\"\" /></p>\r\n<p><span>Настройка внешнего вида редактора важна, так как мы довольно длительное время проводим за написанием кода. Это влияет на нашу усталость, продуктивность, здоровье да и просто на настроение.</span><br /><br /><span>Следующее, что мы сделаем это установим ряд плагинов и дополнений. Их существует огромное количество, а я расскажу про основные, которые активно использую сам и которые в разы ускорят весь процесс верстки. Приступим!</span><br /><br /></p>\r\n<h2>Плагины</h2>\r\n<p></p>\r\n<h3>AutoFileName</h3>\r\n<p><br /><span>Дело в том, что в процессе верстки часто приходится подключать различные картинки. Этот плагин в разы облегчает процесс подключения. Установим его. Нажимаем&nbsp;</span><b>Ctrl+Shift+P</b><span>&nbsp;далее&nbsp;</span><i>Install Package Control</i><span>&nbsp;ищем&nbsp;</span><i>AutoFileName</i><span>&nbsp;устанавливаем. Попробуем подключить картинку сейчас. Сразу замечаем появление выпадающего меню со списком локальных файлов. Переходим в нужную папку с картинками и видим тут нужный нам файл, а также его размеры, что тоже пригодится.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d10719c478.jpg\" alt=\"\" /></p>\r\n<h3>BracketHighliter</h3>\r\n<p><br /><span>BracketHighliter можно перевести как подсветка кавычек. Установим его. Нажимаем&nbsp;</span><b>Ctrl+Shift+P</b><span>,&nbsp;</span><i>Install Package Control</i><span>&nbsp;ищем&nbsp;</span><b>BracketHighliter</b><span>. Устанавливаем. Тут даже открывается отдельный файл с сообщением об успешной установке. Теперь в нашем коде будет подсвечиваться начальный и конечный элемент, например открывающий и закрывающий тег, начальная и конечная ковычка, открывающая и закрывающая скобка. Это очень помогает с ориентацией в коде.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d1086ec660.jpg\" alt=\"\" /></p>\r\n<h3>ColorHighliter</h3>\r\n<p><br /><span>Обрати внимание на этот код &mdash; это код цвета, но какого именно непонятно.</span><br /><br /></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d109563d7c.jpg\" alt=\"\" /></p>\r\n<p><span>Давай установим плагин.&nbsp;</span><b>Ctrl+Shift+P</b><span>,&nbsp;</span><i>Install Package Control</i><span>&nbsp;ищем&nbsp;</span><b>ColorHighliter</b><span>. Опять открывается отдельный файл с сообщением об успешной установке. И сообщения о некой ошибке, игнорируем их. Смотрим на наш код с цветом, и теперь видим что за цвет скрывается за буквенноцифровым кодом. Сам плагин можно дополнительно настроить в меню&nbsp;</span><b>Tools &mdash; ColorHighliter</b><span>&nbsp;но сейчас не будем останавливаться на этом. Все и так стало намного лучше.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d10af51399.jpg\" alt=\"\" /></p>\r\n<h3>Великий и могучий Emmet</h3>\r\n<p><br /><span>Устанавливаем по наработанной схеме.&nbsp;</span><b>Ctrl+Shift+P</b><span>,&nbsp;</span><i>Install Package Control</i><span>&nbsp;ищем&nbsp;</span><b>Emmet</b><span>. Открывается отдельный файл с сообщением с просьбой перезагрузить программу для окончания установки. Закрываем и открываем Sublime. Получаем сообщение, что все установлено.</span><br /><br /></p>\r\n<h4>Итак, что же умеет Emmet?</h4>\r\n<p><br /><span>Перейдем в HTML файл и попробуем записать тег&nbsp;</span><i>div</i><span>&nbsp;с классом&nbsp;</span><i>.block</i><span>, для этого нам теперь достаточно&nbsp;</span><i>поставить точку</i><span>, написать \"</span><i>block</i><span>\" и нажать клавишу&nbsp;</span><b>Tab</b><span>. Мы получим:</span><br /><br /></p>\r\n<pre><code class=\"xml hljs\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"block\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\r\n</code></pre>\r\n<p><br /><span>Чтобы сделать более сложную запись, например в тег&nbsp;</span><i>div</i><span>&nbsp;с классом&nbsp;</span><i>.block</i><span>&nbsp;вставить тег&nbsp;</span><i>span</i><span>&nbsp;используем следующую запись:</span><br /><br /></p>\r\n<pre><code class=\"xml hljs\">.block&gt;span\r\n</code></pre>\r\n<p><br /><span>Жмем клавишу&nbsp;</span><b>Tab</b><span>&nbsp;и получаем:</span><br /><br /></p>\r\n<pre><code class=\"xml hljs\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"block\"</span>&gt;</span><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">span</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">span</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\r\n</code></pre>\r\n<p><br /><span>Крутяк, правда!?</span><br /><br /><span>Но и это еще не все, мы можем создавать свои сниппеты, то есть шаблоны/заготовки.</span><br /><span>Для этого перейдем&nbsp;</span><b>Preferences &ndash; Package Settings &ndash; Emmet &ndash; Settings User</b><span>. Здесь запишем следующее:</span><br /><br /></p>\r\n<pre><code class=\"json hljs\">{\r\n	<span class=\"hljs-attr\">\"snippets\"</span>:{\r\n		<span class=\"hljs-attr\">\"html\"</span>:{\r\n			<span class=\"hljs-attr\">\"snippets\"</span>:{\r\n				<span class=\"hljs-attr\">\"bl\"</span>:<span class=\"hljs-string\">\"</span></code></pre>\r\n<div class=\"\\&quot;block\\&quot;\"></div>\r\n<pre><code class=\"json hljs\"><span class=\"hljs-string\">\"</span>\r\n			}\r\n		}\r\n	}\r\n}\r\n</code></pre>\r\n<p><br /><span>Теперь для того чтобы вызвать запись:</span><br /><br /></p>\r\n<pre><code class=\"xml hljs\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"block\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\r\n</code></pre>\r\n<p><br /><span>нам достаточно написать&nbsp;</span><i>bl</i><span>&nbsp;и нажать клавишу&nbsp;</span><b>Tab</b><br /><br /><span>Из этого следует, что возможности&nbsp;</span><b>Emmet</b><span>&nbsp;безграничны, и мы можем настроить свои сниппеты как угодно и работать очень быстро. Подробную информацию о возможностях плагина можно найти на сайте&nbsp;</span><a href=\"https://emmet.io/\">https://emmet.io</a><br /><br /></p>\r\n<h3>GotoCSSDeclaration</h3>\r\n<p><br /><span>Плагин поможет нам с навигацией в коде. Устанавливаем ровно так же как и предыдущие плагины. Далее назначим горячие клавиши для работы с плагином для этого переходим&nbsp;</span><b>Preferences &ndash; Key Bindings</b><span>, и пишем следующий код</span><br /><br /></p>\r\n<pre><code class=\"json hljs\">{\r\n<span class=\"hljs-attr\">\"keys\"</span>: [<span class=\"hljs-string\">\"ctrl+1\"</span>], <span class=\"hljs-attr\">\"command\"</span>: <span class=\"hljs-string\">\"goto_css_declaration\"</span>,\r\n<span class=\"hljs-attr\">\"args\"</span>: {<span class=\"hljs-attr\">\"goto\"</span>: <span class=\"hljs-string\">\"next\"</span>}\r\n},\r\n</code></pre>\r\n<p><br /><span>Где [\"</span><b>ctrl+1</b><span>\"] это и есть нужное сочетание клавиш. Сохраняем&nbsp;</span><b>Cntr+S</b><span>.</span><br /><span>И вот как это работает. У нас должен быть открыт CSS и HTML файлы. CSS как правило очень большой и найти что-то быстро сложно, но это в прошлом. Например, нам нужно изменить CSS для класса&nbsp;</span><i>content-mainpage</i><span>&nbsp;кликаем на него мышкой и нажимаем&nbsp;</span><b>ctrl+1</b><span>. Вуаля, мы в нужном месте CSS файла.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d10c49678e.jpg\" alt=\"\" /></p>\r\n<h3>Tag</h3>\r\n<p><br /><span>Ну и для тех, кто дочитал до этого момента покажу еще один плагин, который установить не так просто, но он точно того стоит.</span><br /><br /><span>Зовут его Tag и установить нам придется его вручную. По&nbsp;</span><a href=\"http://fls.guru/files/Tag.zip\">этой ссылке</a><span>&nbsp;можно скачать архив с плагином. Далее распаковываем в особую папку программы. Для Windows 10 это C:\\Users\\[Подставь свое имя пользователя]\\AppData\\Roaming\\Sublime Text 3\\Packages. Далее закрываем Sublime и открываем снова и добавляем горячие клавиши открыв&nbsp;</span><b>Preferences &ndash; Key Bindings</b><span>&nbsp;и дописав следующее:</span><br /><br /></p>\r\n<pre><code class=\"json hljs\">{ <span class=\"hljs-attr\">\"keys\"</span>: [<span class=\"hljs-string\">\"ctrl+`\"</span>], <span class=\"hljs-attr\">\"command\"</span>: <span class=\"hljs-string\">\"tag_classes\"</span> }\r\n</code></pre>\r\n<p><br /><span>Где&nbsp;</span><b>ctrl+`</b><span>&nbsp;это и есть наше сочетание клавиш.</span><br /><br /><span>Итак, для чего же мы проделали весь этот нелегкий путь? Как правило, в процессе написания, кода мы работаем сначала с HTML потом переносим названия классов в CSS и работаем уже там. Так вот этот перенос делать вручную давольно долго. И тут нам на помощь приходит плагин&nbsp;</span><b>Tag</b><span>. Сейчас нам достаточно выделить нужный HTML код, нажать наше сочетание клавиш&nbsp;</span><b>ctrl+`</b></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d10d76d756.jpg\" alt=\"\" /></p>\r\n<p><span>и потом вставить результат копирования в наш CSS&nbsp;</span><b>ctrl+v</b><span>.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d10e9cc6f1.jpg\" alt=\"\" /></p>', 1, 'uploads/images/2022/10/image_750x500_635d114f7e9de.jpg', 'uploads/images/2022/10/image_750x_635d114f904a3.jpg', 'uploads/images/2022/10/image_600x460_635d114fa0c08.jpg', 'uploads/images/2022/10/image_380x226_635d114fafec0.jpg', 'uploads/images/2022/10/image_140x98_635d114fbcb49.jpg', 'jpg', 'local', '', 25, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, '2022-10-29 13:42:04', '2022-10-29 13:41:50');
INSERT INTO `posts` (`id`, `lang_id`, `title`, `title_slug`, `title_hash`, `keywords`, `summary`, `content`, `category_id`, `image_big`, `image_default`, `image_slider`, `image_mid`, `image_small`, `image_mime`, `image_storage`, `optional_url`, `pageviews`, `need_auth`, `is_slider`, `slider_order`, `is_featured`, `featured_order`, `is_recommended`, `is_breaking`, `is_scheduled`, `visibility`, `show_right_column`, `post_type`, `video_path`, `video_storage`, `image_url`, `video_url`, `video_embed_code`, `user_id`, `status`, `feed_id`, `post_url`, `show_post_url`, `image_description`, `show_item_numbers`, `updated_at`, `created_at`) VALUES
(946, 1, 'Как включить DNS через HTTPS и для чего это нужно', 'kak-vklyuchit-dns-cherez-https-i-dlya-chego-eto-nuzhno', NULL, '', 'Такие компании, как Microsoft, Google и Mozilla, продвигают DNS через HTTPS (DoH). Эта технология будет шифровать поисковые запросы DNS, улучшая конфиденциальность и безопасность в Интернете. Давайте познакомимся поближе с технологией DNS Over HTTPS, узнаем, для чего она нужна и как её включить. Вполне возможно, что вы уже пользуетесь DNS через HTTPS даже не зная этого!', '<h2>Что такое DNS через HTTPS (DoH)?</h2>\r\n<p>Интернет стремится, чтобы по умолчанию шифрование присутствовало везде. На данный момент большинство веб-сайтов, к которым вы обращаетесь, вероятно, используют шифрование HTTPS. Современные веб-браузеры, такие как Chrome, теперь помечают любые сайты, использующие стандартный HTTP, как &laquo;небезопасные&raquo;. HTTP/3, новая версия протокола HTTP, имеет встроенное шифрование.</p>\r\n<p>Это шифрование гарантирует, что никто не сможет вмешаться в работу веб-страницы, пока вы её просматриваете, или следить за тем, что вы делаете в Интернете. Например, если вы подключаетесь к Wikipedia.org, оператор сети &mdash; будь то общедоступная точка доступа Wi-Fi компании или ваш Интернет-провайдер &mdash; может видеть только то, что вы подключены к wikipedia.org. Они не видят, какую статью вы читаете, и не могут изменять статью Википедии пока она идёт до&nbsp;вашего компьютера.</p>\r\n<p>Но в стремлении к шифрованию DNS остался позади. Система доменных имён делает так, что мы можем подключаться к веб-сайтам через их доменные имена, а не с помощью числовых IP-адресов. Вы вводите доменное имя, например google.com, и ваша система свяжется с&nbsp;DNS-сервером, который указан в настройках системы, чтобы получить IP-адрес, связанный с google.com. Затем ваш компьютер или телефон подключится к этому IP-адресу.</p>\r\n<p>До сих пор эти запросы DNS не были зашифрованы. Когда вы подключаетесь к веб-сайту, ваша система отправляет запрос о том, что вы ищете IP-адрес, связанный с определённым доменом. Любой посредник передачи данных &mdash; возможно, ваш интернет-провайдер, но, возможно, также просто общедоступная точка доступа Wi-Fi, записывающая трафик, &mdash; могут регистрировать, к каким доменам вы подключаетесь. Из-за этого возможны атаки и сбор информации.</p>\r\n<p>DNS через HTTPS делает этот надзор невозможным. При использовании DNS через HTTPS ваша система установит безопасное зашифрованное соединение с вашим DNS-сервером и будет передавать запрос и ответ через это соединение. Все, кто находится между ними, не смогут увидеть, какие доменные имена вы ищете, или вмешаться в присланный ответ.</p>\r\n<p>Сегодня большинство людей используют DNS-серверы, предоставленные их интернет-провайдером. Однако существует множество сторонних DNS-серверов, таких как Google Public DNS, Cloudflare&nbsp;и OpenDNS. Эти сторонние поставщики одними из первых включили поддержку DNS через HTTPS на стороне сервера. Чтобы использовать DNS через HTTPS, вам потребуется как DNS-сервер, так и клиент (например, веб-браузер или операционная система), который его поддерживает.</p>\r\n<p><strong>DNSCrypt</strong><span>&nbsp;</span>&mdash; это сетевой протокол, который аутентифицирует и шифрует трафик системы доменных имён (DNS) между компьютером пользователя и рекурсивными серверами имён. Первоначально он был разработан Фрэнком Денисом и Йеченг Фу.</p>\r\n<p>Хотя существует несколько реализаций клиента и сервера, протокол никогда не предлагался Инженерной группе Интернета (IETF) в виде RFC.</p>\r\n<p>DNSCrypt обёртывает неизмененный DNS-трафик между клиентом и преобразователем DNS в криптографической конструкции для обнаружения подделки. Хотя он не обеспечивает сквозную безопасность, он защищает локальную сеть от атак типа &laquo;злоумышленник в середине&raquo;.</p>\r\n<p>Он также снижает опасность атак с усилением на основе UDP, требуя, чтобы вопрос был не меньше размера соответствующего ответа. Таким образом, DNSCrypt помогает предотвратить атаки с усилением DNS.</p>\r\n<p><strong>DNSCurve</strong><span>&nbsp;</span>&mdash; это предлагаемый безопасный протокол для системы доменных имён (DNS), разработанный Дэниелом Дж. Бернстайном.</p>\r\n<h2>Способы включения DNS через HTTPS (DoH)</h2>\r\n<p>Можно включить зашифрованные DNS запросы двумя способами &mdash; на уровне веб-браузеров и на уровне операционной системы. Каждый из этих способов имеет свои преимущества.</p>\r\n<p>Включение безопасного DNS на уровне веб-браузеров выполняется очень просто, достаточно поставить галочку в настройках. Более того, в Google Chrome эта настройка уже включена по умолчанию. Недостаток этого метода в том, что все другие приложения, использующие Интернет-подключение, не смогут использовать DNS через HTTPS. Такими приложениями могут быть программы для скачивания файлов, мессенджеры, службы обновления программ и операционной системы и так далее.</p>\r\n<p>Включение DoH на уровне системы делает так, что все программы будут делать DNS запросы исключительно по зашифрованному каналу. Но это требует установки программы &mdash; кэширующего DNS сервера. На самом деле, установка очень простая и программа будет потреблять минимум ресурсов. При этом собственный DNS будет кэшировать полученные данные благодаря чему немного увеличит скорость работы сети.</p>\r\n<p>Какой вариант выбрать &mdash; исключительно на ваше усмотрение. В этой инструкции будут рассмотрены оба способа и вы увидите, насколько всё просто при выборе любого метода шифрования DNS запросов.</p>\r\n<h2>Публичные сервера имён с поддержкой DNS через HTTPS</h2>\r\n<p>Чтобы использовать DNS через HTTPS сервер имён должен поддерживать эту технологию. В настоящее время публичные самые популярные DNS серверы её поддерживают. Их адреса для DoH или обычных DNS запросов одинаковые.</p>\r\n<table border=\"2\">\r\n<thead>\r\n<tr>\r\n<th role=\"columnheader button\" title=\"Упорядочить по возрастанию\" tabindex=\"0\">Провайдер</th>\r\n<th role=\"columnheader button\" title=\"Упорядочить по возрастанию\" tabindex=\"0\">IP-адреса</th>\r\n<th role=\"columnheader button\" title=\"Упорядочить по возрастанию\" tabindex=\"0\">Блокирование</th>\r\n<th role=\"columnheader button\" title=\"Упорядочить по возрастанию\" tabindex=\"0\">Особенности</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th>Cloudflare</th>\r\n<td>1.1.1.1<br />1.0.0.1<br />2606:4700:4700::1111<br />2606:4700:4700::1001</td>\r\n<td>нет</td>\r\n<td>Конечная точка DNS поверх HTTPS.</td>\r\n</tr>\r\n<tr>\r\n<th><strong>Google Public DNS</strong></th>\r\n<td>8.8.8.8<br />8.8.4.4<br />2001:4860:4860::8888<br />2001:4860:4860::8844</td>\r\n<td>нет</td>\r\n<td>Конечная точка DNS поверх HTTPS.</td>\r\n</tr>\r\n<tr>\r\n<th>CleanBrowsing</th>\r\n<td>185.228.168.168<br />185.228.169.168<br />2a0d:2a00:1::<br />2a0d:2a00:2::</td>\r\n<td>Взрослый контент.</td>\r\n<td>Конечная точка DNS поверх HTTPS.</td>\r\n</tr>\r\n<tr>\r\n<th>Adguard</th>\r\n<td>176.103.130.130<br />176.103.130.131<br />2a00:5a60::ad1:0ff<br />2a00:5a60::ad2:0ff</td>\r\n<td>Рекламный контент.</td>\r\n<td>Конечная точка DNS поверх HTTPS.</td>\r\n</tr>\r\n<tr>\r\n<th>Quad9</th>\r\n<td>9.9.9.9<br />149.112.112.112<br />2620:fe::fe<br />2620:fe::9</td>\r\n<td>Вредоносный контент.</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<th>OpenDNS</th>\r\n<td>208.67.222.222<br />208.67.220.220<br />2620:119:35::35<br />2620:119:53::53</td>\r\n<td>нет</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Независимо от того, включаете вы DoH в браузерах или для всей системы, вы можете использовать любой DNS сервер из этого списка. Лично я предпочитаю DNS сервера от Google.</p>\r\n<h2>Как включить DNS через HTTPS (DoH) в веб-браузерах</h2>\r\n<h3>Google Chrome</h3>\r\n<p>В Google Chrome в Windows уже включена опция DNS через HTTPS. Вы можете её проверить перейдя в<span>&nbsp;</span><strong>&laquo;Настройки&raquo; &rarr; &laquo;Конфиденциальность и безопасность&raquo; &rarr; &laquo;Безопасность&raquo; &rarr; &laquo;Дополнительные&raquo; &rarr; &laquo;Использовать безопасный DNS сервер&raquo;</strong>. Чтобы быстро найти эту настройку, введите в адресную строку &laquo;<strong>chrome://settings/security/</strong>&raquo; и пролистните в самый низ.</p>\r\n<h2>Как соотносятся DNS поверх HTTPS, DNSSEC, DNSCrypt, DNS поверх TLS</h2>\r\n<p>Имеется несколько протоколов, обеспечивающих шифрование DNS запросов. В настоящее время на клиентском программном обеспечении лучше всего поддерживается DNS поверх HTTPS (DoH) &mdash; именно ему и посвящена данная статья. Чтобы ориентироваться в терминах, рассмотрим краткие характеристики каждого из протоколов.</p>\r\n<p><strong>DNS поверх HTTPS (DoH)</strong><span>&nbsp;</span>&mdash; протокол для выполнения разрешения DNS по протоколу HTTPS. Целью этого метода является повышение конфиденциальности и безопасности пользователей путём предотвращения перехвата и манипулирования данными DNS с помощью атак типа &laquo;Атака посредника&raquo;.</p>\r\n<p><strong>DNS поверх TLS (DoT)</strong><span>&nbsp;</span>&mdash; предлагаемый стандартный протокол для выполнения разрешения удалённой системы DNS с использованием TLS. Целью этого метода является повышение конфиденциальности и безопасности пользователей путём предотвращения перехвата и манипулирования данными DNS с помощью атак типа &laquo;Атака посредника&raquo;.</p>\r\n<p><strong>DNSSEC</strong><span>&nbsp;</span>(англ. Domain Name System Security Extensions) &mdash; набор расширений IETF протокола DNS, позволяющих минимизировать атаки, связанные с подменой DNS-адреса при разрешении доменных имён. Он направлен на предоставление DNS-клиентам (англ. термин resolver) аутентичных ответов на DNS-запросы (или аутентичную информацию о факте отсутствия данных) и обеспечение их целостности. При этом используется криптография с открытым ключом.</p>\r\n<div class=\"576fa40ea81d72e15bb77373cb701737\" data-index=\"5\">\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d12c20f3a9.jpg\" alt=\"\" /></p>\r\n<p>Вы можете выбрать из списка любой DNS сервер с поддержкой DoH или указать свой собственный.</p>\r\n<div class=\"576fa40ea81d72e15bb77373cb701737\" data-index=\"6\">\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d12ed42478.jpg\" alt=\"\" /></p>\r\n<p>На момент написания, в Google Chrome в Linux данная опция недоступна.</p>\r\n<h3>Firefox</h3>\r\n<p>Перейдите в<span>&nbsp;</span><strong>Настройки &rarr; Основные</strong>. Пролистните в самый низ, чтобы найти кнопку &laquo;<strong>Параметры сети, Настроить</strong>&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d130438a33.jpg\" alt=\"\" /></p>\r\n<p>Поставьте галочку &laquo;<strong>Включить DNS через HTTPS</strong>&raquo; и выберите провайдера из списка или введите свой IP адрес:</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d1314a6b7f.jpg\" alt=\"\" /></p>\r\n<h3>Opera</h3>\r\n<p>Перейдите в настройки (шестерёнка внизу левого сайдбара или кнопка<span>&nbsp;</span><strong>&laquo;Простые настройки&raquo; &rarr; &laquo;Открыть все настройки браузера&raquo;</strong>).</p>\r\n<p>Затем перейдите в<span>&nbsp;</span><strong>&laquo;Дополнительно&raquo; &rarr;&nbsp;&laquo;Система&raquo;</strong>.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d13263b6a5.jpg\" alt=\"\" /></p>\r\n<p>Включите галочку &laquo;<strong>Использовать DNS поверх HTTPS вместо системных настроек DNS</strong>&raquo; и выберите желаемый DNS сервер.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d1335258a5.jpg\" alt=\"\" /></p>\r\n<h3>Microsoft Edge</h3>\r\n<p>На момент написания предустановленный по умолчанию Internet Explorer (Microsoft Edge) вовсе не знает про DNS через HTTPS.&nbsp;Если скачать последнюю версию Microsoft Edge, то там эту настройку можно включить с помощью флага.</p>\r\n<p>Введите в адресную строку<span>&nbsp;</span><strong>edge://flags#dns-over-https</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d1344c1f31.jpg\" alt=\"\" /></p>\r\n<p>Включите экспериментальный флаг и перезапустите веб-браузер.</p>\r\n<p>Эммм&hellip; вроде как нужно бы ещё ввести настройки DNS сервера, но я не нашёл, где это сделать в Microsoft Edge. Да и кому дело до Microsoft Edge &mdash; кто им вообще пользуется?!</p>\r\n<h2>Как включить DNS через HTTPS (DoH) для всех приложений</h2>\r\n<h3>Программы для DNS через HTTPS (DoH)</h3>\r\n<h3>dnscrypt-proxy</h3>\r\n<p><a href=\"https://kali.tools/?p=5964\" rel=\"noopener noreferrer\" target=\"_blank\">dnscrypt-proxy</a><span>&nbsp;</span>&mdash; это гибкий DNS-прокси с поддержкой современных зашифрованных DNS-протоколов, таких как DNSCrypt v2, DNS-over-HTTPS и Anonymized DNSCrypt.</p>\r\n<p>У программы открыт исходный код, также программа доступна в виде предварительно скомпилированных двоичных файлов для большинства операционных систем и архитектур.</p>\r\n<p>Характеристики:</p>\r\n<ul>\r\n<li>Шифрование и аутентификация DNS-трафика. Поддерживает DNS-over-HTTPS (DoH) с использованием TLS 1.3, DNSCrypt и анонимного DNS</li>\r\n<li>IP-адреса клиентов могут быть скрыты с помощью Tor, SOCKS-прокси или анонимных DNS-ретрансляторов</li>\r\n<li>Мониторинг DNS-запросов с отдельными файлами журналов для обычных и подозрительных запросов</li>\r\n<li>Фильтрация: блокируйте рекламу, вредоносное ПО и другой нежелательный контент. Совместим со всеми службами DNS</li>\r\n<li>Фильтрация по времени с гибким недельным расписанием</li>\r\n<li>Прозрачное перенаправление определённых доменов на определённые резолверы</li>\r\n<li>Кэширование DNS для уменьшения задержки и повышения конфиденциальности</li>\r\n<li>Локальная блокировка IPv6 для уменьшения задержки в сетях только с IPv4</li>\r\n<li>Балансировка нагрузки: выберите набор резолверов, dnscrypt-proxy будет автоматически измерять и отслеживать их скорость, а также балансировать трафик между самыми быстрыми из доступных.</li>\r\n<li>Маскировка: как файл HOSTS на стероидах, который может возвращать предварительно настроенные адреса для определённых имён или разрешать и возвращать IP-адреса других имён. Это можно использовать для локальной разработки, а также для обеспечения безопасных результатов поиска в Google, Yahoo, DuckDuckGo и Bing.</li>\r\n<li>Автоматическое обновление списков резолверов в фоновом режиме</li>\r\n<li>Может заставить исходящие соединения использовать TCP</li>\r\n<li>Совместим с DNSSEC</li>\r\n<li>Включает локальный сервер DoH для поддержки ECHO (ESNI)</li>\r\n</ul>\r\n<h3><a id=\"612\" name=\"612\"></a>DNS-over-HTTPS</h3>\r\n<p><a href=\"https://github.com/m13253/dns-over-https\" rel=\"noopener noreferrer\" target=\"_blank\">DNS-over-HTTPS</a><span>&nbsp;</span>&mdash; это клиентское и серверное программное обеспечение для запроса DNS через HTTPS, используя протоколы Google DNS-over-HTTPS и IETF DNS-over-HTTPS (RFC 8484).</p>\r\n<h3>Как включить DNS через HTTPS (DoH) на уровне операционной системы в Windows</h3>\r\n<h4>Как включить DNS через HTTPS (DoH) на уровне операционной системы в Windows (в настройках ОС)</h4>\r\n<p>Данный метод удобен тем, что не нужно устанавливать дополнительное программное обеспечение. Но недостатком данного метода является то, что в качестве DNS сервера вы можете использовать только тот, который предусмотрен ОС Windows &mdash; всего около 5 провайдеров.&nbsp;Ещё одно ограничение в том, что данный метод работает только начиная с Windows 11.</p>\r\n<p><strong><u>Сначала выберите, какой&nbsp;DNS с поддержкой DoH вы хотите использовать</u></strong></p>\r\n<p>Начиная с выпуска Windows 11, DNS через HTTPS в Windows 11 работает только с определенным жёстко запрограммированным списком бесплатных служб DNS (вы можете увидеть список самостоятельно, запустив</p>\r\n<div>\r\n<div id=\"highlighter_435775\" class=\"syntaxhighlighter  bash\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"bash plain\">netsh dns show encryption</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p>в<span>&nbsp;</span>окне терминала).</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d13808ef2b.jpg\" alt=\"\" /></p>\r\n<p>Вот текущий список поддерживаемых адресов серверов DNS IPv4 по состоянию на октябрь 2022 года:</p>\r\n<ul>\r\n<li>Основной DNS Google:<span>&nbsp;</span><strong>8.8.8.8</strong></li>\r\n<li>Дополнительный Google DNS:<span>&nbsp;</span><strong>8.8.4.4</strong></li>\r\n<li>Основной DNS Cloudflare:<span>&nbsp;</span><strong>1.1.1.1</strong></li>\r\n<li>Вторичный DNS Cloudflare:<strong><span>&nbsp;</span>1.0.0.1</strong></li>\r\n<li>Первичный DNS Quad9:<span>&nbsp;</span><strong>9.9.9.9</strong></li>\r\n<li>Вторичный DNS Quad9:<span>&nbsp;</span><strong>149.112.112.112</strong></li>\r\n</ul>\r\n<p>Для IPv6 список поддерживаемых адресов серверов DNS:</p>\r\n<ul>\r\n<li>Основной DNS Google:<span>&nbsp;</span><strong>2001:4860:4860::8888</strong></li>\r\n<li>Вторичный DNS Google:<span>&nbsp;</span><strong>2001:4860:4860::8844</strong></li>\r\n<li>Основной DNS-сервер Cloudflare:<span>&nbsp;</span><strong>2606:4700:4700::1111</strong></li>\r\n<li>Дополнительный DNS Cloudflare:<span>&nbsp;</span><strong>2606:4700:4700::1001</strong></li>\r\n<li>Первичный DNS Quad9:<span>&nbsp;</span><strong>2620:fe::fe</strong></li>\r\n<li>Вторичный DNS Quad9:<span>&nbsp;</span><strong>2620:fe::fe:9</strong></li>\r\n</ul>\r\n<p>Когда придёт время включить DoH в разделе ниже, вам нужно будет выбрать две пары этих DNS-серверов &mdash; первичный и вторичный для IPv4 и IPv6 &mdash; для использования с ПК с Windows 11. В качестве бонуса их использование, скорее всего, ускорит работу в Интернете.</p>\r\n<p><strong><u>Затем включите DNS через HTTPS в Windows 11</u></strong></p>\r\n<p>Чтобы начать настройку DNS через HTTPS, откройте приложение &laquo;Настройки&raquo;, нажав Win+i на клавиатуре. Либо можно нажать правой кнопкой мыши кнопку &laquo;Пуск&raquo; и в появившемся специальном меню выбрать пункт &laquo;Параметры&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d139e87528.jpg\" alt=\"\" /></p>\r\n<p>В настройках нажмите &laquo;<strong>Сеть и Интернет</strong>&raquo; на боковой панели.</p>\r\n<p>Для &laquo;Wi-Fi&raquo; и &laquo;Ethernet&raquo; процедура настройки DNS поверх HTTPS чуть различается.</p>\r\n<p><u>Настройка DNS поверх HTTPS для Ethernet (проводное подключение)</u></p>\r\n<p>В настройках сети и Интернета щёлкните имя вашего основного подключения к Интернету в списке, например &laquo;<strong>Ethernet</strong>&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d13b825b55.jpg\" alt=\"\" /></p>\r\n<p>На странице свойств Ethernet найдите параметр &laquo;Назначение DNS-сервера&raquo; и нажмите кнопку &laquo;<strong>Изменить</strong>&raquo; рядом с ним.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d13e0272af.jpg\" alt=\"\" /></p>\r\n<p>В появившемся окне в раскрывающемся меню выберите &laquo;<strong>Вручную</strong>&raquo; настройки DNS.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d13f6a8727.jpg\" alt=\"\" /></p>\r\n<p>Затем переведите переключатель &laquo;IPv4&raquo; в положение &laquo;<strong>Вкл.</strong>&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d140b0b6f8.jpg\" alt=\"\" /></p>\r\n<p>В разделе IPv4 введите адрес основного DNS-сервера, который вы выбрали в разделе выше, в поле &laquo;Предпочтительный DNS&raquo; (например, &laquo;<strong>8.8.8.8</strong>&raquo;).</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d141ad52eb.jpg\" alt=\"\" /></p>\r\n<p>Станет активным выпадающий список &laquo;Предпочтительное шифрование DNS&raquo;. В этом списке выберите &laquo;<strong>Только зашифрованные (DNS поверх HTTPS)</strong>&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d142c575d3.jpg\" alt=\"\" /></p>\r\n<p>Аналогичным образом введите адрес вторичного DNS-сервера в поле &laquo;Дополнительный DNS&raquo; (например, &laquo;<strong>8.8.4.4</strong>&raquo;).&nbsp;Станет активным выпадающий список &laquo;Предпочтительное шифрование DNS&raquo;. В этом списке выберите &laquo;<strong>Только зашифрованные (DNS поверх HTTPS)</strong>&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d144a3d780.jpg\" alt=\"\" /></p>\r\n<p>Если ваш Интернет-провайдер поддерживает IPv6, то повторите этот процесс с IPv6. Если ваш Интернет-провайдер НЕ поддерживает IPv6, то вам НЕ НУЖНО включать IPv6 DNS серверы. Если вы не уверены, то лучше не включайте IPv6 DNS.&nbsp;</p>\r\n<p>Переведите переключатель IPv6 в положение &laquo;Вкл.&raquo;, а затем скопируйте основной IPv6-адрес из раздела выше и вставьте его в поле &laquo;Предпочитаемый DNS&raquo;. Затем скопируйте соответствующий вторичный IPv6-адрес и вставьте его в поле &laquo;Дополнительный DNS&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d146cc64a3.jpg\" alt=\"\" /></p>\r\n<p>После этого установите для обоих параметров &laquo;Шифрование DNS&raquo; значение &laquo;<strong>Только зашифрованные (DNS поверх HTTPS)</strong>&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d147c1fff5.jpg\" alt=\"\" /></p>\r\n<p>Наконец, нажмите &laquo;<strong>Сохранить</strong>&raquo;.</p>\r\n<p>Вернувшись на страницу свойств оборудования Ethernet, вы увидите список своих DNS-серверов с пометкой &laquo;(Зашифровано)&raquo; рядом с каждым из них.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d148e6607e.jpg\" alt=\"\" /></p>\r\n<p><u>Настройка DNS поверх HTTPS для Wi-Fi (беспроводное подключение)</u></p>\r\n<p>В настройках<span>&nbsp;</span><strong>Сети и Интернета</strong><span>&nbsp;</span>щёлкните имя вашего основного подключения к Интернету в списке, например &laquo;<strong>Wi-Fi</strong>&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d14bf2a9a4.jpg\" alt=\"\" /></p>\r\n<p>На странице свойств Wi-Fi перейдите в раздел &laquo;<strong>Свойства оборудования</strong>&raquo;.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d14d19914d.jpg\" alt=\"\" /></p>\r\n<p>На следующем окне найдите параметр &laquo;Назначение DNS-сервера&raquo; и нажмите кнопку &laquo;<strong>Изменить</strong>&raquo; рядом с ним.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d14e5ab660.jpg\" alt=\"\" /></p>\r\n<p>В появившемся окне в раскрывающемся меню выберите &laquo;<strong>Вручную</strong>&raquo; настройки DNS. Затем переведите переключатель &laquo;IPv4&raquo; в положение &laquo;<strong>Вкл.</strong>&raquo;.</p>\r\n<p>В разделе IPv4 введите адрес основного DNS-сервера, который вы выбрали в разделе выше, в поле &laquo;Предпочтительный DNS&raquo; (например, &laquo;<strong>8.8.8.8</strong>&raquo;).</p>\r\n<p>Станет активным выпадающий список &laquo;Предпочтительное шифрование DNS&raquo;. В этом списке выберите &laquo;<strong>Только зашифрованные (DNS поверх HTTPS)</strong>&raquo;.</p>\r\n<p></p>\r\n<p><strong>Подсказка</strong>: Если вы не видите параметры шифрования DNS, значит, вы редактируете настройки DNS для конкретного подключения Wi-Fi, а не для беспроводного адаптера в целом. Убедитесь, что вы выбрали тип подключения в &laquo;Настройки&raquo; &rarr; &laquo;Сеть и Интернет&raquo;, затем сначала нажмите &laquo;Свойства оборудования&raquo;.</p>\r\n<div class=\"576fa40ea81d72e15bb77373cb701737\" data-index=\"9\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-7219829351026140\" data-ad-slot=\"7663666599\" data-ad-format=\"link\" data-adsbygoogle-status=\"done\" data-ad-status=\"unfilled\">\r\n<div id=\"aswift_6_host\" title=\"Advertisement\" aria-label=\"Advertisement\" tabindex=\"0\"></div>\r\n<div title=\"Advertisement\" aria-label=\"Advertisement\" tabindex=\"0\">\r\n<p>Аналогичным образом введите адрес вторичного DNS-сервера в поле &laquo;Дополнительный DNS&raquo; (например, &laquo;<strong>8.8.4.4</strong>&raquo;).</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d159022055.jpg\" alt=\"\" /></p>\r\n<p>Если ваш Интернет-провайдер поддерживает IPv6, то повторите этот процесс с IPv6. Если ваш Интернет-провайдер НЕ поддерживает IPv6, то вам НЕ НУЖНО включать IPv6 DNS серверы. Если вы не уверены, то лучше не включайте IPv6 DNS.</p>\r\n<p>Переведите переключатель IPv6 в положение &laquo;<strong>Вкл.</strong>&raquo;, а затем скопируйте основной IPv6-адрес из раздела выше и вставьте его в поле &laquo;<strong>Предпочитаемый DNS</strong>&raquo;. Затем скопируйте соответствующий вторичный IPv6-адрес и вставьте его в поле &laquo;<strong>Дополнительный DNS</strong>&raquo;.</p>\r\n<p>После этого установите для обоих параметров &laquo;Шифрование DNS&raquo; значение &laquo;<strong>Только шифрование (DNS через HTTPS)</strong>&raquo;.</p>\r\n<p>Наконец, нажмите &laquo;<strong>Сохранить</strong>&raquo;.</p>\r\n<p>Вернувшись на страницу свойств оборудования Wi-Fi, вы увидите список своих DNS-серверов с пометкой &laquo;(Зашифровано)&raquo; рядом с каждым из них.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d15a2cc54f.jpg\" alt=\"\" /></p>\r\n</div>\r\n</ins></div>\r\n<p>Это всё, что вам нужно сделать. Закройте приложение &laquo;Настройки&raquo;, и вы готовы к работе. Отныне все ваши DNS-запросы будут конфиденциальными и безопасными.</p>\r\n<p><strong>Примечание</strong>. Если после изменения этих настроек у вас возникли проблемы с сетью, убедитесь, что вы правильно ввели IP-адреса. Ошибочный IP-адрес может привести к недоступности DNS-серверов. Если адреса введены правильно, попробуйте<span>&nbsp;</span><strong>отключить</strong><span>&nbsp;</span>переключатель &laquo;<strong>IPv6</strong>&raquo; в списке DNS-серверов. Если вы настраиваете DNS-серверы IPv6 на компьютере без подключения к IPv6, это может вызвать проблемы с подключением.</p>\r\n</div>\r\n</div>', 40, 'uploads/images/2022/10/image_750x500_635d15ebd814e.jpg', 'uploads/images/2022/10/image_750x_635d15ebe226f.jpg', 'uploads/images/2022/10/image_600x460_635d15ebebfab.jpg', 'uploads/images/2022/10/image_380x226_635d15ec0019b.jpg', 'uploads/images/2022/10/image_140x98_635d15ec05aab.jpg', 'jpg', 'local', '', 21, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-29 14:00:48'),
(947, 1, 'IT для неайтишников: Куда исчезают программисты после 40 лет?', 'it-dlya-neaytishnikov-kuda-ischezayut-programmisti-posle-40-let', NULL, 'itfox, habr, community, programming community, turkmenportal', 'Это сложная тема, которая периодически всплывает в среде IT-специалистов, об этом сказано уже немало, а вот для «неайтишников» многое может оказаться новостью. Как для тех, кто хочет «войти в IT», так и для тех, кто по роду своей деятельности вынужден работать вместе с IT-службами. Некоторые вещи будут очевидны для IT-специалистов, но не очевидными для других. Иногда из-за их непонимания люди допускают болезненные ошибки. Не только и не столько со своей карьерой, сколько в своём бизнесе делают ставку не на тех людей. Поэтому, давайте разберём этот вопрос без эмоций и на понятном для неспециалистов языке.', '<p><span>Неверно было бы полагать, что дело в &laquo;молодости&raquo; области информационных технологий. Это не правда. Знаете, первое поколение программистов уже давно умерло от старости. Многие профессиональные программисты уже вышли на пенсию.</span></p>\r\n<blockquote>\r\n<p><em>Владимир Орлов - это тот человек, который учился у первых программистов, а сейчас он пишет статьи о своём более чем пятидесятилетием опыте в отрасли. Разве можно называть такую область &laquo;молодой&raquo;?</em></p>\r\n</blockquote>\r\n<p>Широко известная книга Фредерика Брукса &laquo;Мифический человеко-месяц, или Как создаются программные системы&raquo; издана в 1975 году и содержит ранее опубликованные журнальные статьи автора. Брукс родился в 1931 году, он ещё жив, сейчас ему 91 год.</p>\r\n<p>Неверно было бы сказать, что область информационных технологий стала популярной лишь недавно.<span>&nbsp;</span><a href=\"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D0%B7%D1%8B%D1%80%D1%8C_%D0%B4%D0%BE%D1%82%D0%BA%D0%BE%D0%BC%D0%BE%D0%B2\" rel=\"noopener noreferrer nofollow\"><u>10 марта 2000 года лопнул пузырь доткомов</u></a>, в результате чего по мировой экономике был нанесен мощный удар. Еще в 90-е года XX-века рынок информационных технологий был перегретым.</p>\r\n<p>Неправдой является и то, что это просто российский рынок является молодым. Нет, у нас все так же, как и у других. 6 декабря 2016 года Don Denoncourt написал статью<span>&nbsp;</span><a href=\"https://corgibytes.com/blog/2016/12/06/getting-old-er-in-tech/\" rel=\"noopener noreferrer nofollow\"><u>On Getting Old(er) in Tech</u></a>. 18 мая 2021 года Anupam Chugh написал статью<span>&nbsp;</span><a href=\"https://abrarmasum.medium.com/when-do-programmers-retire-is-35-the-end-72d173760ee2\" rel=\"noopener noreferrer nofollow\"><u>When Do Programmers Retire? Is 35 the End?</u></a><span>&nbsp;</span></p>\r\n<p>Тезис о том, что все дорастают до руководящих должностей, не выдерживает никакой критики. Дело даже не в том, что управление людьми вещь непростая, так ещё руководящих должностей на всех не хватит.</p>\r\n<blockquote>\r\n<p><em>Так в чем же дело? Неужели действительно в возрасте? Нет, не в нём. Все дело в профессиональном выгорании. Программистом можно стать (&laquo;войти в IT&raquo;) и после 40 лет, вопрос лишь в том, сколько лет вы сможете продержаться.</em></p>\r\n</blockquote>\r\n<p>Что же происходит и в чем дело?</p>\r\n<h2>Нужно постоянно учиться</h2>\r\n<p>В области информационных технологий, как в сказке про Алису в стране чудес, нужно очень быстро бежать, чтобы оставаться на месте. А если хочешь куда-то попасть, то надо бежать ещё быстрее. Вообще IT - это злая, жестокая и выматывающая сказка.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d18cd7c292.jpg\" alt=\"\" /></p>\r\n<blockquote>\r\n<p><em>Работа в области информационных технологий - это не спринтерский забег, это марафонская дистанция. Нельзя просто взять и ворваться в IT. Лет через 5-10 ваши навыки и достижения обесценятся. Бежать придётся не только быстро, но и долго.</em></p>\r\n</blockquote>\r\n<p>В IT вообще всё быстро меняется, появляются новые технологии, уходят старые технологии. Сегодня востребовано одно, завтра другое. Честно говоря, профессиональный программист может изучить новый для себя язык (близкий по стеку) за 2-4 недели. То есть через месяц человек выйдет на производительность среднего разработчика, но уже на новом языке.</p>\r\n<p>На примере нашей компании. Как-то мы решили, что наши бэкенд разработчики (разработчики серверной части web-приложений) должны владеть PHP и Python одновременно. На освоение нового языка мы им давали как раз 2 недели.</p>\r\n<p>Наши фронтенд разработчики (разработчики клиентской части web-приложений) все умеют разрабатывать на Flutter. То есть они умеют писать кроссплатформенные мобильные приложения (сразу под Android и под iOs). Flutter - хорошая технология, теперь у нас в компании нет разработчиков мобильных приложений на нативных языках (Java, Kotlin, Object-C, Swift), они проиграли конкуренцию по скорости и стоимости разработки.</p>\r\n<p>Конечно, это не значит, что нативной разработки завтра вообще не станет. Иногда, но далеко не каждый день, нужно писать сложные приложения, где без нативных средств совсем никак, но такие задачи встречаются нечасто. Мобильное приложение обычной сложности можно написать и на Flutter. А простое - вообще без услуг программиста. В какой-то момент окажутся востребованы только самые сильные разработчики мобильных приложений на нативных языках, остальным придётся куда-то уйти.</p>\r\n<p>Скажем честно, постоянно делать инвестиции в самообучение выходит не у каждого. Легко учиться, когда тебе 16-20 лет, затем учиться все тяжелее и тяжелее. В какой-то момент начинаешь замечать, как люди разделяются на тех, кто может постоянно переучиваться, и тех, кто начинает сдавать, не выдерживая темп.</p>\r\n<p>У бегунов на марафонскую дистанцию есть понятие &laquo;марафонская стена&raquo;, это эффект, который происходит где-то на 25-30 километрах. В этот момент у организма исчезает вся энергия и многие люди останавливаются, не в силах преодолеть эту &laquo;стену&raquo;. Эффект во многом психологический, физиологически же организм просто переходит с расщепления гликогена на расщепление жиров.</p>\r\n<p>Вот в IT есть свой аналог &laquo;марафонской стены&raquo;, когда человек её достигает, у него погасают глаза. Эффект тоже лишь психологический, дело не в &laquo;старости мозга&raquo;. Посмотрите на учёных, мозг у них прекрасно работает до 60-90 лет, пока в целом организм не начнёт отказывать.</p>\r\n<p>В качестве лирического отступления о психологии профессиональных IT-специалистов. Мы, как-то с моим коллегой по старой работе, решили поучаствовать в туристической прогулке на 100 км за 24 часа. Мероприятие не очень сложное, нести с собой нужно было только воду и репеллент (шли по лесу вокруг города), каждые 25 км был привал, где нас кормили и можно было сойти с дистанции. Выходишь в субботу утром, приходишь в воскресенье утром.</p>\r\n<p>Пошли мы без подготовки, как и многие другие. В целом, дистанция посильная для любого физически здорового человека. Только нужно психологически преодолеть себя. На 50-м километре у моего коллеги от ходьбы начало сильно болеть колено, поэтому следующие 50 километров он проделал лёгким бегом с той же скоростью, с какой я шёл. В прогулке с нами участвовал клуб альпинистов, в какой-то момент ребята начали употреблять обезболивающие. Последний их них потерялся где-то после 75-го километра. Я сам неверно подобрал обувь, пошёл без пластыря, стёр одну ногу в кровь, больно, конечно, было. Вопрос об остановиться мы как-то даже не рассматривали.</p>\r\n<p>До финиша дошли лишь представители туристического клуба-организатора и мы вдвоём с коллегой. В понедельник я встал (достижение) и поехал (ещё большее достижение) на работу. Коллега отработал понедельник в удалённом режиме, встать не получилось.</p>\r\n<blockquote>\r\n<p><em>Хотите в IT? Пробегите марафон. Именно такая психология у профессиональных &laquo;программистов&raquo;, понадобится.</em></p>\r\n</blockquote>\r\n<p>По правде говоря, область информационных технологий в этом не уникальна. Хорошие врачи тоже учатся целую жизнь, учёные - тоже. Я все ещё веду научную работу (численное моделирование сопряженного свободноконвективного теплообмена), поэтому могу сказать, что в научной среде тебя всегда окружают старые люди, а в IT - молодые. Барьер один и тот же, просто в IT есть постоянный приток новых людей, а в науку - нет.</p>\r\n<h2>Много случайных людей</h2>\r\n<p>Скажем прямо, у IT-специалистов хорошие доходы, это привлекает в отрасль множество людей. А их всё равно не хватает. Тут бы в пору заподозрить неладное и подумать почему так, но этим обычно мало кто себя обременяет.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d18f992cfb.jpg\" alt=\"\" /></p>\r\n<p>Раньше это был поток в основном молодых людей, сейчас молодые закончились (кроме шуток, 90-е года XX века дают о себе знать), перешли на более старшие возрастные категории. Поэтому стали появляться истории про людей, которые &laquo;вошли в айти&raquo; после 40 либо даже 50 лет. Это возможно, но войти мало, нужно ещё и задержаться.</p>\r\n<p>Когда я ещё учился в университете, на нем была программа &laquo;Программист за 1 год&raquo;. Ежегодно профессиональную переподготовку проходило множество людей, которым рассказывали азы программирования. Но рынок ими почему-то не насыщался. Люди приходили на рынок, а потом куда-то исчезали с него.</p>\r\n<p>Сейчас ситуация усугубилась. Появилось множество онлайн-школ, которые обещают, что через 6-9 месяцев обучения человек будет востребован в IT, после чего будет получать 100-200 тысяч рублей оклада в месяц. Их даже учат правильно составлять резюме и проходить собеседования.</p>\r\n<p>Как-то мне наши рекрутеры сказали, что просмотрели где-то 600 (!!) откликов на вакансию, провели несколько первичных собеседований, но до второго этапа никто не дошёл. Причина - выпускники онлайн школ.</p>\r\n<p>Да, у нас несколько строже отбор, чем в крупные компании. Но сейчас 2022 год, год перемен, в который крупные компании &laquo;режут косты&raquo;, то есть сокращают бюджеты на IT, причём резко и заметно.</p>\r\n<p>Честно говоря, в отрасли давно знают непрофильные специальности, которые легко конвертируются в IT-специалистов. Это математики, физики, радиотехники и несколько иных направлений. В основном инженерные и естественнонаучные дисциплины, где у людей развивают системное мышление. Дефициту IT-специалистов же не один десяток лет, многие варианты уже перебрали.</p>\r\n<p>Это новую технологию можно изучить за 1-6 месяцев, а вот системному мышлению приходится учиться 5-6 лет в университете. Быстрее не получается.</p>\r\n<p>И тут надо было бы спросить, а зачем отрасли столько &laquo;случайных&raquo; людей? Все просто, для выполнения несложных работ и участия в стартапах за небольшие (сравнительно) деньги. Пока у человека ещё горят глаза и не закончился энтузиазм. Помним, что спринтерскую дистанцию каждый пробежит с первого раза, а десяток километров - нет.</p>\r\n<blockquote>\r\n<p><em>Есть ещё одна причина - эмоциональное выгорание, но об этом после.</em></p>\r\n</blockquote>\r\n<p>Область информационных технологий жестока, если нового человека хватит на 5-10 лет рядовой работы, то почему бы нет? Кстати, именно с такой частотой в IT происходят кризисы, которые подчищают рынок. Чуть более подробно этот вопрос рассмотрен в статье &laquo;<a href=\"https://vc.ru/life/477354-samoregulyaciya-v-it-minimalno-dopustimaya-effektivnost-raboty\" rel=\"noopener noreferrer nofollow\"><u>Саморегуляция в ИТ: минимально допустимая эффективность работы</u></a>&raquo; (на Habr её ещё не публиковал).</p>\r\n<h2>Автоматизация</h2>\r\n<p>Знаете, очень интересная вещь. Программисты многое делают, чтобы автоматизировать свой труд, то есть чтобы было нужно как можно меньше программистов.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d1917dd041.jpg\" alt=\"\" /></p>\r\n<p>Хорошим примером является реализация информационных сайтов. Раньше для этого нужен был программист, а то и коллектив программистов. Нужно было вручную сделать вёрстку сайта, реализовать северную часть, присоединить первое ко второму.</p>\r\n<p>Потом появились MVC-фреймворки, которые давали каркасы web-приложений. Для реализации сайта стало хватать одного &laquo;full-stack&raquo; разработчика. То есть один человек делал северную и клиентскую часть.</p>\r\n<p>Затем пришли CMS (сontent management system - система управления содержимым). Для того чтобы создать сайт не нужно было заниматься программированием, хватало - конфигурирования.</p>\r\n<p>А под конец пришли сервисы типа<span>&nbsp;</span><a href=\"https://tilda.cc/ru/\" rel=\"noopener noreferrer nofollow\"><u>Тильды</u></a>. Это конструкторы сайтов, которым могут пользоваться непрограммисты. Например, UI/UX специалисты уже могут создавать там новые шаблонные блоки, не прибегая к помощи разработчиков. А простой сайт может сконструировать из готовых блоков любой человек.</p>\r\n<blockquote>\r\n<p><em>Куда делись те люди, которые ещё недавно разрабатывали сайты за 5 тысяч рублей на потоке? Правильно - были вынуждены искать новую работу.</em></p>\r\n</blockquote>\r\n<p>Во многом аналогичное сейчас происходит с интернет-магазинами. Это несложная шаблонная работа, которую можно автоматизировать.</p>\r\n<p>Кроме того, сейчас начали набирать популярность сервисы NoCode и LowCode, которые позволяют создавать несложные мобильные приложения в визуальном редакторе. Чуть поподробнее в &laquo;<a href=\"https://vc.ru/dev/423927-no-code-i-low-code-vzglyad-inzhenera-i-biznesmena\" rel=\"noopener noreferrer nofollow\"><u>No-Code и Low-Code. Взгляд инженера и бизнесмена</u></a>&raquo; (на Habr её не публиковал).</p>\r\n<p>То есть сама отрасль лишает свой хвост работы, отбрасывая его. Очень плохая идея оказаться в хвосте. Это тоже сытая жизнь, только не очень надолго.</p>\r\n<h2>Крупные компании и устаревшие технологии</h2>\r\n<p>Здесь есть место для конфликта интересов IT-специалистов и крупным бизнесом. Первым нужно не отстать от рынка, для этого нужно постоянно бежать. Вторым нужно сокращать свои операционные и капитальные затраты. Бизнес не заинтересован в постоянном внедрении новых технологий. Бизнес заинтересован в технологических платформах, которые будут работать 10-20 и более лет. Стоимость внедрения новых платформ - очень большая.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d192e61b0f.jpg\" alt=\"\" /></p>\r\n<p>Иногда бывают курьёзные случаи. Те, кто остаются в IT надолго, рискуют продолжить работать до самой смерти. В конце XX века всплыла &laquo;<a href=\"https://en.wikipedia.org/wiki/Year_2000_problem\" rel=\"noopener noreferrer nofollow\"><u>Проблема 2000 года</u></a>&raquo;, много программного обеспечения было неготово к работе после 2000 года. В том числе и банковского программного обеспечения разработанного на языке Cobol. Язык создан в 1959 году, программистов - мало. Пришлось привлекать к разработке даже тех людей, кто на тот момент были в домах престарелых. Самое смешное, что и в 20-х годах XXI века подумывают о программистах Cobol из дома престарелых.</p>\r\n<p>Мне самому приходилось работать на старой и очень живучей платформе разработки систем документооборота. Шутки про Cobol у нас были скорее грустные, а не смешные. Мы понимали, что нас может ожидать.</p>\r\n<blockquote>\r\n<p><em>То есть, работа в крупной компании либо государственном секторе может обернуться для IT-специалиста застоем в освоении новых технологий и отставании от отрасли на 10-15 лет. Это очень большая дистанция, при этом есть риски, что одним рывком её преодолеть будет невозможно.</em></p>\r\n</blockquote>\r\n<p>Но это же и средство &laquo;консервации&raquo; IT-специалистов. Главное, чтобы от твоего технологического стека (набора) не отказались, когда тебе 40-50 лет. Сильные разработчики быстро переучатся на новый стек технологий, а другие уйдут с рынка.</p>\r\n<h2>Нужно любить своё дело</h2>\r\n<p>Невозможно выдержать длительную профессиональную гонку, когда не любишь то, чем занимаешься. Для тех людей, что представляют из себя профессиональное ядро отрасли, информационные технологии - это не только и не столько источник дохода. Это возможность самореализовываться в любимом деле.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d19476ba64.jpg\" alt=\"\" /></p>\r\n<p>Скорее всего, у таких людей будет профильное образование, либо близкая к профильной специальность. Хорошее образование и фундаментальная подготовка позволяет человеку понимать, что развитие технологий происходит по спирали. Концептуально разница между мейнфреймом с терминалами и тонкими клиентами с облаком не так уж и много.</p>\r\n<p>При достижении определённой глубины понимания отрасли, гонка технологий перестаёт быть гонкой, уходит необходимость постоянно переобучаться. Остаётся только любопытство и тяга к новым знаниями и инструментам, которая позволяет оставаться востребованным до конца своей трудовой жизни.</p>\r\n<p>Именно эти люди решают сложные инженерные проблемы, создают новые технологии и методологии. Их мало, но именно в их присутствии IT начинает работать эффективно и надёжно, как хорошо отлаженный механизм.</p>\r\n<p>Вместе с плюсами такая любовь к своему делу несет и большие риски. Если такой человек начинает заниматься никому не нужно работай, когда результатами его труда перестают пользоваться люди, наступает быстрое эмоциональное выгорание. Такие люди не смогут работать в стол.</p>\r\n<p>Поэтому их редко можно увидеть в стартапах. Если человек в десятый раз делает новую социальную сеть, которая никогда не запустится, не потому, что она плохо написана, а потому, что она никому не нужна, и его всё устраивает, то это явно какой-то другой человек. Профессионал, скорее, реализует конструктор социальных сетей и будет продавать его, как услугу, любителям стартапов, чтобы они могли проверять свои гипотезы самостоятельно.</p>\r\n<p>Конечно, иногда профессионалы участвуют в стартапах, но чаще они приходят в них, когда бизнес-идея подтвердилась и нужно строить устойчивое и гибкое технологическое основание.</p>\r\n<p>Все мы понимаем, что торговать своей любовью долго не получится, даже за большие деньги.</p>\r\n<h2>Подводя итоги</h2>\r\n<p>На рынке информационных технологий одновременно присутствуют долгоживущие профессионалы и люди, которые попали в отрасль &laquo;случайно&raquo;. Плюс некоторая прослойка, которые пришли в отрасль молодыми, но не выдержат длительной гонки.</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635d196233041.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>Если вы небольшой стартап и вам нужны люди ненадолго, то вам подойдут любые специалисты. Если вам нужны представители профессионального ядра отрасли, то внимательно посмотрите в глаза человека. Насколько они у него горят? Насколько он любит (по-настоящему) то дело, которым занимается? Как долго он сможет &laquo;бежать&raquo;? Насколько то, что вы делаете, интересно этому человеку? Ему тоже в это придётся вкладывать душу.</p>\r\n<p>Помните, что дело не в возрасте. Человек может состояться, как профессионал и в 25-27 лет. Их просто нужно уметь отличить от тех, кто через 10 лет сойдёт с дистанции. Вообще, в области информационных технологий очень много психологии и технологий социальных. Это иная (скрытая) грань отрасли.</p>\r\n<p>Что до вопроса, куда исчезают программисты после 40 лет? Профессионалы остаются востребованными и после 50-60 лет. Чаще всего это люди, которые очень глубоко понимают свою область, среди них много старших разработчиков и технических лидеров. Таких людей никогда не было много, рынок ими не перенасытится никогда. Некоторое число людей отрасль отдаёт на руководящие должности. Кадровый кризис в области руководства ещё более острый, чем среди IT-специалистов.</p>\r\n<p>А остальные сходят с дистанции, кто-то совсем уходит из отрасли, кто-то продолжает работать в крупных и государственных организациях, выполняя несложную работу и получая оклад ниже средней по региону. То есть перестают соответствовать мифу о высокооплачиваемых и сверхвостребованных IT-специалистах, которые могут работать удаленно из любой точки мира.</p>\r\n<p>Если вы дочитали до конца и написанное было для вас полезным, то спасибо вам.</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 62, 'uploads/images/2022/10/image_750x500_635d19ab5d1ab.jpg', 'uploads/images/2022/10/image_750x_635d19ab6f7b8.jpg', 'uploads/images/2022/10/image_600x460_635d19ab7f020.jpg', 'uploads/images/2022/10/image_380x226_635d19ab90343.jpg', 'uploads/images/2022/10/image_140x98_635d19ab9b9bb.jpg', 'jpg', 'local', '', 25, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-29 14:17:04');
