(948, 1, 'Легендарный: история самого высокооплачиваемого инженера-программиста из Google', 'legendarniy-istoriya-samogo-visokooplachivaemogo-inzhenera-programmista-iz-google', NULL, 'itfox, habr, community, programming community, turkmenportal', '«В 2002 году Google-поиск не работал несколько часов. Джеффу Дину пришлось вручную обрабатывать запросы пользователей. Качество поисковой выдачи выросло в два раза» — забавный факт о Джеффе Дине.', '<p><span>Разумеется, это лишь шутка &mdash; про Джеффа Дина их ходит совсем не мало. Совсем скоро вы поймете, откуда &laquo;растут ноги&raquo; у баек об одном из самых легендарных программистов из Google.</span></p>\r\n<p><span>В середине нулевых шесть лучших инженеров Google собрались в импровизированном штабе. Ключевая система Google, которая занималась индексацией веб-страниц, отключилась. Пользователи все еще могли вводить запросы, но результаты поисковой выдачи являлись устаревшими на целых пять месяцев.<br /><br />К тому же Google только-только успела заключить с Yahoo соглашение о запуске новой поисковой системы, которая должна была стать в десять раз крупнее, чем существующая. Напряжение росло. На карту было поставлено слишком многое. В случае неудачи компания потеряла бы все свои средства и обанкротилась. Все, чего удалось достичь, могло просто-напросто вылететь в трубу за один день.<br /><br />Одним из этих шести инженеров был высокий, энергичный молодой человек по имени Джефф Дин. Ему был 31 год, пару месяцев назад он ушел из D. E. C. и начал карьеру в молодой и амбициозной компании Google.<br /><br />При разговоре о людях, сформировавших Всемирную паутину, первыми на ум, вероятно, приходят легендарные деятели вроде Ларри Пейджа и Сергея Брина, Марка Андрессена, Тима Бернерса-Ли, Билла Гейтса и Марка Цукерберга. Безусловно, их можно назвать умнейшими людьми на Земле. Тем временем легионы безымянных кодеров ежедневно пыхтят над клавиатурами, создавая системы и продукты, которые мы ежедневно используем. Увы, их удел &mdash; оставаться в тени боссов-гигантов. Однако именно на них зиждется вся компьютерная индустрия.<br /><br /></span></p>\r\n<h2>Давайте познакомимся поближе</h2>\r\n<p><span><br />Возможно, именно по причине, озвученной выше, вы никогда бы не услышали о некоем Джеффе Дине. Джефф Дин &mdash; американский инженер-программист и ученый в области информатики. Благодаря ему на свет появилось множество &laquo;закулисных&raquo; продуктов Google, которые помогли корпорации пробиться на трон всея интернета. Кроме того Джефф, соучредитель компании и глава команды инженеров Google по глубокому обучению, широко известен своими докладами на тему технологий, инноваций и искусственного интеллекта.<br /><br />Параллельно с получением магистерской и докторской степеней по информатике он работал в Университете Вашингтона ассистентом преподавателя, инструктором и научным сотрудником. После окончания университета Дин присоединился к исследовательской группе в Западной исследовательской лаборатории корпорации Compaq Computer.<br /><br />Работая в Compaq, Джефф участвовал в создании инфраструктуры непрерывного профилирования и изобрел ProfileMe, аппаратную технологию мониторинга производительности микропроцессоров. Кроме того, он успел приложить руку к разработке и внедрению Swift, одной из самых быстрых в мире реализаций Java. Также он был ведущим техническим сотрудником mySimon Inc., некогда популярного сервиса для сравнения покупок.<br /><br />Когда в середине 1999-го Дин пришел в Google, он уже был одним из самых успешных молодых компьютерных специалистов страны. Даже во времена его детства &mdash; в пору, когда персональные компьютеры только-только набирались силы &mdash; он постоянно искал способы расширить возможности цифровых устройств.<br /></span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e358ac6ed0.jpg\" alt=\"\" /></p>\r\n<h2>Гений</h2>\r\n<p><br /><span>Разработанная им еще в средней школе программа для обработки огромных массивов эпидемиологических данных работала в 26 раз быстрее инструментов, которыми пользовались специалисты этой области. Epi Info стала отраслевым стандартом &mdash; ее массово внедрили Центры по контролю за заболеваниями. Программа распространилась во всем мире и даже была переведена на десятки иностранных языков.</span><br /><br /><span>Уже будучи кандидатом наук в области информатики, Дин активно работал над компиляторами. Но это не было делом всей его жизни. Так Дин оказался в компании Google, в которой на тот момент работало менее 20 человек. Он внес свой вклад в создание Google News и AdSense, сервиса, который коренным образом изменил мир рекламы и интернет-экономики. Однако вскоре после этого ему пришлось сосредоточиться на решении одной из главных проблем Google &mdash; масштабировании.</span><br /><br /><span>По мере роста Google столкнулась с огромным дефицитом вычислительных мощностей. В конце 90-х годов был создан PageRank, алгоритм, выдающий наиболее релевантные результаты по заданному поисковому запросу. Популярность поисковика неуклонно росла, но Google не успевала развертывать новые мощности и поспевать за спросом.</span><br /><br /><span>Дин занялся тем, что у него получалось лучше всего &mdash; поиском нестандартного решения проблемы. Вместе с выдающимся программистом Санджаем Гемаватом он создал для Google особую файловую систему, которая позволяла эффективно распределять огромные объемы данных по тысячам дешевых машин.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e35b09a722.jpg\" alt=\"\" /></p>\r\n<p><i>Джефф Дин и Санджай Гемават, Wired</i><br /><br /><span>Затем в тандеме они разработали революционный инструмент MapReduce, модель распределенных вычислений, используемую в технологиях Big Data для параллельных вычислений, производимых над очень большими (до нескольких петабайт) наборами данных. После выхода в 2004 году статьи&nbsp;</span><a href=\"http://research.google.com/archive/mapreduce.html\">MapReduce: Simplified Data Processing on Large Clusters</a><span>&nbsp;инструмент стал сенсацией и буквально взорвал отрасль!</span><br /><br /></p>\r\n<h2>Инновации меняют все</h2>\r\n<p><br /><span>Другие инициативы Дина также не раз меняли правила игры. Например,&nbsp;</span><b>BigTable</b><span>, распределенная система хранения данных, основанная на файловой системе Google, способна управлять буквально петабайтами информации. Или&nbsp;</span><b>Spanner</b><span>&nbsp;&mdash; первая глобальная база данных, позволящая хранить данные на миллионах серверов в десятках центров обработки данных на разных континентах.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e35cf85302.jpg\" alt=\"\" /></p>\r\n<p><i>Джефф Дин, Medium</i><br /><br /><span>Сегодня она служит основой для всех ключевых сервисов Google &mdash; от Gmail до AdWords. Возможно, вы удивитесь, но Джефф Дин был соучредителем Google Translate. Кроме того, он внес серьезный вклад в создание Google News. Сегодня Дин возглавляет подразделение Google AI и занимает в компании должность Senior Fellow (эквивалент Senior Vice President) подразделения Google Research and Health.</span><br /><br /></p>\r\n<h2>Признание</h2>\r\n<p><br /><span>В 2009 году Дин был избран в Национальную инженерную академию. В 2009 году стал членом Ассоциации вычислительной техники, а в 2016-ом &mdash; Американской академии искусств и наук. В 2012 году был удостоен награды ACM-Infosys Foundation Award, а в 2007 году &mdash; ACM-SIGOPS Mark Weiser Award. И этот список можно продолжать очень долго.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e35ee9c508.jpg\" alt=\"\" /></p>\r\n<div data-gallery-root=\"\" lang=\"ru\" class=\"tm-article-body\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-1\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\"><i>Джефф Дин, Medium</i><br /><br />В вашей голове может возникнуть коварный вопрос: сколько же зарабатывает этот мега-мозг? Многие считают Джеффа Дина одним из самых высокооплачиваемых сотрудников Google. Согласно результатам исследования, он получает 3 миллиона долларов в год.<br /><br />Как правило, его утро в Google начинается так. Джефф присоединяется к небольшой группе коллег возле офисной кофемашины &mdash; чтобы выпить по кружечке кофе и пообщаться. Дин подогревает молоко, один его коллега мелет кофе, а другой уже готовит порцию эспрессо. Пока варится кофе, коллеги обсуждают семейные дела и технические вопросы. По мнению Дина, именно такие небольшие беседы и обмен идеями заставляют Google работать.<br /><br />&laquo;Некоторые из нас работают бок о бок уже более 15 лет&raquo;, &mdash; говорит Дин. &laquo;И по нашим самым скромным подсчетам, вместе мы сварили уже более 20 000 капучино&raquo;.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 62, 'uploads/images/2022/10/image_750x500_635e3577be152.jpg', 'uploads/images/2022/10/image_750x_635e3577d0bca.jpg', 'uploads/images/2022/10/image_600x460_635e3577e0908.jpg', 'uploads/images/2022/10/image_380x226_635e3577ee800.jpg', 'uploads/images/2022/10/image_140x98_635e357806e36.jpg', 'jpg', 'local', '', 19, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-30 10:30:20'),
(949, 1, 'Игры созданные в одиночку и Заработавшие Миллионы', 'igri-sozdannie-v-odinochku-i-zarabotavshie-millioni', NULL, '', 'Это инди игры созданные в одиночку, которые заработали миллионы долларов. Разработка игр в одиночку дело непростое, успешные инди игры выходят не так часто как нам кажется, но даже среди них есть игры созданные одним человеком, которые принесли огромные деньги своим авторам. В основном это игры на пк, которые затем портировали и на другие платформы. Приятного чтения.', '<p><strong>Sally Face</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e4df4cca1d.jpg\" alt=\"\" /></p>\r\n<p>Итак, начнём с чего нибудь простого, но очень душевного, психоделического, и захватывающего. Например&hellip; Sally Face. Это приключенческая инди игра, созданная Стивом Габри, также известным как Portable Moose. В ней нам рассказывается история парня по имени Сал Фишер, который получил протез на лицо, в результате одного инцидента. В первом эпизоде Сал с отцом переехали в Апартаменты Эддисона, и чуть ли не стали свидетелями ужасного убийства. Сал находит себе лучшего друга, по имени Ларри, и вместе с ним обнаруживает всё больше странных вещей с каждой главой (которых в игре 5). Несмотря на свой простой концепт, игра обрела заслуженных фанатов, и немалую цифру в размере $670k. (Предупреждаю, в игре есть мерзкие сцены)</p>\r\n<p>Ссылка на игру:<span>&nbsp;</span><a href=\"https://store.steampowered.com/app/541570\" rel=\"noopener noreferrer nofollow\">Steam</a></p>\r\n<p></p>\r\n<p><strong>Thomas Was Alone</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e4e10a4bc5.jpg\" alt=\"\" /></p>\r\n<p>Эта игра была создана одним человеком, хотя вам, наверное, могло показаться, что над этой игрой около 5 лет трудились 89 человек из разных стран и разных направлений. Ах да, забыл сказать что её анонс переносили 17 раз. Её создал Майк Бителл. В ней мы играем за искусственный интеллект. Он появился в нужном месте, в нужное время, однако он поумнел, и научился думать, и анализировать местность. По мере прохождения он задаёт себе вопросы &ldquo;Кто я? Где я?&rdquo;. Сама игра выполнена в 2D. В общем, довольно красивый визуал, и геймплей, который не совсем заслуженно получил $710k.</p>\r\n<p>Ссылка на игру:<span>&nbsp;</span><a href=\"https://store.steampowered.com/app/220780\" rel=\"noopener noreferrer nofollow\">Steam</a></p>\r\n<p></p>\r\n<p><strong>Axiom Verge</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e4e444d40c.jpg\" alt=\"\" /></p>\r\n<p>Ох, 80-ые, время ретро, &ldquo;догони меня кирпич&rdquo; и 50 благословений&hellip; Если, вы конечно поняли, что я имею ввиду. Axiom Verge - игра, которая может вас вернуть в те самые времена. Игра выполнена в стиле игр 80-ых. Но тем не менее, разработчик над ней сильно постарался. В игре мы управляем неким ученым, который наконец то хорошо выспавшись проснулся после аварии. С нами связываются &ldquo;Русалки&rdquo; - некие суперкомпьютеры, и просят нас о помощи. Естественно нам нечего делать, и мы решаемся помочь &ldquo;русалкам&rdquo;. Геймплей по началу не интересен, но позже вам уже явно не будет скучно. Игра заработала $1.7m.</p>\r\n<p>Ссылка на игру:<span>&nbsp;</span><a href=\"https://store.steampowered.com/app/332200\" rel=\"noopener noreferrer nofollow\">Steam</a></p>\r\n<p></p>\r\n<p><strong>Stanley Parable</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e53793cf8b.jpg\" alt=\"\" /></p>\r\n<p>Обратная психология - интересная штука. Вроде тебе говорят пойти в левую дверь, а ты по своему решению идешь в правую, ведь тебе кажется что она интереснее. Stanley Parable - отличный пример такой психологии. Эта игра нам рассказывает историю о молодом офисном планктоне Стенли, который сидит за столом и слушает указания &ldquo;На какую кнопку нажимать, в какой последовательности, и как долго на неё нажимать&rdquo;. Не смотря на это, Стенли был счастлив. Но в один момент все сотрудники неожиданно куда то пропали, и следуя словам рассказчика он должен расследовать это дело. Но вы наверное уже в курсе, что в этой игре куча, КУЧА веток событий, и куча разных концовок. В результате разработчик получил почти $7m.</p>\r\n<p>Ссылка на игру:<span>&nbsp;</span><a href=\"https://store.steampowered.com/app/221910\" rel=\"noopener noreferrer nofollow\">Steam</a></p>\r\n<p></p>\r\n<p><strong>Papers, Please</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e53a5e9740.jpg\" alt=\"\" /></p>\r\n<p>Да, это тот самый симулятор пограничника. Бывший разработчик из Студии Naughty Dog (Да да, анчартед, и ласт оф ас) уйдя из студии решил разработать свою игру, в которой нужно сверять документы, и определять, фальшивые ли они или настоящие. 20 концовок, а фраза &ldquo;Слава Арстоцке&rdquo;, которая стала культовой, подарили разработчику $9.2m. Теперь он прямо как в игре, прокармливает семью и утепляет дом.</p>\r\n<p>Ссылка на игру:<span>&nbsp;</span><a href=\"https://store.steampowered.com/app/239030\" rel=\"noopener noreferrer nofollow\">Steam</a></p>\r\n<p></p>\r\n<p><strong>Plague Inc: Evolved</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e53dac4570.jpg\" alt=\"\" /></p>\r\n<p>Коронавирус на фоне всех событий просто исчез, как будто его и не бывало. Но всё же, он есть, и этого нельзя отрицать. Plague Inc - хит 2020 года, ведь она была актуальна на фоне проклятого вируса. Из за её механики игру даже запретили в некоторых странах. Но что в ней такого интересного и особенного? Сейчас выясним. В этой игре мы, вероятно, играем за секретную корпорацию по изготовлению вирусов, бактерий, и прочих опасных одноклеточных. Высадившись на любую из всех существующих стран, мы должны развивать нашу бактерию за счет &ldquo;очков ДНК&rdquo;. В результате наша бактерия должна УНИЧТОЖИТЬ ВСЁ НАСЕЛЕНИЕ ЗЕМЛИ АХАХАХА, ой&hellip;Случайно вырвалось. Вариаций развития огромное количество, и они все разные, от симптома кашля до комы. В игре также есть &ldquo;сценарии&rdquo; которые разнообразят игру. Игра принесла разработчику $11m.</p>\r\n<p>Ссылка на игру:<span>&nbsp;</span><a href=\"https://store.steampowered.com/app/246620\" rel=\"noopener noreferrer nofollow\">Steam</a></p>\r\n<p></p>\r\n<p><strong>Stanley Parable: Ultra Deluxe</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e53793cf8b.jpg\" alt=\"\" /></p>\r\n<p>Стоп. Мы же о ней говорили 3 пункта назад. Да, только эта версия - Делюкс. Да, в оригинале концовок не мало, но в то же время и не много, 20 штук. Хочется больше. И тогда разработчик добавил ЕЩЁ 22 концовки. И это замечательно. В отличие от оригинала, Ультра Делюкс получила уже $11m в сравнении с $7m.</p>\r\n<p>Ссылка на игру:<span>&nbsp;</span><a href=\"https://store.steampowered.com/app/1703340\" rel=\"noopener noreferrer nofollow\">Steam</a></p>\r\n<p></p>\r\n<p><strong>Phasmophobia</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e5455ea30a.jpg\" alt=\"\" /></p>\r\n<p>Если про Thomas Was Alone я шутил, что вы могли подумать что она создана огромной командой, то про Phasmophobia я действительно думал что эта игра создана командой. Для тех кто не знает, Phasmophobia - многопользовательский сурвайвл хоррор, в которой игрок вместе с друзьями должен исследовать паранормальные места, с помощью взаимодействия с призраками и доказательств их существования.</p>\r\n<p>С помощью призраков, разработчик игры заработал ровно $100m.</p>\r\n<p>Ссылка на игру:<span>&nbsp;</span><a href=\"https://store.steampowered.com/app/739630\" rel=\"noopener noreferrer nofollow\">Steam</a></p>\r\n<p></p>\r\n<p><strong>Stardew Valley</strong></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_635e5477315ec.jpg\" alt=\"\" /></p>\r\n<p>Среди всех выше перечисленных игр, есть как жестокие и страшные, так и довольно безобидные, но эта игра отличается отсутствием какого либо насилия, крови, и убийств. Ну, не совсем, убийства есть, только они ни капли не кровавые и жестокие, ведь мы убиваем монстров в пещере. В общем, суть этой игры - фермерство. Нашему герою в наследство от умершего дедушки выдаётся ферма в маленьком городке Пеликан, в долине Стардью. По мере прохождения игры, мы познакомимся со всеми персонажами, вернём ферму в исходное состояние, узнаем много тайн, и даже обзаведёмся семьей. Короче, в этой игре у вас дел по горло, в другом смысле, естественно. В игре также есть конструктор персонажа. Игра заработала $120m.</p>\r\n<p></p>\r\n<div data-gallery-root=\"\" lang=\"ru\" class=\"tm-article-body\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p>Да, еще есть такие игры как тетрис, майнкрафт, митбой, фез и т.д.) игр много)</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 1, 'uploads/images/2022/10/image_750x500_635e54d19bf88.jpg', 'uploads/images/2022/10/image_750x_635e54d1aa2ca.jpg', 'uploads/images/2022/10/image_600x460_635e54d1b7bc5.jpg', 'uploads/images/2022/10/image_380x226_635e54d1c386f.jpg', 'uploads/images/2022/10/image_140x98_635e54d1ccc3c.jpg', 'jpg', 'local', '', 29, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-30 12:41:24'),
(951, 1, 'Маркетинговые исследования и UX-исследования. В чем разница?', 'marketingovie-issledovaniya-i-ux-issledovaniya-v-chem-raznitsa', NULL, 'itfox, habr, community, programming community, turkmenportal', 'Между исследованием рынка и исследованием UX есть много общего. По сути оба типа исследований сосредоточены на опыте клиентов. Тем не менее, есть различия в их целях и способах применения.', '<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<h3>Определения</h3>\r\n<p><strong>Маркетинговые исследование</strong>&nbsp;- это процесс изучения потребностей и покупательских предпочтений клиентов. В исследованиях используются опросы и анализ данных, которые позволяют определить рынок для продукта и аудиторию, которая с наибольшей вероятностью купит продукт. Благодаря полученным результатам можно определить, стоит ли запускать продукт или нет.</p>\r\n<p><strong>UX-исследование</strong>&nbsp;- это изучение пользователей, предназначенное для информирования и улучшения процесса принятия решений командой разработчиков продукта. Это позволяет командам быть ориентированными на пользователя и действовать с максимальным эффектом.</p>\r\n<p>UX-исследования направлены на то, чтобы лучше узнать существующую аудиторию, а полученные результаты используют для разработки и последующего тестирования дизайнерских решений. В результате можно выявить проблемы продукта, такие как высокий процент отказов, низкие показатели удовлетворенности клиентов или жалобы на неудобство использования продукта или услуги.</p>\r\n<p>Как маркетинговые, так и UX исследования составляют неотъемлемую часть процесса разработки и проектирования продукта.</p>\r\n<p>Маркетинговые исследования направлены на понимание покупательского поведения и предпочтений аудитории.</p>\r\n<p>UX-исследования направлены на понимание того, как пользователи взаимодействуют с продуктом и как сделать продукт более привлекательным.</p>\r\n<h3>Когда проводить маркетинговые или UX-исследования</h3>\r\n<p><strong>Маркетинговые исследования</strong>&nbsp;обычно проводятся перед запуском или обновлением продукта и дают ответы на следующие вопросы:</p>\r\n<ul>\r\n<li>\r\n<p>Существует ли потребность рынка в продукте?</p>\r\n</li>\r\n<li>\r\n<p>Кто будет покупать продукт?</p>\r\n</li>\r\n<li>\r\n<p>Как можно охватить целевую покупательскую аудиторию?</p>\r\n</li>\r\n</ul>\r\n<p>По сути, маркетинговые исследования позволяют выявить жизнеспособность продукта и определить рыночную стратегию бизнеса. В ходе маркетинговых исследований прорабатываются следующие разделы:</p>\r\n<ul>\r\n<li>\r\n<p>Размер рынка</p>\r\n</li>\r\n<li>\r\n<p>Определение ценообразования</p>\r\n</li>\r\n<li>\r\n<p>Тенденции рынка</p>\r\n</li>\r\n<li>\r\n<p>Оценка конкуренции</p>\r\n</li>\r\n</ul>\r\n<p><strong>UX-исследования</strong>&nbsp;изучают пользователей, их потребности, ожидания, паттерны поведения, как они взаимодействуют с продуктом. Как правило они применяется, когда разработан прототип, готовый к тестированию на пользователях. UX-исследования направлены на то, чтобы ответить на 3 ключевых вопроса:</p>\r\n<ul>\r\n<li>\r\n<p>Чего хотят пользователи?</p>\r\n</li>\r\n<li>\r\n<p>Что нужно пользователям?</p>\r\n</li>\r\n<li>\r\n<p>Как они используют ваш продукт?</p>\r\n</li>\r\n</ul>\r\n<p>В процессе UX-исследования ставятся следующие цели:</p>\r\n<ul>\r\n<li>\r\n<p>Определить персоны и пути пользователей.</p>\r\n</li>\r\n<li>\r\n<p>Понять потребности и цели пользователей</p>\r\n</li>\r\n<li>\r\n<p>Выявить узкие места в маршрутах пользователей</p>\r\n</li>\r\n<li>\r\n<p>Проверить потенциал новых функций</p>\r\n</li>\r\n<li>\r\n<p>Определить оптимальную информационную архитектуру и онбординг</p>\r\n</li>\r\n<li>\r\n<p>Определить области для улучшения опыта.</p>\r\n</li>\r\n</ul>\r\n<p>Как можно заметить, у каждого типа исследований разные цели. Например, маркетинговые исследования имеют тенденцию смотреть вовне (рынок, конкуренты и т.д.). В то время как UX-исследования обычно смотрят внутрь продукта.</p>\r\n<h3>Сходства методов маркетинговых и UX-исследований</h3>\r\n<p>В маркетинговых и в UX-исследованиях используются практически одинаковые методы, такие как:</p>\r\n<ul>\r\n<li>\r\n<p>Опросы</p>\r\n</li>\r\n<li>\r\n<p>Фокус-группы</p>\r\n</li>\r\n<li>\r\n<p>Личные интервью</p>\r\n</li>\r\n<li>\r\n<p>Наблюдение и полевые испытания</p>\r\n</li>\r\n<li>\r\n<p>Конкурентные исследования</p>\r\n</li>\r\n<li>\r\n<p>A/B тестирование</p>\r\n</li>\r\n</ul>\r\n<p>Несмотря на то, что эти методы практически идентичны, контекст, в котором они применяются, различен. Это возвращает нас к целям. Маркетинговые исследования используют вышеперечисленные методы для определения того, насколько продукт востребован и жизнеспособен для бизнеса. UX-исследования использует те же методы для изучения и анализа поведения пользователей.</p>\r\n<p>Например, в UX-исследованиях используются такие методы, как юзабилити-тестирование, эвристическая оценка и отслеживание взгляда. Хотя эти методы являются частью UX-исследований, полученные сведения могут быть ценными и для команды, занимающейся маркетинговыми исследованиями.</p>\r\n<p>Другой пример, анализ социальных сетей или данных о продажах лучше подходят для маркетинговых исследований. Однако их результаты могут использовать и UX-исследователи, чтобы лучше понять взаимодействие между потребителем и продуктом. Одним словом, тактики, используемые как для маркетинговых, так и для UX-исследований во многом совпадают.</p>\r\n<h3>Как правильно выбрать метод исследования</h3>\r\n<p>Для начала определяем бизнес-проблему, которую хотим решить.</p>\r\n<p>Допустим, мы запустили новый продукт. Несмотря на то, что он хорошо продается, он все еще не отвечает бизнес-целям компании. В этом случае UX-исследование поможет лучше понять, как люди взаимодействуют с вашим продуктом.</p>\r\n<p>Или другой сценарий. Если у бизнеса есть сомнения по поводу востребованности вашего продукта на рынке, маркетинговые исследования дадут вам необходимые ответы.</p>\r\n<p>Если не проводить различия между маркетинговыми и UX исследователями, а объединить оба типа исследований, то мы получим более целостную картину. Полученные результаты в дальнейшем можно применять как для маркетинговых активностей, так и для улучшения продукта.</p>\r\n<h3>Взаимосвязь маркетинговых и UX исследований</h3>\r\n<p>Мы разобрались с тем, что, эти два вида исследований во многом пересекаются. Поэтому не всегда имеет смысл ставить стену между этими двумя видами деятельности. Это может привести к неэффективному рабочему процессу с некачественным результатом.</p>\r\n<p>Вот почему.</p>\r\n<p>Во-первых, разделение маркетинговых и UX исследований приведет к дублированию работ. Поскольку между ними много общего, велика вероятность того, что ваши команды будут выполнять одни и те же действия дважды. Более того, если отдать одну часть процесса исследования маркетологам, а другую - специалистам по дизайну, то это приведет к разрыву пути клиента. В результате общий путь клиента будет лишен целостности.</p>\r\n<p>Эта эволюция в исследованиях привела к еще большему совпадению между маркетинговыми и UX-исследованиями. UX-исследования открывают двери к пониманию того, как пользователи взаимодействуют с продуктом. Выяснив это, бизнес сможет определить, куда направить ресурсы, чтобы преуспеть в конкурентной борьбе.</p>\r\n<h3>Какой можно сделать вывод</h3>\r\n<p>Маркетинговые и UX-исследования жизненно важные части процесса проектирования и разработки продукта. Хотя в некотором смысле они практически идентичны (методы исследования, бизнес-цели и т.д.), но все же подходят к проблемам бизнеса с разных сторон. Поэтому интеграция обоих типов исследований позволит получить полную целостную картину.</p>\r\n<p>Надеемся, что все вышесказанное даст вам понимание необходимости проведения маркетинговых и UX-исследований, а также их преимуществ для вашего бизнеса.</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 41, 'uploads/images/2022/10/image_750x500_635e5a45b5a02.jpg', 'uploads/images/2022/10/image_750x_635e5a45c385e.jpg', 'uploads/images/2022/10/image_600x460_635e5a45d0a61.jpg', 'uploads/images/2022/10/image_380x226_635e5a45dce3a.jpg', 'uploads/images/2022/10/image_140x98_635e5a45e5bc8.jpg', 'jpg', 'local', '', 21, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-30 13:05:23'),
(952, 1, 'Несколько сервисов, позволяющих удалить информацию о себе из интернета:', 'neskolko-servisov-pozvolyayushchikh-udalit-informatsiyu-o-sebe-iz-interneta', NULL, '', '', '<p class=\"p1\">➖ <a href=\"https://joindeleteme.com/\">DeleteMe</a> &mdash; это компания, которая предоставляет годовую защиту от сайтов по сбору данных и брокеров. За абонентскую плату компания периодически ищет и удаляет любую личную информацию на любых сайтах по сбору данных.</p>\r\n<p class=\"p2\"></p>\r\n<p class=\"p1\">➖ <a href=\"https://www.accountkiller.com/en\">AccountKiller</a> &mdash; очень полезный сайт, на котором представлен самый быстрый способ удаления любой учетной записи в Интернете. На сайте также представлены советы о том, как полностью приватизировать свой аккаунт в случае, если вы не можете его удалить.</p>\r\n<p class=\"p2\"></p>\r\n<p class=\"p1\">➖ <a href=\"https://justdeleteme.xyz/\">JustDeleteMe</a> &mdash;</p>\r\n<p class=\"p1\">еще один сайт, который представляет собой каталог шагов по удалению или отмене аккаунта, включая удобные ссылки.</p>', 62, 'uploads/images/2022/10/image_750x500_63600aa8ba6a2.jpg', 'uploads/images/2022/10/image_750x_63600aa8cb8b0.jpg', 'uploads/images/2022/10/image_600x460_63600aa8d6bf9.jpg', 'uploads/images/2022/10/image_380x226_63600aa8e1f11.jpg', 'uploads/images/2022/10/image_140x98_63600aa8e97c8.jpg', 'jpg', 'local', '', 15, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-31 19:49:36');
