(953, 1, 'Интерактивография – новый научный термин или Манифест любви к играм', 'interaktivografiya-noviy-nauchniy-termin-ili-manifest-lyubvi-k-igram', NULL, '', 'Интерактивогрáфия — новый научный термин, обозначающий искусство электронно-цифровых игр.\r\n', '<h4>Короткое введение</h4>\r\n<p><br /><span>Что же такое &ldquo;Интерaктивография&ldquo;, почему так называется и откуда такое название?</span><br /><br /><span>&mdash; Я, автор этого термина, будучи учёным-теоретиком и геймдизайнером, являюсь также большим поклонником игр и даже пытаюсь лично создавать кое-чего в этой сфере.</span><br /><br /><span>Когда я впервые ознакомился с термином &laquo;Интерактивное Искусство&raquo;, представляющая искусство игр, я понял, что с таким, не совсем конкретным названием, было бы слишком мало и несправедливо по отношению к такой грандиозной формы современного искусства и обширной области культуры. Поэтому я поставил себе цель найти более адекватное и логичное название, с точки зрения науки. Будучи хорошо знакомым с этой областью, я проанализировал разные вариации, пока, наконец, дошёл до конкретного термина, который более корректно бы обозначал это искусство, начиная от её основы (</span><i>-так сказать, от истоков</i><span>) и способный приоткрыть изнутри данное явление &ndash;&nbsp;</span><b><i>интерактивография</i></b><span>.</span><br /><br /><br /></p>\r\n<h4>Формулировка</h4>\r\n<p><br /><b><i>Интерактивогр&aacute;фия</i></b><span>&nbsp;(латынь:&nbsp;</span><i>inter</i><span>-между,&nbsp;</span><i>activitas</i><span>-деятельность,&nbsp;</span><i>graphica</i><span>-графика) &ndash; это форма синтетического искусства на базе компьютерной программы, составленная из графических изображений, либо движущиеся или неподвижные, в 2D или 3D измерении, в которой пользователь, с помощью определённого интерфейса и манипуляторов, может взаимодействовать с виртуальными объектами, тем самым участвуя лично в действиях, происходящие в играх.</span><br /><br /><span>Как известно, продуктом интерактивографического искусство является &laquo;Игра&raquo; (</span><i>Game, Juego, Jeu etc.</i><span>), а её пользователем называется &laquo;Игрок&raquo; (</span><i>Gamer, Jucător, Joueur etc.</i><span>).</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600b3de4a71.jpg\" alt=\"\" /></p>\r\n<h4>Детальнее</h4>\r\n<p><br /><span>&ldquo;Интерактивография&rdquo;, названная также &ldquo;интерактивным искусством&rdquo;, известно как искусство в которой игрок обычно участвует в определённых симуляциях или в виртуальных интерактивных событиях, в которой имеет возможность, как виртуальный актёр, принимать участие в развитии художественного или документального сюжета игры. В некоторых играх пользователь может своими действиями приоткрывать их сюжет, даже развивать сюжет в своих интересах, имея при этом возможность повторять одно и то же действие по несколько раз. Ну а в некоторых современных играх пользователь может прийти к тому финалу, который будет зависеть от его личных действий на протяжении игры.</span><br /><span>Говоря проще, в современной игре каждый игрок может принять участие в разных имитациях действий, вдохновлённые из реальной жизни или же поучаствовать в придуманных действиях, которые могут быть &ldquo;облачены&rdquo; в одном сюжете (художественный или нет) и где можешь почувствовать себя в коже виртуального персонажа, участвуя в событиях игры как очевидец или даже как настоящий актёр в главной роли. Это всё равно как играть в театре на какой то сцене, не зная текста и сюжета, но зато постепенно узнаём всё лично, вмешиваемся когда захотим и даже можем менять финал в нашу пользу.</span><br /><span>Соответственно, будучи синтетическим искусством (</span><i>составным</i><span>), интерактивографическое искусство похоже на театр, где мы сами играем как актёры, да ещё снимаемся на виртуальных киноплощадках. К тому же в играх можем и танцевать, петь, слушать музыку, строить как архитекторы, рисовать и т.д., любоваться прекрасным и высоким искусством или же просто дурачится и бродить.</span><br /><br /><span>Всё же&nbsp;</span><b><i>интерактивогр&aacute;фия</i></b><span>&nbsp;предлагает нам намного больше возможностей, чем театр или кинематогр&aacute;фия, постоянно развивается и я даже позволю себе сказать, что это относительно новое искусство является сейчас наиболее важным для человечества, чем другая форма искусства!</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600b50903e3.jpg\" alt=\"\" /></p>\r\n<h4>Краткая история, взаимосвязи</h4>\r\n<p><br /><span>Поскольку&nbsp;</span><b><i>интерактивография</i></b><span>&nbsp;является синтетическим искусством (</span><i>составным</i><span>), оно также имеет много общих касательных связей (</span><i>взаимосвязей</i><span>) с определёнными формами искусства, в основном с кинематогр&aacute;фией.</span><br /><br /><span>К примеру, в первые десятилетия существования кинематографии некоторые критики и деятели искусства утверждали, что эта &laquo;новая&raquo; форма искусства является всего лишь слабой имитацией театра и на большее не будет способна. Но по мере развития технологий, в фильмах появились звуки и музыка, цвета, даже впечатление глубины (</span><i>стерео-видение или так называемая 3D vision</i><span>). Возможно, со временем появятся другие осязания, новые возможности и другие технические чудачества.</span><br /><br /><span>Сейчас, если посмотрим на короткую историю игр, с первых полуцифровых игровых приставок (</span><i>какими были Pong, Magnavox Odissey и т.д.</i><span>) и до последних поколений приставок и современных персональных компьютеров, мы можем наблюдать эволюцию&nbsp;</span><i><b>интерактивографии</b></i><span>&nbsp;в полном масштабе, которая ещё продолжается. Мы увидели появление не только звуков и цветов в играх, но и потрясающая развитие графики, а также разных манипуляторов для интерактивности. Но самое главное, мы увидели потрясающее развитие продуктов&nbsp;</span><b><i>интерактивографии</i></b><span>&nbsp;&ndash; игр &ndash; от простых чёрно-белых спортивных симуляторов, до целых художественных или документальных работ с миллионными бюджетами, с отдельными сюжетами как в фильмах и фотореалистичной графикой. Само собой, над интерактивографическим искусством нависла целая волна негативной критики со стороны тех кто её не понял и не взлюбили, но ведь понимаем что не такие критики останутся в истории, а лишь те, кто понимают это искусство и обожают его.</span><br /><br /><span>Таким образом, развитие&nbsp;</span><b><i>интерактивографии</i></b><span>&nbsp;зависит много от научно-технического прогресса, в основном от цифровой компьютеризированной техники, которая предлагает нам не только мощные и более совершенные аппараты, но и новые возможности взаимодействия в виртуальных мирах.</span><br /><span>К тому же, некоторые кинематографические методы широко применяются в играх, как, например, видео сцены, снятые вживую (</span><i>документальные или с актёрами</i><span>) или же с помощью виртуальных съёмочных камер внутри самих игр &ndash; так называемые &laquo;кат-сцены&raquo; (</span><i>cut-scene, cinematic sequences</i><span>).</span><br /><br /><span>Интерактивографические жанры также идентичны жанрам кино и театра, даже если некоторым кажется, что в играх больше жанров. На самом деле, &laquo;большое&raquo; число этих жанров продиктованы методами взаимодействий (</span><i>то есть, интерактивными методами</i><span>) в виртуальных мирах. Я бы не стал перечислять все эти интерактивные жанры, просто выделю некоторые из них:</span><br /><br /><span>&mdash; К примеру, если игрок может взять оружие в руках и пострелять, тогда такой жанр будет называться &laquo;стрелялка&raquo; (</span><i>&laquo;shooter&raquo;</i><span>). Если сможем ездить на автомобиле, тогда этот жанр &ndash; &laquo;гонка&raquo; или &laquo;автосимулятор&raquo; (</span><i>&laquo;racing&raquo;</i><span>), ну а если возьмём саблю и пройдём ею всю игру, то этот интерактивный жанр будет называться &laquo;слэшер&raquo; (</span><i>&laquo;slasher&raquo;</i><span>). Можно привести в пример ещё много таких интерактивных жанров и поджанров, но ничто на свете не заменит художественные жанры, хотя и малочисленные, такие как &ndash; комедия, трагедия, драма, мелодрама &ndash; они до сих пор являются основой любого художественного произведения кинематографии, театра или интерактивографии.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600b624aeb7.jpg\" alt=\"\" /></p>\r\n<p><span>Сейчас, если спросите, &laquo;почему термин&nbsp;</span><b><i>интерактивогр&aacute;фия</i></b><span>&nbsp;&ndash; правильный с научной точки зрения?&raquo;, я скажу, что ответ простой. К примеру, посмотрите, что является самым главным в искусстве кинематографа, что стоит у его основы &ndash; это движение коротких фрагментов изображения с (</span><i>или из</i><span>) видео носителя, образуя нам иллюзию общего движения изображения на экране, чтобы созерцать действие фильма.</span><br /><br /><span>В играх мы в первую очередь взаимодействуем с объектами из виртуального изображения на экране (</span><i>действуя почти как актёры</i><span>), данная интерактивность (</span><i>взаимодействие</i><span>) основана на компьютерной графике. Даже если эта графика запрограммирована и возможность взаимодействовать тоже продиктована программными кодами, всё же надо учитывать, что игры &mdash; это не просто какие-то мультимедийные программы или развлечение для офисной работы, а в первую очередь представляют современный вид искусства, в котором автор (</span><i>геймдизайнер, сценарист, разработчик</i><span>) выражает своё художественное видение и философию, перед зрителем-игроком приоткрывает душу, рассказывает ему сюжет и показывает судьбу некоторых персонажей. Разве это обычная программа?</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600b764d300.jpg\" alt=\"\" /></p>\r\n<p><span>Наверно кто-то может спросить: &laquo;Ладно, а как же обстоят дела со спортивными состязаниями, симуляциями транспорта и других вещей менее художественных? Или с &bdquo;играми&ldquo; типа РПГ, проведённые в реальной жизни с реальными людьми или же состязания в пейнтбол с перестрелками, ну или казино-игры? Как же с ними?&raquo;</span><br /><br /><span>На это я вам отвечу, снова обращаясь к аналогии: посмотрите на кинопродукцию. Что у них замечаем?</span><br /><span>Существуют документальные фильмы, в которых рассказывается о жизни определённых людей. Мы видим историю целых народов, видим спортивные состязания с людьми в движении или на разном транспорте, наконец, видим широкий спектр разнообразных событий, элементов жизни и истории человечества, снятых на камеру &mdash; и всё это &laquo;собрано&raquo; сначала на бумаге каким-нибудь кинематографистом или репортёром и затем сплетёно в логическую очерёдность изображений, которую мы потом созерцаем на экране.</span><br /><span>Так что кинематография &mdash; это комплексное искусство, составленное из художественных фильмов, документальных фильмов (</span><i>которые подразделяются на простые видео репортажи, до серьёзных &laquo;документалок&raquo;</i><span>), снятые по заранее написанным сценариям и с реальными людьми в кадре (</span><i>а в последнее время даже с виртуальными людьми</i><span>).</span><br /><br /><span>Что же замечаем у&nbsp;</span><b><i>интерактивографии</i></b><span>? Примерно такая же ситуация &ndash; есть художественные и документальные произведения. Эти работы могут быть доступны на разных электронно-цифровых устройствах, одним или несколькими игроками. У этих произведений есть графические интерфейсы, всё основано на 2D или 3D графике и на программные языки.</span><br /><br /><span>&ndash; Имеют ли все эти цифровые элементы что-нибудь общее с тем, что происходит в реальной жизни, на спортивных состязаниях, в казино и могут ли те игры, проведённые в реальной жизни, быть добавленными в ряды интерактивного искусства? У меня только один ответ: нет!</span><br /><br /><span>&ndash; Спорт, авто состязания, пейнтбол, игры казино, даже игры РПГ проведённые в реальности (</span><i>составленные отдельно или же вдохновлённые из интерактивографических игр</i><span>) являются отдельными культурными феноменами. Они могут вдохновить игровых разработчиков, соответственно, могут являться лишь источником вдохновения.</span><br /><br /><span>Ну а что касается виртуальных спортивных состязаний, симуляторов автомобилей или другого типа, то эти феномены из мира цифровых электронных игр могут быть запросто добавлены к интерактивографии, как документальная часть этого искусства. С другой стороны, некоторые элементы виртуальных спортивных состязаний могут представлять из себя художественный интерес и ценность, например &ndash; графические интерфейсы, гeймдизайн и даже методы интерактивности (</span><i>взаимодействия</i><span>).</span><br /><br /><span>Ну а если кому-то показалось, что я слишком несправедлив к определённым феноменам, имеющим очень близкое отношение к цифровым играм, таким как РПГ, упомянутым выше, или же к карточным играм, основанным на сюжетах (</span><i>кстати, кто не знает, подтверждаю, что есть и такие!</i><span>), в конце концов эти игры можно систематизировать как &laquo;аналоговые игры&raquo; и они могут представлять художественные и культурные ветви, возникшие или вдохновлённые из общей области и формы искусства &ndash;&nbsp;</span><i><b>интерактивографии</b></i><span>. Вполне возможно, некоторые из этих &laquo;аналоговых&raquo; ветвей со временем смогут преобразоваться в отдельные формы искусства, как в своё время было с кинематографией, возникшей из театра.</span><br /><habracut></habracut><br /><br /></p>\r\n<h4>Заключение</h4>\r\n<p><br /><span>Как бы ни было странно, но некоторым людям игры могут предоставить не только возможность попробовать что-нибудь, на что они не способны в реальной жизни, но и уникальное чувство чуда и красоты реального мира. В реальной жизни мы часто не замечаем и не восхищаемся миром, что нас окружает, и только когда окунаешься с головой в виртуальный мир игры, нам открываются глаза перед такими феноменами, как движения руками, ногами, возможность взять что-то или бросить, включить, выключить, гонятся, ходить, ездить на машине, лететь и т.д&hellip; Свет, что проникает сквозь листья, утренний туман или частички пыль, что реют в лучах солнца и т.д. и т.п&hellip; В некотором смысле, открывая заново для каждого те возможности и элементы реальной жизни, на которые мы порой не обращаем внимания, только в играх мы замечаем, насколько они важные и особенные.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600b8c5eda8.jpg\" alt=\"\" /></p>\r\n<h4>На заметку</h4>\r\n<p><br /><span>В науке существуют такие общепринятые термины (</span><i>и научные, естественно</i><span>), как&nbsp;</span><b>феномен</b><span>&nbsp;и&nbsp;</span><b>объект</b><span>&nbsp;(</span><i>оно же вещь</i><span>). Так что, с научной точки зрения, кое-что в этом мире можно назвать&nbsp;</span><b>феноменом</b><span>, а кое что &mdash;&nbsp;</span><b>объектом</b><span>.</span><br /><span>Например,&nbsp;</span><b>футбол</b><span>&nbsp;&mdash; это&nbsp;</span><i>феномен</i><span>&nbsp;(</span><i>спортивный и культурный</i><span>), а&nbsp;</span><b>мяч</b><span>&nbsp;&ndash; это&nbsp;</span><i>объект</i><span>&nbsp;(</span><i>с которым играешь, само собой</i><span>).</span><br /><span>Так что, то, во что играешь, правильно назвать не игрушкой, а игрой. Всё потому, что с научной точки зрения (</span><i>и это правильно!</i><span>),&nbsp;</span><b>игра</b><span>&nbsp;&mdash; это&nbsp;</span><i>феномен</i><span>, а&nbsp;</span><b>игрушка</b><span>&nbsp;&ndash; это&nbsp;</span><i>объект</i><span>.</span><br /><span>Вот, например, такие известные аппараты как &laquo;PlayStation Portable&raquo; или &laquo;Nintendo DS&raquo; являются&nbsp;</span><b>игрушками</b><span>&nbsp;(</span><i>то есть</i><span>,&nbsp;</span><i>объектами</i><span>), ну а то, во что играешь, используя их &ndash; это уже&nbsp;</span><b>игры</b><span>&nbsp;(</span><i>то есть</i><span>,&nbsp;</span><i>феномены</i><span>).</span><br /><span>Так что пожалуйста, не путайте одно с другим!</span><br /><b>....................</b><br /><span>И ещё &ndash; существуют два вида мировоззрений &ndash;&nbsp;</span><b><i>объективное</i></b><span>&nbsp;и&nbsp;</span><b><i>субъективное</i></b><span>. Самыми простыми словами их можно описать так: одни видят мир таким, какой он есть на самом деле (</span><i>в основном это учёные, бизнесмены и т.д.</i><span>) &ndash; это&nbsp;</span><i><b>объективное</b></i><span>&nbsp;мировоззрение; другие видят мир так, как им самим этого хочется (</span><i>религиозные верующие, большинство философов и т.д.</i><span>) &ndash; это уже&nbsp;</span><i><b>субъективное</b></i><span>&nbsp;мировоззрение.</span><br /><span>Я, автор данной статьи, определяю себя как человек из первой группы.</span><br /><span>Другим людям советую сначало определится со своим мировоззрением, потом можете начинать что-то серьёзно анализировать и делать выводы.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600ba0c5c13.jpg\" alt=\"\" /></p>\r\n<h4>Уместное время для игры</h4>\r\n<p><br /><span>Все мы заметили, что многие игроки слишком много времени уделяют своим любимым играм &ndash; от 10-ти часов и более. Некоторые вообще торчат целыми днями над игрой, не отдыхая вовсе.</span><br /><span>Припоминается случай со смертельным исходом, когда один заядлый игрок погиб, после нескольких дней непрерывной игры, без отдыха. Во что он играл уже не имеет значение. Проблема в том, что у этого игрока полностью отсутствовало нормальное воспитание, касательно времени для игры, для отдыха, касательно физического и психологического здоровья, не говоря уже о личной жизни.</span><br /><span>Касательно этой темы появляется элементарный вопрос: сколько времени нужно уделять игре?</span><br /><span>Немного парафразирую: какое количество времени считается нормальным, чтобы играть?</span><br /><span>Я сам (</span><i>автор этой статьи</i><span>), будучи заядлым игроком, давно уже пришёл к выводу касательно этой темы и уже ответил себе на данный вопрос, мучительный для многих. Мои рекомендации следующие:</span><br /><br /><i>Играть</i><span>&nbsp;</span><b>2 часа</b><span>&nbsp;в день (</span><i>и только!</i><span>): в рабочие дни (</span><i>обычно с понедельника по пятницу</i><span>);</span><br /><br /><i>Играть</i><span>&nbsp;</span><b>5 часов</b><span>&nbsp;в день (</span><i>и только!</i><span>): на выходные или в свободные дни (</span><i>будь то в субботу или на воскресенье, к примеру</i><span>);</span><br /><br /><i>Играть</i><span>&nbsp;</span><b>8 часов</b><span>&nbsp;в день: только для специалистов, которые занимаются анализом игр (</span><i>создание рецензий, видео или текстовые и т.д.</i><span>), соответственно, для игровых разработчиков, журналистов или учёных, которые изучают игры. Ну и для киберспортсменов, если таковыми являются. Восемь часов &mdash; это как раз нормальное время для рабочего дня. Если кто-то будет работать больше 10-ти или 12-ти часов в сутки, это уже может привести к серьезным проблемам со здоровьем.</span><br /><span>В общем, это и есть нормальное время для игры &ndash; от 2-х до 8-ми часов в день, в зависимости от обстоятельств. Я даже рекомендую играть по чаще, но потратив на это занятие лишь определённое, уместное количество времени! И это всегда будет заряжать вас положительной и конструктивной энергией, снизит стресс, немного оторвёт от рутины, помогая даже увидеть свои проблемы в другом свете, пути к их решению, поможет вам подготовиться к серьёзным проектам или к напряжённой работе.</span><br /><span>И это совсем не шутка, а вполне серьёзно. Запомните, пожалуйста:</span><br /><br /><span>&ndash; Да, игры могут вам помочь легче решить проблемы!</span><br /><span>&ndash; Да, игры могут вас зарядить положительной и конструктивной энергией!</span><br /><span>&ndash; Да, игры могут вам помочь собраться с мыслями для напряжённой работы!</span><br /><br /><span>Но только в том случае, если вы потратите на игры лишь определённое, уместное количество времени.</span><br /><span>Будьте бдительны, пожалуйста, ведь здоровье очень ценно, к тому же, природа дарит нам жизнь лишь один раз. Само собой понятно, что если теряете своё здоровье и жизнь, тогда потеряете и шанс сыграть в несметное количество игр, которые появляются со временем.</span><br /><span>Запоминайте, какое количество часов считается нормальным для игры и тогда это время сыграет в вашу пользу.</span></p>\r\n<h4>Дополнение к заметкам</h4>\r\n<p><br /><span>Да, кстати. Некоторые сторонние наблюдатели отрицательно критикуют игры за то, что многие рьяные игроки забывают о своём здоровье и полностью отдают себя игре, а также совершают злобные действия, которые заметны в некоторых играх.</span></p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600bbe96a0d.jpg\" alt=\"\" /></p>\r\n<p><br /><br /><span>Мой вам ответ: а причём тут игры!? Как будто мало на свете любителей всяких сериалов и жутких фильмецов, всяких (</span><i>тупых и не очень</i><span>) телепередач?! И эти любители готовы ночи напролёт смотреть &laquo;ящик&raquo; и жрать попкорн с бутербродами, заполняя своё тело и душу всякой гадостью. Любители тратить своё время впустую и во вред своему здоровью найдутся всегда и везде &mdash; и это совершенно не зависит от вида искусства, продукты которого они &laquo;потребляют&raquo;.</span><br /><span>Всё дело в самом человеке, в его семье и в обществе, продуктом которого он сам и является. Если какому то человеку не привили чувство меры, знание и чувство заботы о своём здоровье, толерантность и уважение к людям, то это уже проблемы как этого человека, так и общества, в котором живёт. И пусть не впутают в их проблемы ещё и виды искусства, а пусть по человечески объяснят, нормально и логично, пусть учат как жить с мерой ко всему, с заботой о себе и к близким.</span><br /><span>&ndash; Играйте, радуйтесь, живите сполна и не забывайте о мере.</span></p>', 41, 'uploads/images/2022/10/image_750x500_63600b2c22d39.jpg', 'uploads/images/2022/10/image_750x_63600b2c3011e.jpg', 'uploads/images/2022/10/image_600x460_63600b2c3d1e2.jpg', 'uploads/images/2022/10/image_380x226_63600b2c471d8.jpg', 'uploads/images/2022/10/image_140x98_63600b2c4e2c9.jpg', 'jpg', 'local', '', 16, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-31 19:55:14'),
(954, 1, 'Изучаем инструменты для работы с ARP протоколом', 'izuchaem-instrumenti-dlya-raboti-s-arp-protokolom', NULL, '', 'Статья расскажет об очень простом протоколе, который может быть использован для атак на сети. Рассмотрим из чего состоит протокол и какие инструменты есть для работы с ним.', '<h3>ARP основные данные</h3>\r\n<p>Address Resolution Protocol (ARP) - протокол, который позволяет определить MAC адрес устройства по известному IP адресу, хотя можно используя протокол просто собрать все данные о подсети.</p>\r\n<p>Протокол уже известен почти 40 лет! (Рассматриваем IPv4 версию) Описание протокола находится в<span>&nbsp;</span><a href=\"https://www.rfc-editor.org/rfc/rfc826\">RFC 826</a>. У RFC было несколько апдейтов, которые касались различных частей протокола, вот некоторые их них:</p>\r\n<ul>\r\n<li>\r\n<p><a href=\"https://www.rfc-editor.org/rfc/rfc5227\">RFC 5227</a><span>&nbsp;</span>- рекомендации по устранению проблем с конфликтами адресов, если несколько устройств используют один и тот же IP адрес,</p>\r\n</li>\r\n<li>\r\n<p><a href=\"https://www.rfc-editor.org/rfc/rfc5494\">RFC 5494</a><span>&nbsp;</span>- описание расширений, которые можно использовать для работы с различными протоколами. Среди них: HYPERChannel, DHCP options, ATM ARP, HARP, Dual Mac FDDI, MAPOS, FC, DNS DHCID,</p>\r\n</li>\r\n</ul>\r\n<p>Всю работу протокола можно условно разделить на 3 шага, которые он должен обрабатывать всякий раз как операционные системы или устройства в сети стараются собрать информацию о подсети. Ниже приведем список шагов:</p>\r\n<ol>\r\n<li>\r\n<p>Устройство, которое используется для сбора данных собирает специальный запрос, который будет рассылаться для всей подсети.</p>\r\n</li>\r\n<li>\r\n<p>Все хосты подсети получив запрос должны ответить, если запрашиваемые данные совпадают с их характеристиками (MAC или IP адрес).</p>\r\n</li>\r\n<li>\r\n<p>Если данные запроса совпали с данными того, кто принял запрос, то он должен ответить парой значений MAC адрес и IP адрес.</p>\r\n</li>\r\n</ol>\r\n<p>Полученные данные должны быть сохранены в структуре -<span>&nbsp;</span><code>ARP таблице</code>. В зависимости от имплементации эта таблица может обновляться, а может быть заполнена один раз и использоваться постоянно, пока устройство подключено к сети. Кстати, таблицу ARP во всех популярных операционных системах можно вывести командами:</p>\r\n<pre><code>arp -a</code></pre>\r\n<p>Или</p>\r\n<pre><code>ip neigh</code></pre>\r\n<p>Структура пакета, который используется для работы с протоколом:</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600efcb38ca.jpg\" alt=\"\" /></p>\r\n<h3>Инструменты для взаимодействия и проведения атак</h3>\r\n<p>Разобьём набор инструментов для работы с протоколом на несколько классов:</p>\r\n<ol>\r\n<li>\r\n<p>Исследование данных</p>\r\n</li>\r\n<li>\r\n<p>Создание и манипуляция параметрами пакетов</p>\r\n</li>\r\n<li>\r\n<p>Инструменты для проведения атак</p>\r\n</li>\r\n</ol>\r\n<h4>Исследование данных</h4>\r\n<p>Собрать данные с RFC и теоритически представлять из чего состоит пакет это только половина дела, теперь нужно посмотреть на имплементацию, так как она иногда отличается. Для этого можно использовать инструменты, которые называют снифферами. Самые популярные из них:</p>\r\n<ul>\r\n<li>\r\n<p>WireShark</p>\r\n</li>\r\n<li>\r\n<p>tcpdump</p>\r\n</li>\r\n</ul>\r\n<p>Инструменты представляют собой интерфейс, который позволяет посмотреть конкретные данные, которые заполняют участники сети. Ниже приведен вариант разобранного пакета ARP, открытого в WireShark:</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600f1e2944b.jpg\" alt=\"\" /></p>\r\n<p>Благодаря интерфейсу приложения можно проводить анализ того насколько корректно работает протокол с точки зрения RFC и можно попытаться найти данные, которые могли быть использованы для дестабилизации работы сети. Тестовые данные, которые были записаны для отображения можно найти<span>&nbsp;</span><a href=\"https://wiki.wireshark.org/uploads/__moin_import__/attachments/SampleCaptures/arp-storm.pcap\">тут</a>.</p>\r\n<h4>Создание и манипуляция параметрами пакетов</h4>\r\n<p>Этот набор инструментов подразумевает низкоуровневую работу со структурой пакетов. Поэтому инструменты либо будут представлять собой библиотеки для работы с сетевыми интерфейсами и протоколом, либо это специализированный софт, который может позволять манипулировать отдельными полями пакета.</p>\r\n<p>Самой популярной библиотекой-инструментом можно считать<span>&nbsp;</span><a href=\"https://scapy.net/\">Scapy</a>. Это и библиотека и интерактивный инструмент одновременно, с его, помощью зная только основные элементы языка программирования Python, можно заполнять все поля пакетов и отправлять их в сеть.</p>\r\n<p>Пример созданного пакета в Scapy:</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600f3205542.jpg\" alt=\"\" /></p>\r\n<p>Попробуем сделать кастомный пакет и отправить в сеть, в качестве теста используется сеть 192.168.0.1/24, запрос будем отправлять для несуществующего устройства по адресу 192.168.0.111. Листинг мини приложения будет таким:</p>\r\n<pre><code class=\"python hljs\">packet = ARP(pdst=<span class=\"hljs-string\">\'192.168.0.111\'</span>)\r\nsend(packet)</code><br /><br /></pre>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600f61ce799.jpg\" alt=\"\" /></p>\r\n<p>Для примера именно готового инструмента приведем nping - инструмент, который позволяет работать с различными протоколами, среди них есть ARP. Чтобы повторить запрос, который делали из Scapy, можно использовать вот такую команду:</p>\r\n<pre><code>sudo nping --arp --arp-target-ip=\'192.168.0.111\' 192.168.0.1</code></pre>\r\n<p>Результат работы команды:</p>\r\n<p><img src=\"https://itfox-tm.ru/uploads/images/2022/10/image_750x_63600f8387bd9.jpg\" alt=\"\" /></p>\r\n<h4>Инструменты для проведения атак</h4>\r\n<p>Как ни странно, хоть ARP один из самых простых протоколов, он является очень важным в проведении MiTM атак. Причем с помощью этого протокола происходит 90% задачи по перехвату трафика в сети, а уже оставшиеся 10% доделывают остальные инструменты и обработчики более высокоуровневых протоколов.</p>\r\n<p>То есть для проведения ниже перечисленных атак, нужно, чтобы была произведена атака на протокол ARP, а уже далее отправлялись данные, которые приносят пользу от проведенной атаки. К атакам, которые используют ARP в качестве основы можно отнести:</p>\r\n<ul>\r\n<li>\r\n<p>ARPSpoofing</p>\r\n</li>\r\n<li>\r\n<p>DNSSpoofing (в локальной сети)</p>\r\n</li>\r\n</ul>\r\n<p>Механизм атак достаточно прост, для успеха нужно чтобы трафик сети проходил через точку, которую контролирует злоумышленник. Для этого он может генерировать большое количество однотипных ARP пакетов, которые имеют определенные значения внутри.</p>\r\n<p>В ARP протоколе существует всего 2 вида запросов, это запрос, который ищет соответствие MAC и IP адреса и ответ на этот запрос.</p>\r\n<p>Если в неограниченном количестве продолжать генерировать ответы, которые содержат информацию о разных IP адресах и одном MAC адресе, то таким образом можно добиться обновления данных о маршруте у всех систем сети и заставить отправлять данные через тот MAC+IP, который постоянно мелькает в сети.</p>\r\n<p>Практически атака может быть реализована с помощью следующих инструментов:</p>\r\n<ul>\r\n<li>\r\n<p>scapy</p>\r\n</li>\r\n<li>\r\n<p><a href=\"https://www.bettercap.org/\">bettercap</a></p>\r\n</li>\r\n<li>\r\n<p><a href=\"https://github.com/smikims/arpspoof\">arpspoof</a></p>\r\n</li>\r\n</ul>\r\n<p>В списке представлены только те инструменты, которые имеют достаточно хорошую документацию и были протестированы на работоспособность. Ниже приведем способы проведения атак.</p>\r\n<p>(ПЕРЕД ТЕМ КАК НАЧАТЬ ТЕСТИРОВАТЬ РЕАЛЬНЫЕ СЕТИ: сразу пытаться обрабатывать большие сети больше /24 маски может быть проблематично). Чтобы подготовить машину, рекомендуется сделать небольшую настройку:</p>\r\n<pre><code>sudo sysctl -w net.ipv4.ip_forward=1\r\n\r\nsudo ip link set eth0 promisc on\r\n\r\nsudo iptables -t nat -A POSTROUTING -o eth0 -j MASQUERADE\r\n\r\nsudo modprobe nf_conntrack\r\n\r\necho \"1\" &gt; /proc/sys/net/netfilter/nf_conntrack_helper\r\n</code></pre>\r\n<p>Команды выше обычно используются для настройки NAT обработки, в таком виде можно будет обрабатывать трафик от большого количества хостов и не нарушать хотя бы первое время работу тестируемой сети. Все настройки выше нужно производить самостоятельно, ни один из перечисленных инструментов для проведения атак их не ставят.</p>\r\n<p>Как запускать инструменты для тестирования:</p>\r\n<p>Scapy - пример скрипта, который может проводить атаки на DNS и ARP можно найти<span>&nbsp;</span><a href=\"https://github.com/sania454/Module-2\">тут</a></p>\r\n<p>arpspoof:</p>\r\n<pre><code>arpspoof -r ip ip.vi.c.tim ip.dest.i.na.tion</code></pre>\r\n<p>bettercap:</p>\r\n<pre><code>set arp.spoof.targets ip.of.subnet.ot.victim\r\narp.spoof on</code></pre>\r\n<h3>Механизмы защиты</h3>\r\n<p>Защита от перенаправления трафика может быть реализована за счет нескольких инструментов:</p>\r\n<ol>\r\n<li>\r\n<p>Само оборудование, которое используется для построения сети. На сегодняшний день практически все устройства позволяют обнаруживать аномалии протокола ARP. Поэтому может быть проблематично редиректить трафик так как устройство просто отключит порт.</p>\r\n</li>\r\n<li>\r\n<p>Использование стороннего софта, который мониторит трафик сети. Небольшой список таких инструментов можно найти в сети в огромном количестве. К примеру вот<span>&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/ARP_spoofing#Defense\">такой</a>.</p>\r\n</li>\r\n</ol>\r\n<p>Иногда настройкой и установкой даже одного из перечисленных способов пренебрегают и у злоумышленников появляется шанс перехватывать и модифицировать трафик.</p>', 1, 'uploads/images/2022/10/image_750x500_63600fd09b1e9.jpg', 'uploads/images/2022/10/image_750x_63600fd0a5fbb.jpg', 'uploads/images/2022/10/image_600x460_63600fd0af67d.jpg', 'uploads/images/2022/10/image_380x226_63600fd0b6db2.jpg', 'uploads/images/2022/10/image_140x98_63600fd0bbe90.jpg', 'jpg', 'local', '', 18, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-31 20:11:56'),
(955, 1, 'Падающие проды, соискатели-мошенники, нейросети: собрали страхи разработчиков', 'padayushchie-prodi-soiskateli-moshenniki-neyroseti-sobrali-strakhi-razrabotchikov', NULL, '', 'В честь Хэллоуина мы поговорили о страхах с разработчиками, директорами по продукту, техническими топ-менеджерами и другими нашими друзьями и коллегами. Оказалось, они не боятся самой страшной ночи в году, зато имеют множество профессиональных страшилок за плечами. Что они нам рассказали?', '<div data-gallery-root=\"\" class=\"tm-article-body\" lang=\"ru\">\r\n<div id=\"post-content-body\">\r\n<div>\r\n<div class=\"article-formatted-body article-formatted-body article-formatted-body_version-2\">\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<p><strong>Кирилл Кошаев, автор курса Skillbox &ldquo;Java-разработчик PRO&rdquo;:</strong></p>\r\n<p>&ldquo;По долгу службы приходится сталкиваться с разными, я бы сказал, экстремальными ситуациями. Именно они и вызывают страх. Боюсь не успеть подхватить вовремя падающий прод, а еще больше &mdash; не успеть его поднять до того, как новость дойдет до генерального директора. Страшно обнаружить рухнувший на проде сервис за 5 минут до конца рабочего дня, особенно ошибки с тегом &ldquo;timeout&rdquo;. Получается из разряда &ldquo;пойди туда, не знаю куда, принеси то, не знаю что&rdquo; и приходится проверять всю цепочку логики. Ну, а самое любимое &mdash; звонок от топ-менеджмента в 5 утра. Скорее всего, клиент из Омска получил ошибку при запросе&rdquo;.</p>\r\n<p><strong>Александр Чернов, руководитель управления информационных технологий &ldquo;Много лосося&rdquo;:</strong></p>\r\n<p>&ldquo;У любого человека есть своеобразные профессиональные страхи, и это нормально. Лично я очень боюсь, что у кого-то в совете директоров окажется новый Google Pixel, на котором наше Android-приложение крашится. Мы уже в процессе исправления проблемы, но пока страшно. А в новых реалиях волнение вызывает потенциальный уход с российского рынка иностранного вендора, ПО которого используется в нашей системе. Особенно если это произойдет в пятницу вечером&rdquo;.</p>\r\n<p><strong>Александр Сербул, руководитель направления контроля качества интеграции и внедрений Битрикс24:</strong></p>\r\n<p>&ldquo;Главный страх разработчиков &mdash; просьба друзей починить технику. Многие думают, если ты работаешь с компьютером, следовательно, ты и мастер в ремонте. Хоть я сейчас и иронизирую, но иногда такие ситуации действительно случаются. Больше всего мы боимся ошибок в коде и риска потери данных. Но в отличие от навязчивых знакомых, от этой фобии можно избавиться. Разрабатывайте простые и понятные программы, ведь сложно не означает надежно. А чтобы быть уверенным на 100% &mdash; всегда пишите автотесты&rdquo;.&nbsp;&nbsp;</p>\r\n<p><strong>Глеб Михеев, CTO Skillbox Holding:</strong></p>\r\n<p>\"У меня есть большой страх уйти в менеджмент, перестать кодить и спустя пару лет стать ненужным. Ведь HR звонят только разработчикам\".</p>\r\n<p><strong>Александр Хакимов, Android Team Lead Grow Food:</strong></p>\r\n<p>&ldquo;Страхи есть, причем как реальные, так и надуманные. Конечно, боюсь нанять не того человека. С учетом того, что команда у нас совсем небольшая, цена такой ошибки очень высока. И очень боюсь нейросетей. Вдруг они научатся &ldquo;красить и двигать кнопочки&rdquo; вместо меня&rdquo;.</p>\r\n<p><strong>Николай Андреев, CPO &ldquo;Кухни на районе&rdquo;:</strong></p>\r\n<p>&ldquo;Один из самых больших страхов директора по продукту в фудтехе &mdash; в этой сфере сложная экономика, поэтому инвесторы могут внезапно отказаться от вложений в проект. Есть и продуктовые страхи. Например, ты потратишь кучу времени на улучшения, а пользователям не понравится, и придется откатывать приложение к прошлой версии. Еще боюсь, что обновления нарушат работу уже отлаженных процессов, или операционка не вывезет поток новых заказов. Есть и страхи, связанные с человеческим фактором. Очень опасаюсь новых людей в команде &mdash; бывает, что они снижают продуктивность целого отдела. А вишенка на торте &mdash; соискатель окажется мошенником. Не поверите, но такие кейсы были&rdquo;.</p>\r\n<p><strong>Алексей Некрасов (<a class=\"mention\" href=\"https://habr.com/users/znbiz\">@znbiz</a>), лидер направления Python в МТС, программный директор направления Python в Skillbox:</strong>&nbsp;</p>\r\n<p>&ldquo;Больше всего боюсь, что сломается рабочий компьютер, а я не успел сохранить данные в облако&rdquo;.</p>\r\n<p><strong>Артем Воскобойник, старший Java-разработчик в компании &ldquo;Метр квадратный&rdquo;:</strong></p>\r\n<p>&ldquo;Не могу сказать, что страхи присутствуют постоянно, но вспомнил пару таких ситуаций. Иногда приходится чинить баг прямо на проде, вот в этот момент начинаешь бояться одним неверным движением уронить всю систему. А из глобального &mdash; первый раз реализовывать очень крупный проект самостоятельно&rdquo;.</p>\r\n<p><strong>Даниил Пилипенко, программный директор направления &ldquo;Backend-разработки&rdquo; в Skillbox, директор центра подбора IT-специалистов SymbioWay:</strong></p>\r\n<p>&ldquo;У любого человека есть какие-то страхи. Но бывают и чисто профессиональные, наиболее свойственные людям той или иной профессии. У программистов они тоже есть. Пожалуй, основной страх практически любого программиста, особенно начинающего, &mdash; не уложиться в сроки. Ты можешь думать, что правильно рассчитал время, но при выполнении задачи обнаружатся какие-то детали, которые невозможно было учесть при оценке сроков. Второй страх программиста состоит в том, что написанный им код может внезапно сломаться. Особенно страшно, что он может сломаться из-за того, что программист что-то упустил или ошибся. Третий страх &mdash; устаревание хорошо знакомого и \"любимого\" языка программирования или используемой технологии. Ведь взамен появится что-то новое и пока неизвестное, что придется изучать и к чему придется привыкать, чтобы оставаться на рынке востребованным специалистом. И ещё один типичный страх &mdash; неправильно понять ТЗ. Иногда картины мира заказчика и программиста могут сильно расходиться, поэтому очень важно проговаривать, если что-то непонятно, и работать итерациями&rdquo;.</p>\r\n<p>А чего боитесь вы: стереть код, потерять ноут или оказаться в непродуктивной команде? Делитесь своими историями в комментариях и ищите друзей по страхам!</p>\r\n<p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 1, 'uploads/images/2022/10/image_750x500_636011006451e.jpg', 'uploads/images/2022/10/image_750x_63601100774df.jpg', 'uploads/images/2022/10/image_600x460_636011008a54a.jpg', 'uploads/images/2022/10/image_380x226_636011009b48d.jpg', 'uploads/images/2022/10/image_140x98_63601100a8b92.jpg', 'jpg', 'local', '', 21, 0, 1, 1, 1, 1, 1, 1, 0, 1, 1, 'article', NULL, 'local', '', NULL, NULL, 43, 1, NULL, NULL, 0, '', 0, NULL, '2022-10-31 20:16:39');
